INSERT INTO `skripsi_komentar` (`no`, `komentar`, `stem`, `sentimen`) VALUES
(1, 'sudah lama saya pakai aplikasi ini dan tidak pernah mengecewakan', 'sudah, lama, saya, pakai, aplikasi, ini, dan, tidak, pernah, kecewa', 1),
(2, 'semakin hari semakin keren saja aplikasinya, jadi makin mudah untuk menggunakannya', 'makin, hari, makin, keren, saja, aplikasi, jadi, makin, mudah, untuk, guna', 1);
INSERT INTO `skripsi_rekap` (`no`, `komentar`, `stem`, `sentimen`, `tgl`, `flag`) VALUES
(1, 'Aplikasi ini akan membantu dengan cara yang mudah. Ini membantu orang-orang yang tidak bisa keluar atau jauh di pasar, itu sangat berguna bagi mereka biasanya bagi saya. Pengalaman saya sangat bagus sejauh ini. Begitu banyak toko legit yang menjual produk berkualitas baik dengan harga murah. Anda harus bijak dalam menemukan toko/penjual yang bagus- Penilaian dengan gambar adalah kuncinya ï¸ Pasti salah satu toko belanja yang paling mudah dinavigasi di luar sana. Banyak penjualan, potongan harga, kupon, voucher, dan gratis.', 'aplikasi,bantu,cara,mudah,bantu,orangorang,tidak,keluar,jauh,pasar,guna,biasa,alam,bagus,jauh,banyak,toko,legit,jual,produk,kualitas,baik,harga,murah,anda,harus,bijak,temu,tokopenjual,bagus,nilai,gambar,kunci,pasti,salah,satu,toko,belanja,paling,mudah,navigasi,sana,banyak,jual,potong,harga,kupon,voucher,gratis', -1, '2022-05-24 16:10:50', 0),
(2, 'Platform belanja online ini didesain sempurna untuk kita para pelanggan yang lebih memilih berbelanja online daripada keluar rumah karena pandemi. Fitur yang paling terpuji dari aplikasi ini adalah pengirimannya, sebagian besar barang yang saya pesan untuk tanggal tertentu dikirim pada hari berikutnya.', 'platform,belanja,online,desain,sempurna,para,langgan,lebih,pilih,belanja,online,daripada,keluar,rumah,pandemi,fitur,paling,puji,aplikasi,kirim,besar,barang,pesan,tanggal,tentu,kirim,hari,ikut', -1, '2022-05-24 16:10:50', 0),
(3, 'Platform belanja online ini didesain sempurna untuk kita para pelanggan yang lebih memilih berbelanja online daripada keluar rumah karena pandemi. Fitur yang paling terpuji dari aplikasi ini adalah pengirimannya, sebagian besar barang yang saya pesan untuk tanggal tertentu dikirim pada hari berikutnya.', 'platform,belanja,online,desain,sempurna,para,langgan,lebih,pilih,belanja,online,daripada,keluar,rumah,pandemi,fitur,paling,puji,aplikasi,kirim,besar,barang,pesan,tanggal,tentu,kirim,hari,ikut', -1, '2022-05-24 16:10:50', 0),
