(61, 'Aplikasi ini sebenarnya bagus. Saya suka bagaimana mereka menempatkan \'baru-baru ini dilihat\' bagi orang-orang untuk melihat item apa yang baru saja mereka lihat. Saya suka daftar keinginan mereka juga. Secara keseluruhan, 9!', 'aplikasi,benar,bagus,suka,bagaimana,tempat,barubaru,lihat,orangorang,lihat,item,baru,saja,lihat,suka,daftar,ingin,cara,seluruh', -1, '2022-05-24 16:49:33', 0),
(62, 'Saya pelanggan setia lazada, sebenarnya hampir setiap bulan atau setiap penjualan bulanan saya memesan di sini barang-barang yang biasa saya butuhkan di rumah kami. Saya puas dengan pelayanannya bahkan kurir/pengirimnya sangat akomodatif.... Keep the good works LAZADA!!!????????????', 'langgan,setia,lazada,benar,hampir,tiap,bulan,tiap,jual,bulan,mesan,sini,barangbarang,biasa,butuh,rumah,puas,layan,bahkan,kurirpengirim,akomodatif,keep,the,good,works,lazada', -1, '2022-05-24 16:49:33', 0),
(63, 'Aplikasi ini adalah Cara terbaik dan nyaman untuk membeli semua barang yang kami butuhkan.. Semua yang Anda butuhkan, Anda dapat menemukannya di sini, tidak perlu terburu-buru pergi ke mal.. Selalu menawari kami pengiriman gratis, Banyak voucher dan gratis Dan selalu beri kami PENJUALAN Bulanan', 'aplikasi,cara,baik,nyaman,beli,semua,barang,butuh,semua,anda,butuh,anda,dapat,temu,sini,tidak,perlu,terburuburu,pergi,mal,awar,kirim,gratis,banyak,voucher,gratis,beri,jual,bulan', -1, '2022-05-24 16:49:34', 0),
(64, 'Sangat mudah memesan dan penjual napakabait ng, nagrereply jika mungkin pertanyaan tentang item sa. Mereka mengemas barang dengan aman dan dikirim tepat waktu. Hindi ka na magwoworry na magantay ng matagal kc dapat pesan teks dan email na isinesend mengenai status dan inorder. Terima kasih Lazada lebih banyak penjualan yang akan datang dan abang abang ulet sa mga item dengan diskon 50% dan obral.', 'mudah,mesan,jual,napakabait,ng,nagrereply,tanya,tentang,item,sa,emas,barang,aman,kirim,tepat,waktu,hindi,ka,na,magwoworry,na,magantay,ng,matagal,kc,dapat,pesan,teks,email,na,isinesend,kena,status,inorder,terima,kasih,lazada,lebih,banyak,jual,datang,abang,abang,ulet,sa,mga,item,diskon,obral', 1, '2022-05-24 16:49:34', 0),
(65, 'Aplikasi ini sangat bagus. Itu membuat pengalaman berbelanja saya nyaman. Saya sangat suka belanja online dan lazada adalah aplikasi belanja online favorit saya. Tuhan memberkati dan lebih banyak kekuatan!', 'aplikasi,bagus,buat,alam,belanja,nyaman,suka,belanja,online,lazada,aplikasi,belanja,online,favorit,tuhan,berkat,lebih,banyak,kuat', -1, '2022-05-24 16:49:34', 0),
(66, 'Aplikasi ini sangat membantu semua orang yang suka membeli secara online, ini adalah cara mudah untuk melihat dan meninjau setiap produk. Saya ingin merekomendasikan aplikasi ini, ini sangat membantu kami sebagai pembeli online?', 'aplikasi,bantu,semua,orang,suka,beli,cara,online,cara,mudah,lihat,tinjau,tiap,produk,ingin,rekomendasi,aplikasi,bantu,bagai,beli,online', -1, '2022-05-24 16:49:34', 0),
(67, 'Aplikasi yang luar biasa, akan lebih sering menggunakannya, tidak membuat Anda lag atau lambat saat menelusuri produk...aplikasi yang cukup stabil...', 'aplikasi,biasa,lebih,sering,guna,tidak,buat,anda,lag,lambat,telusur,produkaplikasi,cukup,stabil', -1, '2022-05-24 16:49:34', 0),
(68, 'Wow Aplikasinya bagus dengan banyak voucher dan menyenangkan untuk membeli dengan jumlah yang tepat, jadi Rating saya adalah 5 bintang karena Pengiriman pun memberikan barang dengan Cepat. teruskan', 'wow,aplikasi,bagus,banyak,voucher,senang,beli,jumlah,tepat,jadi,rating,bintang,kirim,berik,barang,cepat,terus', -1, '2022-05-24 16:49:35', 0),
(69, 'Lazada membuat belanja saya lebih mudah dan aman, saya bersyukur saya menemukan platform belanja online ini karena saya tidak perlu pergi ke mall dan supermarket hanya untuk membeli kebutuhan kita terutama pandemi ini, dan belanja saya di sini tidak pernah membosankan dan melelahkan karena Anda bisa beli apa saja (Nasa Lazada Yan) di kenyamanan rumah Anda, sangat aman???? plus banyak penghematan karena gratis, voucher diskon, voucher pengiriman gratis dan sekarang juga ada cashback???? Just WOW!', 'lazada,buat,belanja,lebih,mudah,aman,syukur,temu,platform,belanja,online,tidak,perlu,pergi,mall,supermarket,beli,butuh,utama,pandemi,belanja,sini,tidak,bosan,lelah,anda,beli,saja,nasa,lazada,y,nyaman,rumah,anda,aman,plus,banyak,hemat,gratis,voucher,diskon,voucher,kirim,gratis,ada,cashback,just,wow', -1, '2022-05-24 16:49:35', 0),
(70, 'Aplikasi yang sangat berguna... banyak diskon dan hadiah gratis... nyaman... kualitas bagus dan harga terjangkau... lebih banyak lagi promo dan gratis yang akan datang... ????????', 'aplikasi,guna,banyak,diskon,hadiah,gratis,nyaman,kualitas,bagus,harga,jangkau,lebih,banyak,promo,gratis,datang', -1, '2022-05-24 16:49:35', 0),
(71, 'Jauh lebih baik harga untuk berbelanja. Tunggu saja pesanan Anda & Anda akan senang selama ini Saya suka aplikasinya. Anda tidak akan pernah menyesalinya.', 'jauh,lebih,baik,harga,belanja,tunggu,saja,pesan,anda,anda,senang,selama,suka,aplikasi,anda,tidak,sesal', -1, '2022-05-24 16:49:35', 0),
(72, 'Pembaruan baru telah meningkatkan fitur, juga lebih mudah untuk melacak validitas voucher. Dan seperti biasa mencari item / menempatkan pesanan \'hanya dalam satu ketukan. Pandemi ngayong jangan khawatir kahit stay at home. Saya dapat meyakinkan keluarga dan teman-teman di NASA Lazada Yan!', 'baru,baru,telah,tingkat,fitur,lebih,mudah,lacak,validitas,voucher,seperti,biasa,cari,item,tempat,pesan,satu,ketuk,pandemi,ngayong,khawatir,kahit,stay,at,home,dapat,yakin,keluarga,temanteman,nasa,lazada,y', 1, '2022-05-24 16:49:36', 0),
(73, 'Semuanya baik baik saja! Terima kasih telah memperbaiki aplikasi ini. Omong-omong, ini adalah satu-satunya aplikasi yang sangat saya butuhkan setiap kali tidak ada barang yang tersedia di toko terdekat, Lazada adalah satu-satunya cara saya dapat memilih dan membeli apa pun yang saya inginkan dan ada begitu banyak produk yang saya pilih dari Nasa Lazada Yan', 'semua,baik,baik,saja,terima,kasih,telah,baik,aplikasi,omongomong,satusatu,aplikasi,butuh,tiap,kali,tidak,ada,barang,sedia,toko,dekat,lazada,satusatu,cara,dapat,pilih,beli,ingin,ada,banyak,produk,pilih,nasa,lazada,y', -1, '2022-05-24 16:49:36', 0),
(74, 'Sejauh ini pengalaman terbaik. Platform yang bagus. juga mereka memiliki banyak promo dan voucher terutama selama penjualan. Saya juga suka bahwa kurir mereka cepat. Juga seperti metode pembayaran mereka. Tidak rumit untuk digunakan.dan terbaik untuk digunakan.pengembalian dan pengembalian uang juga baik. Csnya juga bagus. ???? aplikasi bagus.????', 'jauh,alam,baik,platform,bagus,milik,banyak,promo,voucher,utama,selama,jual,suka,kurir,cepat,seperti,metode,bayar,tidak,rumit,digunakandan,baik,digunakanpengembalian,kembali,uang,baik,cs,bagus,aplikasi,bagus', -1, '2022-05-24 16:49:36', 0),
(75, 'lazadanya bagus. Saya tidak pernah memiliki masalah dalam aplikasi, pesanan saya dikirim dengan kondisi baik, saya suka perwakilan layanan pelanggan mereka yang mereka akomodasi. Tim pengiriman juga baik. Xvn.', 'lazada,bagus,tidak,milik,masalah,aplikasi,pesan,kirim,kondisi,baik,suka,wakil,layan,langgan,akomodasi,tim,kirim,baik,xvn', -1, '2022-05-24 16:49:37', 0),
(76, 'aplikasi mudah digunakan. sejauh ini saya memiliki pengalaman yang baik dalam memesan di toko online ini. mereka memberikan banyak potongan harga, voucher, diskon, dan bahkan gratis. banyak penjual mereka yang sah. terima kasih kepada aplikasi dan toko online ini??????', 'aplikasi,mudah,guna,jauh,milik,alam,baik,mesan,toko,online,berik,banyak,potong,harga,voucher,diskon,bahkan,gratis,banyak,jual,sah,terima,kasih,aplikasi,toko,online', -1, '2022-05-24 16:49:37', 0),
(77, 'Pengalaman berbelanja yang nyaman. Mereka juga memberi Anda Kredit Bayar Nanti yang besar. Harga yang luar biasa untuk pengiriman juga.', 'alam,belanja,nyaman,beri,anda,kredit,bayar,besar,harga,biasa,kirim', -1, '2022-05-24 16:49:37', 0),
(78, 'Item dalam status dikemas lebih dari seminggu dan tidak diizinkan untuk dibatalkan. Alasan - barang telah dikirim dan tidak dapat dibatalkan. Kemungkinan besar saya tidak akan membeli dari lazada lagi. Pengalaman yang sangat buruk.', 'item,status,kemas,lebih,minggu,tidak,izin,batal,alas,barang,telah,kirim,tidak,dapat,batal,besar,tidak,beli,lazada,alam,buruk', 1, '2022-05-24 16:49:37', 0),
(79, 'Aplikasi masuk saya untuk belanja online karena saya memiliki pengalaman yang baik setiap saat. Harga murah untuk barang bagus dan pengiriman cepat.', 'aplikasi,masuk,belanja,online,milik,alam,baik,tiap,harga,murah,barang,bagus,kirim,cepat', -1, '2022-05-24 16:49:37', 0),
(80, 'Cintai Aplikasi ini. Ini sangat membantu ketika pandemi dimulai. Saya telah menggunakan ini sejak 2019 dan ini sangat berguna. Saya mendapatkan lebih banyak diskon dan suka membeli di Aplikasi Lazada sehingga saya tidak perlu keluar. Terima kasih Lazada????????????', 'cinta,aplikasi,bantu,ketika,pandemi,mulai,telah,guna,sejak,guna,dapat,lebih,banyak,diskon,suka,beli,aplikasi,lazada,sehingga,tidak,perlu,keluar,terima,kasih,lazada', -1, '2022-05-24 16:49:37', 0),
(81, 'Hmm kadang grafik + warna aplikasinya bikin bingung..mungkin bisa berubah dari segi ukuran kata, susunan n sebagainya, agar terlihat lebih rapi dan bersih', 'hmm,kadang,grafik,warna,aplikasi,bikin,bingungmungkin,rubah,segi,ukur,kata,susun,bagai,lihat,lebih,rapi,bersih', -1, '2022-05-24 16:49:37', 0),
(82, 'Saya suka aplikasi ini. Begitu banyak produk untuk dipilih. Sangat nyaman digunakan, di sobrang dali lang gamitin super dali din makaipon ng poin para magamit sa pag pembelian. Secara keseluruhan sah. Saya sangat merekomendasikan aplikasi ini.', 'suka,aplikasi,banyak,produk,pilih,nyaman,guna,sobrang,dali,lang,gamitin,super,dali,din,makaipon,ng,poin,para,magamit,sa,pag,beli,cara,seluruh,sah,rekomendasi,aplikasi', -1, '2022-05-24 16:49:38', 0),
(83, 'aplikasi ini bagus ... lalo n ngaung pandemi tidak mudah pergi kemana-mana.. ini membantu kita untuk membeli apa yang kita butuhkan .. yang perlu kita lakukan hanyalah menunggu dan bersabar. untuk seller nya tolong teliti barang nya..packing dengan aman ????', 'aplikasi,bagus,lalo,ngaung,pandemi,tidak,mudah,pergi,kemanamana,bantu,beli,butuh,perlu,laku,tunggu,sabar,seller,,tolong,teliti,barang,nyapacking,aman', -1, '2022-05-24 16:49:38', 0),
(84, 'Sangat membantu untuk pembeli rumahan. Saya sudah beberapa kali memesan melalui aplikasi ini, dan sejauh ini saya hanya menemukan 2 penjual yang mengirimkan barang rusak. Terima kasih, Lazada! ????', 'bantu,beli,rumah,sudah,beberapa,kali,mesan,aplikasi,jauh,temu,jual,kirim,barang,rusak,terima,kasih,lazada', -1, '2022-05-24 16:49:38', 0),
(85, 'Mudah untuk berbelanja. Saya pesan kemarin dan hari ini sudah dikirim. Kurir lazada sangat cepat.barangnya bagus. Barang itu diamankan. terima kasih lazada .Saya tidak perlu keluar, yang saya butuhkan hanyalah di aplikasi lazada .terima kasih banyak.', 'mudah,belanja,pesan,kemarin,hari,sudah,kirim,kurir,lazada,cepatbarang,bagus,barang,aman,terima,kasih,lazada,tidak,perlu,keluar,butuh,aplikasi,lazada,terima,kasih,banyak', -1, '2022-05-24 16:49:38', 0),
(86, 'Nyaman & ramah pengguna, memiliki berbagai produk online, juga memberi kami voucher promosi dan pengiriman gratis. Di sisi lain, saya sangat berharap produk yang dijual di sini asli dan berkualitas. :)', 'nyaman,ramah,guna,milik,bagai,produk,online,beri,voucher,promosi,kirim,gratis,sisi,lain,harap,produk,jual,sini,asli,kualitas', 1, '2022-05-24 16:49:38', 0),
(87, 'Toko Belanja Online Terbaik!!! Harga Terjangkau, Pengiriman Cepat, Voucher Diskon, tidak ada yang bisa diminta. Dua jempol.', 'toko,belanja,online,baik,harga,jangkau,kirim,cepat,voucher,diskon,tidak,ada,minta,dua,jempol', 1, '2022-05-24 16:49:39', 0),
(88, 'Selalu memberi harapan palsu. Dengan penawaran yang tidak akan pernah Anda dapatkan.. Harga rendah tetapi biaya pengiriman tinggi...? Tapi pasti dapat menemukan item yang saya tidak tahu ada.', 'beri,harap,palsu,awar,tidak,anda,dapat,harga,rendah,biaya,kirim,tinggi,pasti,dapat,temu,item,tidak,tahu,ada', 1, '2022-05-24 16:49:39', 0),
(89, 'Pada awalnya saya ragu dan saya berpikir untuk tidak melanjutkan lagi karena berapa kali saya melakukan kesalahan dalam mengetik dan menekan Mengalami beberapa kesulitan karena ini pertama kalinya saya memanfaatkan aplikasi ini. tetapi saya mencoba yang terbaik untuk mendapatkan ini karena saya suka beberapa produk menunjukkan aplikasi ini. saya harap saya dapat memanfaatkan lebih banyak produk Anda, hal yang saya mampu beli. Saya melewatkan beberapa karena saya mengabaikan ini sebelumnya, tetapi ketika saya melihat produk Anda membuat saya kagum, jadi saya memutuskan untuk mencobanya. lebih banyak produk', 'awal,ragu,pikir,tidak,lanjut,berapa,kali,laku,salah,etik,nek,alami,beberapa,sulit,pertama,kali,manfaat,aplikasi,coba,baik,dapat,suka,beberapa,produk,tunjuk,aplikasi,harap,dapat,manfaat,lebih,banyak,produk,anda,hal,mampu,beli,lewat,beberapa,abai,belum,ketika,lihat,produk,anda,buat,kagum,jadi,utus,coba,lebih,banyak,produk', -1, '2022-05-24 16:49:39', 0),
(90, 'Terbaik yang pernah! Sebelumnya, saya suka shopee tetapi shopee selalu menipu saya dalam hal voucher jadi, saya mencoba lazada dan izinkan saya memberi tahu Anda, saya sangat senang dengan aplikasi ini! Semuanya jelas tentang voucher. Saya juga dapat melihat jumlah total yang harus saya bayar tanpa harus mengklik tombol \'check out\'. Sangat nyaman, ? hanya saja, terkadang ketika saya mencari sesuatu, tetapi hasil pencariannya berbeda. Tapi secara keseluruhan, sangat bagus!', 'baik,belum,suka,shopee,shopee,tipu,hal,voucher,jadi,coba,lazada,izin,beri,tahu,anda,senang,aplikasi,semua,jelas,tentang,voucher,dapat,lihat,jumlah,total,harus,bayar,tanpa,harus,klik,tombol,check,out,nyaman,saja,kadang,ketika,cari,suatu,hasil,cari,beda,cara,seluruh,bagus', -1, '2022-05-24 16:49:40', 0);
INSERT INTO `skripsi_rekap` (`no`, `komentar`, `stem`, `sentimen`, `tgl`, `flag`) VALUES
(91, 'Menyukainya, hanya berharap ada cicilan tetapi tetap saja aplikasi yang bagus dan tempat yang bagus untuk berbelanja. Itu juga lebih halus dan jarang lag, yang bagus.', 'suka,harap,ada,cicil,saja,aplikasi,bagus,tempat,bagus,belanja,lebih,halus,jarang,lag,bagus', -1, '2022-05-24 16:49:40', 0),
(92, 'Saya menyukai Lazada daripada platform belanja lainnya di Filipina, Lazada menggunakan kurir logistik (LEX) mereka sendiri dan melakukan kinerja yang luar biasa dan bertanggung jawab dalam menangani paket kami daripada aplikasi belanja lain yang menyewa beberapa logistik pihak ketiga yang tidak melakukan paket standar penanganan dalam operasi logistik, Lazada tahu bagaimana menangani pelanggan mereka dengan benar, saya menyesal menjadi anggota platinum di aplikasi lain, yang tidak memperlakukan keluhan pelanggan mereka dengan benar.', 'suka,lazada,daripada,platform,belanja,lain,filipina,lazada,guna,kurir,logistik,lex,sendiri,laku,kinerja,biasa,tanggung,jawab,tangan,paket,daripada,aplikasi,belanja,lain,sewa,beberapa,logistik,pihak,tiga,tidak,laku,paket,standar,tangan,operasi,logistik,lazada,tahu,bagaimana,tangan,langgan,benar,sesal,jadi,anggota,platinum,aplikasi,lain,tidak,laku,keluh,langgan,benar', -1, '2022-05-24 16:49:40', 0),
(93, 'Saya telah menggunakan ini selama bertahun-tahun sekarang dan baru-baru ini saya memiliki masalah pada barang yang saya beli. Saya sangat puas dengan cara tim lazada menangani keluhan saya dan mengambil tindakan. saya hanya berharap penjual tersebut harus lebih bertanggung jawab dan cukup dapat diandalkan.', 'telah,guna,selama,bertahuntahun,barubaru,milik,masalah,barang,beli,puas,cara,tim,lazada,tangan,keluh,ambil,tindak,harap,jual,sebut,harus,lebih,tanggung,jawab,cukup,dapat,andal', 1, '2022-05-24 16:49:40', 0),
(94, 'Tetap menjadi aplikasi belanja online utama saya...berharap mereka dapat menambahkan segmen yang disebut \'favorit\' untuk menyimpan dan dengan cepat merujuk kembali ke item yang dibeli secara teratur...terima kasih', 'jadi,aplikasi,belanja,online,utama,sayaberharap,dapat,tambah,segmen,sebut,favorit,simpan,cepat,rujuk,kembali,item,beli,cara,teraturterima,kasih', -1, '2022-05-24 16:49:41', 0),
(95, 'Aplikasi belanja online ini sangat berguna. Apalagi di masa pandemi ini. Sangat nyaman untuk digunakan. Talaga terbaik.', 'aplikasi,belanja,online,guna,apalagi,masa,pandemi,nyaman,guna,talaga,baik', -1, '2022-05-24 16:49:41', 0),
(96, 'Aplikasi ini sempurna, sangat berguna dalam setiap hari. Simula nung ininstall ko yung app na\'to di nagsimulang umorder mereka tidak pernah mengecewakan saya kasi oke lahat. Buti nalang may ganitong apps.', 'aplikasi,sempurna,guna,tiap,hari,simula,nung,ininstall,ko,yung,app,nato,nagsimulang,umorder,tidak,kecewa,kasi,oke,lahat,buti,nalang,may,ganitong,apps', -1, '2022-05-24 16:49:41', 0),
(97, 'Cara yang bagus dan mudah untuk membeli atau memesan barang atau produk dengan sedikit usaha dengan harga yang lebih terjangkau', 'cara,bagus,mudah,beli,mesan,barang,produk,sedikit,usaha,harga,lebih,jangkau', 1, '2022-05-24 16:49:41', 0),
(98, 'Lebih praktis dan nyaman saat berbelanja di Lazada. Tidak ada kerumitan untuk saluran dan sekarang aman beberapa hari.', 'lebih,praktis,nyaman,belanja,lazada,tidak,ada,kerumit,salur,aman,beberapa,hari', -1, '2022-05-24 16:49:41', 0),
(99, 'Saya sangat suka toko ini, bahkan ibu saya suka ini, saya hanya berharap mereka akan memiliki pembaruan yang lebih keren, tetapi saya tetap sangat merekomendasikan aplikasi ini jika Anda suka berbelanja ?', 'suka,toko,bahkan,ibu,suka,harap,milik,baru,lebih,keren,rekomendasi,aplikasi,anda,suka,belanja', -1, '2022-05-24 16:49:41', 0),
(100, 'Direkomendasikan!!!! Sangat puas..pelayanan bagus n harga terjangkau..kualitas produk..paling penting harus bijak dalam berbelanja guys....beli dengan hati-hati kantong aman ???????????? LAZADA the best????', 'rekomendasi,puaspelayanan,bagus,harga,terjangkaukualitas,produkpaling,penting,harus,bijak,belanja,guysbeli,hatihati,kantong,aman,lazada,the,best', -1, '2022-05-24 16:49:42', 0),
