(197, 'Aplikasi ini mudah digunakan. Sangat mudah untuk menemukan apa yang Anda cari. Kerja bagus!', 'aplikasi,mudah,guna,mudah,temu,anda,cari,kerja,bagus', -1, '2022-05-24 16:50:07', 0),
(198, 'Aplikasi belanja online ini sangat diperlukan untuk kehidupan kita sehari-hari, terutama saat ini. Senang menggunakannya, setiap kali saya membutuhkan sesuatu, saya langsung membuka aplikasi belanja online ini dan beberapa hari kemudian, saya memiliki hal-hal yang saya inginkan. Silakan lanjutkan untuk mengamankan ini, layanan Anda, Anda tetap aman, tetapi juga di Masa Depan. Terima kasih', 'aplikasi,belanja,online,perlu,hidup,seharihari,utama,senang,guna,tiap,kali,butuh,suatu,langsung,buka,aplikasi,belanja,online,beberapa,hari,kemudian,milik,halhal,ingin,sila,lanjut,aman,layan,anda,anda,aman,masa,depan,terima,kasih', -1, '2022-05-24 16:50:08', 0),
(199, 'Aplikasi yang bagus, tidak perlu membeli di luar hanya satu klik dan selesai!!!????????????????', 'aplikasi,bagus,tidak,perlu,beli,satu,klik,selesai', -1, '2022-05-24 16:50:08', 0),
(200, 'Aplikasi ini sangat luar biasa ,, sangat membantu orang untuk membeli kebutuhan mereka di lazada karena pandemi, saya sangat suka aplikasi ini juga memiliki banyak voucher', 'aplikasi,biasa,bantu,orang,beli,butuh,lazada,pandemi,suka,aplikasi,milik,banyak,voucher', -1, '2022-05-24 16:50:08', 0),
(201, 'Mudah digunakan tetapi perlu mengurangi kelompok permainan yang menghambat tampilan.', 'mudah,guna,perlu,urang,kelompok,main,hambat,tampil', 1, '2022-05-24 16:50:08', 0),
(202, 'Beberapa barang yang dipesan ada yang salah dan penjual tidak menginformasikan kepada pelanggan tentang barang yang salah warna dan jenisnya.. semoga bisa mengkonfirmasi atau menginformasikan kepada pembeli tentang barang yang salah atau mungkin memberikan pilihan atau pilihan lain sehingga pembeli tidak akan kecewa..semoga komentar mune ini diperhatikan.selamat siang', 'beberapa,barang,pesan,ada,salah,jual,tidak,informasi,langgan,tentang,barang,salah,warna,jenis,moga,konfirmasi,informasi,beli,tentang,barang,salah,berik,pilih,pilih,lain,sehingga,beli,tidak,kecewasemoga,komentar,mune,diperhatikanselamat,siang', 1, '2022-05-24 16:50:09', 0),
(203, 'Layanan sangat baik, hanya memelihara dan mengikuti sistem perusahaan.', 'layan,baik,pelihara,ikut,sistem,usaha', -1, '2022-05-24 16:50:09', 0),
(204, 'Lazada adalah aplikasi yang sangat nyaman di mana Anda dapat berbelanja atau bahkan membayar tagihan Anda, plus gratisan dan promo menarik yang bahkan tidak dapat saya tolak. Suka! ????', 'lazada,aplikasi,nyaman,mana,anda,dapat,belanja,bahkan,bayar,tagih,anda,plus,gratis,promo,tarik,bahkan,tidak,dapat,tolak,suka', -1, '2022-05-24 16:50:09', 0),
(205, 'Aplikasi yang sangat direkomendasikan untuk belanja online mudah digunakan, banyak voucher dan diskon untuk digunakan. Anda juga dapat memenangkan kredit dompet lazada, item, dan voucher dengan bergabung di lazlive dan game.', 'aplikasi,rekomendasi,belanja,online,mudah,guna,banyak,voucher,diskon,guna,anda,dapat,menang,kredit,dompet,lazada,item,voucher,gabung,lazlive,game', -1, '2022-05-24 16:50:09', 0),
(206, 'Mudah dicari, mudah dibandingkan, mudah digunakan.', 'mudah,cari,mudah,banding,mudah,guna', 1, '2022-05-24 16:50:09', 0),
(207, 'Jauh lebih baik dari shopee sekarang.. Lebih banyak pengiriman gratis.. Lebih banyak diskon yang tidak bisa didapatkan di toko fisik.', 'jauh,lebih,baik,shopee,lebih,banyak,kirim,gratis,lebih,banyak,diskon,tidak,dapat,toko,fisik', 1, '2022-05-24 16:50:09', 0),
(208, 'Saya suka aplikasi ini. Sejauh ini, dari sekian banyak transaksi/pembelian yang saya lakukan melalui aplikasi ini, saya hanya mendapat 2 kasus pengembalian dana. Dan itu dikarenakan barang yang saya pesan sudah tidak ada lagi (pertama kali) dan penjual (dari China) tidak bisa memenuhi pesanan dalam jangka waktu dua minggu karena penyebaran virus Corona di awal tahun 2020 (kedua kalinya). ). Saya tidak memiliki masalah (untungnya) sejauh ini. Dan saya berharap tim Lazada dapat mempertahankan layanan terbaik Anda. Anda layak mendapatkan 5 .', 'suka,aplikasi,jauh,kian,banyak,transaksipembelian,laku,aplikasi,dapat,kasus,kembali,dana,barang,pesan,sudah,tidak,ada,pertama,kali,jual,china,tidak,penuh,pesan,jangka,waktu,dua,minggu,sebar,virus,corona,awal,tahun,dua,kali,tidak,milik,masalah,untung,jauh,harap,tim,lazada,dapat,tahan,layan,baik,anda,anda,layak,dapat', -1, '2022-05-24 16:50:10', 0),
(209, 'LAZADA ADALAH APLIKASI BELANJA ONLINE TERBAIK. Ini memberikan semua yang saya butuhkan dalam 3 hingga 5 hari minsan nga 1 hari Lang begitu menakjubkan. Yung naiisip ko pa Lang may gusto ako and then sinearch ko ayy meron Pala dito so check out agad agad. Tidak perlu keluar pa sangat nyaman Lalo na sa mga hindi makalabas.. Aman dan cepat. Saya merekomendasikan ini kepada keluarga saya. Pelanggan Lazada sejak 2018.', 'lazada,aplikasi,belanja,online,baik,berik,semua,butuh,hingga,hari,minsan,nga,hari,lang,takjub,yung,naiisip,ko,pa,lang,may,gusto,ako,and,then,sinearch,ko,ayy,meron,pala,dito,so,check,out,agad,agad,tidak,perlu,keluar,pa,nyaman,lalo,na,sa,mga,hindi,makalabas,aman,cepat,rekomendasi,keluarga,langgan,lazada,sejak', -1, '2022-05-24 16:50:10', 0),
(210, 'Untuk Pengguna Smartphone Samsung Kelas Menengah, kami berada di Maroko dan kami tidak menggunakan atau lebih tepatnya tidak dapat menggunakan Lazada untuk berbelanja. Namun, itu wajib untuk Smartphone kita. Secara pribadi, saya biasanya menghapusnya, tetapi terus menginstal ulang secara otomatis, hal yang membuat koneksi internet seluler saya menjadi dangkal. Saya tidak mengatakan bahwa itu bukan Aplikasi Belanja yang bagus, tetapi kami tidak membutuhkannya di negara-negara non-Asia seperti Maroko. Terimalah rasa hormat saya yang terdalam.', 'guna,smartphone,samsung,kelas,tengah,rada,maroko,tidak,guna,lebih,tepat,tidak,dapat,guna,lazada,belanja,wajib,smartphone,cara,pribadi,biasa,hapus,terus,menginstal,ulang,cara,otomatis,hal,buat,koneksi,internet,seluler,jadi,dangkal,tidak,atak,bukan,aplikasi,belanja,bagus,tidak,butuh,negaranegara,nonasia,seperti,maroko,terima,rasa,hormat', -1, '2022-05-24 16:50:10', 0),
(211, 'aplikasi yang sangat luar biasa .. Anda dapat memenangkan banyak hadiah dan Anda bisa mendapatkan produk dengan jumlah yang lebih murah', 'aplikasi,biasa,anda,dapat,menang,banyak,hadiah,anda,dapat,produk,jumlah,lebih,murah', -1, '2022-05-24 16:50:11', 0),
(212, 'Saya suka lazada, karena lazada, saya dapat memesan hadiah terendah, dan semua produk yang saya inginkan sudah ada di aplikasi lazada. dan jumlah jika dipesan karena diskon dan menangkan jika hadiah voucher dan pengiriman gratis. dan hampir setiap hari seseorang datang ke rumah untuk mengantarkan pesanan saya. semua yang ingin anda beli sudah ada di lazada. dan saya tidak perlu keluar lagi. makanya saya suka lazada.', 'suka,lazada,lazada,dapat,mesan,hadiah,rendah,semua,produk,ingin,sudah,ada,aplikasi,lazada,jumlah,pesan,diskon,menang,hadiah,voucher,kirim,gratis,hampir,tiap,hari,seseorang,datang,rumah,antar,pesan,semua,ingin,anda,beli,sudah,ada,lazada,tidak,perlu,keluar,makanya,suka,lazada', -1, '2022-05-24 16:50:11', 0),
(213, 'Aplikasi luar biasa tapi tolong sederhanakan pemrosesan pengembalian karena saya tidak dapat mengakses barang yang ingin saya kembalikan karena telah dihapus dari keranjang saya. Dan tolong larang penjual yang mengirimkan pengganti murah sebagai gantinya. Dan harap pengirim lokal untuk menunjukkan nama barang yang dijual dan nomor CP mereka. Terima kasih.', 'aplikasi,biasa,tolong,sederhana,proses,kembali,tidak,dapat,akses,barang,ingin,kembali,telah,hapus,keranjang,tolong,larang,jual,kirim,ganti,murah,bagai,ganti,harap,kirim,lokal,tunjuk,nama,barang,jual,nomor,cp,terima,kasih', -1, '2022-05-24 16:50:11', 0),
(214, 'Luar biasa & mudah dinavigasi dan mereka memiliki permainan untuk menghibur Anda', 'biasa,mudah,navigasi,milik,main,hibur,anda', 1, '2022-05-24 16:50:11', 0),
(215, 'Sungguh menakjubkan menerima pesanan saya tepat waktu dan terkadang lebih awal seperti yang saya harapkan ... Diskon besar dan barang terjangkau plus voucher gratis untuk dinikmati. Terima kasih kepada lazada! Kerja bagus!', 'sungguh,takjub,terima,pesan,tepat,waktu,kadang,lebih,awal,seperti,harap,diskon,besar,barang,jangkau,plus,voucher,gratis,nikmat,terima,kasih,lazada,kerja,bagus', -1, '2022-05-24 16:50:11', 0),
(216, 'Barang dikirim dengan kualitas bagus dan tepat waktu!', 'barang,kirim,kualitas,bagus,tepat,waktu', -1, '2022-05-24 16:50:11', 0),
(217, 'Pengalaman belanja online yang luar biasa, banyak pilihan, harga bagus, layanan platform luar biasa', 'alam,belanja,online,biasa,banyak,pilih,harga,bagus,layan,platform,biasa', -1, '2022-05-24 16:50:12', 0),
(218, 'Barang bagus, saya bisa membeli tanpa harus pergi berbelanja dan menemukan semua yang saya inginkan dengan mudah, kurir agak repot ketika mereka datang tanpa kehadiran saya di rumah kadang-kadang, tetapi layanan yang tersedia cukup baik untuk memberi tahu dan memberi tahu barang-barang di barang yang saya beli, hanya masalah latency barang datang lebih awal atau sangat terlambat.', 'barang,bagus,beli,tanpa,harus,pergi,belanja,temu,semua,ingin,mudah,kurir,agak,repot,ketika,datang,tanpa,hadir,rumah,kadangkadang,layan,sedia,cukup,baik,beri,tahu,beri,tahu,barangbarang,barang,beli,masalah,latency,barang,datang,lebih,awal,lambat', 1, '2022-05-24 16:50:12', 0);
INSERT INTO `skripsi_rekap` (`no`, `komentar`, `stem`, `sentimen`, `tgl`, `flag`) VALUES
(219, 'Saya sangat suka aplikasi ini sangat nyaman dan membantu saya, mudah digunakan semua yang saya inginkan berfungsi dengan baik dan lebih cepat di sini, sangat direkomendasikan', 'suka,aplikasi,nyaman,bantu,mudah,guna,semua,ingin,fungsi,baik,lebih,cepat,sini,rekomendasi', -1, '2022-05-24 16:50:12', 0),
(220, 'Sebelum saya punya banyak barang yang akan saya beli saya tidak tahu mengapa semua ceritanya menghilang. semoga kali ini Okey...', 'belum,punya,banyak,barang,beli,tidak,tahu,semua,cerita,hilang,moga,kali,okey', 1, '2022-05-24 16:50:12', 0),
(221, 'Banyak tersedia pada apa saja, kapan saja di mana saja. Cari saja penawaran terbaik yang Anda inginkan.', 'banyak,sedia,saja,kapan,saja,mana,saja,cari,saja,awar,baik,anda,ingin', 1, '2022-05-24 16:50:12', 0),
(222, 'Mudah dicari, pengiriman lebih sederhana akan terus melakukan pembelian online lebih banyak', 'mudah,cari,kirim,lebih,sederhana,terus,laku,beli,online,lebih,banyak', 1, '2022-05-24 16:50:12', 0),
(223, 'Mudah dan nyaman menggunakan aplikasi lazada, saya melakukan banyak pembelian melalui aplikasi ini.. Saya akan memilih ini sebagai aplikasi online nomor satu saya saat membeli.. Saya akan memberi peringkat 5!!! ??????', 'mudah,nyaman,guna,aplikasi,lazada,laku,banyak,beli,aplikasi,pilih,bagai,aplikasi,online,nomor,satu,beli,beri,peringkat', -1, '2022-05-24 16:50:13', 0),
(224, 'Sangat mudah digunakan, mudah menemukan apa yang Anda butuhkan, telah digunakan selama setahun dan tidak pernah menemukan pemasok yang buruk. Anda perlu melihat di mana vendor Anda berada. Jika di negara Anda, pengiriman biasanya tiba dalam beberapa hari. Jika datang dari China, bisa memakan waktu berminggu-minggu.', 'mudah,guna,mudah,temu,anda,butuh,telah,guna,selama,tahun,tidak,temu,pasok,buruk,anda,perlu,lihat,mana,vendor,anda,rada,negara,anda,kirim,biasa,tiba,beberapa,hari,datang,china,makan,waktu,bermingguminggu', -1, '2022-05-24 16:50:13', 0),
(225, 'Saya sangat menyukai aplikasi ini, tetapi ada satu hal yang saya khawatirkan. Produk-produk yang tidak relevan dan berbahaya yang berkaitan dengan pornografi, mereka terus bermunculan di layar terutama pada penjualan flash. Jujur, itu benar-benar memberi saya kesan negatif. Saya mencoba mencari cara untuk menyingkirkan produk berbahaya yang muncul di layar, tetapi mereka terus muncul. Saya berharap untuk tidak melihatnya lagi. Tolong lazada, bantu saya menyingkirkan itu ...', 'suka,aplikasi,ada,satu,hal,khawatir,produkproduk,tidak,relevan,bahaya,kait,pornografi,terus,muncul,layar,utama,jual,flash,jujur,benarbenar,beri,kesan,negatif,coba,cari,cara,singkir,produk,bahaya,muncul,layar,terus,muncul,harap,tidak,lihat,tolong,lazada,bantu,singkir', -1, '2022-05-24 16:50:13', 0),
(226, 'Lazada adalah aplikasi belanja yang sangat mudah digunakan! Banyak produk untuk dipilih dengan banyak diskon dan cashback untuk didapatkan. Cara belanja yang sangat aman tanpa keluar rumah.', 'lazada,aplikasi,belanja,mudah,guna,banyak,produk,pilih,banyak,diskon,cashback,dapat,cara,belanja,aman,tanpa,keluar,rumah', -1, '2022-05-24 16:50:14', 0),
(227, 'Bagus harganya memberikan harga yang lebih rendah tetapi pengirimannya tidak bagus saya harap biaya pengirimannya gratis.. dan satu lagi saya ingin lazada membuat penjualan barang bagus atau lain-lain. Karena kadang-kadang hanya bagus tapi hampir banyak yang kita miliki ada kerusakan atau pesanan tidak sama di foto..tapi anyway thanks ini real talk only..', 'bagus,harga,berik,harga,lebih,rendah,kirim,tidak,bagus,harap,biaya,kirim,gratis,satu,ingin,lazada,buat,jual,barang,bagus,lainlain,kadangkadang,bagus,hampir,banyak,milik,ada,rusak,pesan,tidak,sama,fototapi,anyway,thanks,real,talk,only', 1, '2022-05-24 16:50:14', 0),
(228, 'Pengalaman Lazada yang bagus dan yang lebih penting dukungan yang bagus! Lazada sangat berguna selalu sangat membantu ketika saya mencari produk berkualitas dengan harga yang lebih rendah/diskon. Sejauh ini, toko yang saya pesan tidak pernah mengecewakan Hampir selalu, barang dikirim tepat waktu. Satu toko bahkan melebihi harapan saya di mana cepat pengiriman diperhatikan. Secara keseluruhan, saya memiliki pengalaman yang sangat bagus', 'alam,lazada,bagus,lebih,penting,dukung,bagus,lazada,guna,bantu,ketika,cari,produk,kualitas,harga,lebih,rendahdiskon,jauh,toko,pesan,tidak,kecewa,hampir,barang,kirim,tepat,waktu,satu,toko,bahkan,lebih,harap,mana,cepat,kirim,hati,cara,seluruh,milik,alam,bagus', -1, '2022-05-24 16:50:14', 0),
(229, 'Belanja online ini sempurna. Semua kebutuhan Anda ada di sini di lazada belanja online, sangat berharga ?? Dengan penuh kasih menggunakannya dan sangat aman.', 'belanja,online,sempurna,semua,butuh,anda,ada,sini,lazada,belanja,online,harga,penuh,kasih,guna,aman', 1, '2022-05-24 16:50:14', 0),
(230, 'Umumnya tidak apa-apa untuk membeli di sini, meskipun terkadang ada penjual yang menyesatkan pembeli produknya hanya untuk melakukan penjualan. Saya sudah membeli banyak barang di Lazada tetapi hanya ada kali saya merasa puas dengan penjualnya. Awak pengiriman yang ditugaskan ke tempat saya sangat baik dan sudah mengenal saya karena sering bertemu. Harap Anda menendang posting menyesatkan untuk dijual di sini di lazada. Lebih banyak kekuatan dan lebih banyak Penjualan.', 'umum,tidak,apaapa,beli,sini,meski,kadang,ada,jual,sesat,beli,produk,laku,jual,sudah,beli,banyak,barang,lazada,ada,kali,rasa,puas,jual,awak,kirim,tugas,tempat,baik,sudah,kenal,sering,berte,harap,anda,tendang,posting,sesat,jual,sini,lazada,lebih,banyak,kuat,lebih,banyak,jual', 1, '2022-05-24 16:50:15', 0),
(231, 'Pengiriman cepat, paket dikemas dengan baik, penjualan bulanan. budol bulanan. Lebih banyak permainan. juga banyak hadiah dan diskon. Sudah menggunakan Lazada selama hampir satu tahun sekarang.', 'kirim,cepat,paket,kemas,baik,jual,bulan,budol,bulan,lebih,banyak,main,banyak,hadiah,diskon,sudah,guna,lazada,selama,hampir,satu,tahun', -1, '2022-05-24 16:50:15', 0),
(232, 'Lazada dan penjualnya selalu bagus di luar ekspektasi. Saya tidak pernah memiliki masalah apapun sejak saya menggunakan platform ini. Terima kasih dan semoga Tuhan memberkati Anda semua!', 'lazada,jual,bagus,ekspektasi,tidak,milik,masalah,sejak,guna,platform,terima,kasih,moga,tuhan,berkat,anda,semua', -1, '2022-05-24 16:50:15', 0),
(233, 'Semua yang saya cari, ada di Lazada! Cash on Delivery (COD) adalah yang terbaik. Ini adalah salah satu keunggulan Lazada. Ini membantu saya untuk mengalami belanja online meskipun kemampuan untuk membayar online. Selain itu, mereka memiliki Laz Live di mana mereka memberikan diskon besar-besaran. Selalu pengiriman gratis untuk mereka juga! Dimana lagi kamu? Mereka juga memiliki lebih banyak permainan di mana Anda dapat memenangkan voucher atau produk. Saya pernah mengalami kemenangan sekali. Sangat membantu kemenangan bagi saya sebagai guru.', 'semua,cari,ada,lazada,cash,on,delivery,cod,baik,salah,satu,unggul,lazada,bantu,alami,belanja,online,meski,mampu,bayar,online,selain,milik,laz,live,mana,berik,diskon,besarbesaran,kirim,gratis,mana,kamu,milik,lebih,banyak,main,mana,anda,dapat,menang,voucher,produk,alami,menang,sekali,bantu,menang,bagai,guru', -1, '2022-05-24 16:50:16', 0),
(234, 'Aplikasi terbaik yang pernah ada,.,membantu banyak orang khususnya orang-orang yang tidak bisa keluar untuk berbelanja.Aplikasi yang sangat membantu dan bermanfaat.Saya suka aplikasi lazada.', 'aplikasi,baik,adamembantu,banyak,orang,khusus,orangorang,tidak,keluar,berbelanjaaplikasi,bantu,bermanfaatsaya,suka,aplikasi,lazada', -1, '2022-05-24 16:50:16', 0),
