(346, 'Situs web tidak ada harapan. Meminta saya untuk login berulang kali, tidak dapat menambahkan ke keranjang belanja juga. Jadi saya harus menggunakan aplikasi seluler. Aplikasi jauh lebih ramah pengguna.', 'situs,web,tidak,ada,harap,minta,login,ulang,kali,tidak,dapat,tambah,keranjang,belanja,jadi,harus,guna,aplikasi,seluler,aplikasi,jauh,lebih,ramah,guna', -1, '2022-05-24 16:50:35', 0),
(347, 'Sangat bagus dan bagus,. tidak perlu repot dan usaha untuk berbelanja', 'bagus,bagus,tidak,perlu,repot,usaha,belanja', 1, '2022-05-24 16:50:35', 0),
(348, 'Semua pesanan di lazada dipacking dengan baik dan barangnya bagus.', 'semua,pesan,lazada,dipacking,baik,barang,bagus', -1, '2022-05-24 16:50:35', 0),
(349, 'Transaksi mengalir dengan lancar dan efisien. suka aplikasi ini', 'transaksi,alir,lancar,efisien,suka,aplikasi', -1, '2022-05-24 16:50:35', 0),
(350, 'Transaksi dan pengiriman cepat dan mudah. Produk yang sangat terjangkau dan berkualitas. Saya suka Lazada. Keluarga saya dari menantu laki-laki dan empat cucu perempuan saya menggunakan Lazada dalam semua kebutuhan pribadi dan dasar mereka. Hampir setiap hari pengiriman Lazada datang ke rumah kami. Kami semua menyukai produk Lazada. Saya yakin semua orang di seluruh dunia juga menyukai Lazada. Lebih banyak kekuatan dan Tuhan memberkati Anda lebih banyak Lazada. Kami sangat menghargai layanan dan cinta serta perhatian Anda kepada semua pelanggan setia Anda.', 'transaksi,kirim,cepat,mudah,produk,jangkau,kualitas,suka,lazada,keluarga,menantu,lakilaki,empat,cucu,perempuan,guna,lazada,semua,butuh,pribadi,dasar,hampir,tiap,hari,kirim,lazada,datang,rumah,semua,suka,produk,lazada,yakin,semua,orang,seluruh,dunia,suka,lazada,lebih,banyak,kuat,tuhan,berkat,anda,lebih,banyak,lazada,harga,layan,cinta,hati,anda,semua,langgan,setia,anda', 1, '2022-05-24 16:50:36', 0),
(351, 'Menakjubkan. Pengalaman berbelanja membuatnya lebih mudah dan nyaman. Khusus di masa pandemi ini. Kita tinggal di rumah saja scroll tap lalu swipe ????', 'takjub,alam,belanja,buat,lebih,mudah,nyaman,khusus,masa,pandemi,tinggal,rumah,saja,scroll,tap,swipe', 1, '2022-05-24 16:50:36', 0),
(352, 'Yang saya suka dari lazada adalah mereka selalu mengirimkan barang secepat yang saya harapkan.. :)', 'suka,lazada,kirim,barang,cepat,harap', -1, '2022-05-24 16:50:36', 0),
(353, 'Semuanya bagus. Saya suka semua barang di sini dan yang terpenting harga diskon. Pertama kali membeli kotak Misteri Lazada dan semoga bulan keberuntungan saya di bulan kelahiran saya. Salut untuk semua!', 'semua,bagus,suka,semua,barang,sini,penting,harga,diskon,pertama,kali,beli,kotak,misteri,lazada,moga,bulan,untung,bulan,lahir,salut,semua', -1, '2022-05-24 16:50:36', 0),
(354, 'Proses transaksi mudah peasy. Itulah yang saya cari.', 'proses,transaksi,mudah,peasy,cari', 1, '2022-05-24 16:50:36', 0),
(355, 'Saya Suka berbelanja menggunakan aplikasi ini. Terutama setiap kali saya mendapat voucher Pengiriman Gratis', 'suka,belanja,guna,aplikasi,utama,tiap,kali,dapat,voucher,kirim,gratis', -1, '2022-05-24 16:50:36', 0),
(356, 'Pengiriman jauh lebih cepat dari Shopee. APP ini membantu dan menyenangkan untuk dijelajahi. Saya dapat menilai penjual saya setiap setelah saya menerima pesanan saya dengan lancar', 'kirim,jauh,lebih,cepat,shopee,app,bantu,senang,jelajah,dapat,nilai,jual,tiap,sete,terima,pesan,lancar', -1, '2022-05-24 16:50:36', 0),
(357, 'Aplikasi yang sangat berguna! Saya selalu menggunakan aplikasi ini untuk berbelanja', 'aplikasi,guna,guna,aplikasi,belanja', -1, '2022-05-24 16:50:37', 0),
(358, 'Mudah digunakan. Banyak gratisan juga!', 'mudah,guna,banyak,gratis', 1, '2022-05-24 16:50:37', 0),
(359, 'Saya sangat senang dengan aplikasi ini. Saya memesan sesuatu tanpa menghabiskan lebih banyak waktu dan tenaga.. saya dapat membeli apa pun yang saya butuhkan hanya dalam satu menit. Sangat mudah dan tidak ribet', 'senang,aplikasi,mesan,suatu,tanpa,habis,lebih,banyak,waktu,tenaga,dapat,beli,butuh,satu,menit,mudah,tidak,ribet', -1, '2022-05-24 16:50:37', 0),
(360, 'Mudah digunakan, bagus dan nyaman.', 'mudah,guna,bagus,nyaman', 1, '2022-05-24 16:50:37', 0),
(361, 'Sangat mudah dan nyaman untuk digunakan. Terima kasih Lazada. Banyak voucher yang diberikan, saya salah satunya menikmati Voucher itu. Aplikasi itu sendiri benar-benar berfungsi dengan baik, tidak ada lagi gangguan.', 'mudah,nyaman,guna,terima,kasih,lazada,banyak,voucher,berik,salah,satu,nikmat,voucher,aplikasi,sendiri,benarbenar,fungsi,baik,tidak,ada,ganggu', -1, '2022-05-24 16:50:37', 0),
(362, 'Belanja online mudah. Baik sekali!', 'belanja,online,mudah,baik,sekali', 1, '2022-05-24 16:50:37', 0),
(363, 'Bagi saya tidak apa-apa, selain produk ramah anggaran, bebas repot pa... ???? Saya senang menggunakan aplikasi ini', 'tidak,apaapa,selain,produk,ramah,anggar,bebas,repot,pa,senang,guna,aplikasi', -1, '2022-05-24 16:50:37', 0),
(364, 'Lazada adalah aplikasi belanja online terbaik.. Layanan pelanggan luar biasa karena sebagian besar agen responsif dan berpengetahuan luas. Lazada adalah satu-satunya aplikasi belanja online dengan grup pengguna lazada Facebook rekan-rekan Lazada tempat Anda dapat berinteraksi dengan sesama pengguna tentang penawaran dan promosi yang bagus. Lazada memang terbaik dalam hal hadiah, promo, dan voucher. Aplikasi ini juga ramah pengguna. Sangat mudah untuk digunakan.', 'lazada,aplikasi,belanja,online,baik,layan,langgan,biasa,besar,agen,responsif,berpengetahuan,luas,lazada,satusatu,aplikasi,belanja,online,grup,guna,lazada,facebook,rekanrekan,lazada,tempat,anda,dapat,interaksi,sama,guna,tentang,awar,promosi,bagus,lazada,memang,baik,hal,hadiah,promo,voucher,aplikasi,ramah,guna,mudah,guna', -1, '2022-05-24 16:50:38', 0),
(365, 'Sangat mudah digunakan dan banyak voucher untuk mengurangi jumlah barang dan juga banyak pengiriman gratis free', 'mudah,guna,banyak,voucher,urang,jumlah,barang,banyak,kirim,gratis,free', 1, '2022-05-24 16:50:38', 0),
(366, 'Pengiriman cepat, kurir sopan, jenis belanja termudah dengan diskon besar dan paling nyaman karena Anda dapat berbelanja kapan saja atau di mana saja Anda bisa.', 'kirim,cepat,kurir,sopan,jenis,belanja,mudah,diskon,besar,paling,nyaman,anda,dapat,belanja,kapan,saja,mana,saja,anda', 1, '2022-05-24 16:50:38', 0),
(367, 'Aplikasi ini bagus. Saya telah memesan banyak barang dengan aplikasi ini.', 'aplikasi,bagus,telah,mesan,banyak,barang,aplikasi', -1, '2022-05-24 16:50:38', 0),
(368, 'Senang dan mudah menggunakan platform yang sangat terorganisir.', 'senang,mudah,guna,platform,terorganisir', 1, '2022-05-24 16:50:38', 0),
(369, 'Sejauh ini mulus hanya saja saya sudah memesan dan memiliki alamat pengiriman yang lain dan saya ingin pesanan saya dikirim ke alamat kantor saya. Saya harap ini berhasil', 'jauh,mulus,saja,sudah,mesan,milik,alamat,kirim,lain,ingin,pesan,kirim,alamat,kantor,harap,hasil', -1, '2022-05-24 16:50:38', 0);
INSERT INTO `skripsi_rekap` (`no`, `komentar`, `stem`, `sentimen`, `tgl`, `flag`) VALUES
(370, 'Mudah digunakan hanya dengan nomor telepon dan email untuk membuat akun. Tidak suka pembayaran online? Sebagian besar dari apa yang mungkin akan Anda beli dapat dibayar dengan uang tunai pada saat pengiriman ke depan pintu Anda.', 'mudah,guna,nomor,telepon,email,buat,akun,tidak,suka,bayar,online,besar,anda,beli,dapat,bayar,uang,tunai,kirim,depan,pintu,anda', -1, '2022-05-24 16:50:38', 0),
(371, 'Telah menikmati berbelanja di Lazada dengan layanan pelanggan yang baik sejak Anda melakukan pembelian hingga produk dikirimkan kepada Anda. Anda memiliki informasi langsung tentang barang yang Anda beli. Itu adalah jaminan Anda mendapatkan item!', 'telah,nikmat,belanja,lazada,layan,langgan,baik,sejak,anda,laku,beli,hingga,produk,kirim,anda,anda,milik,informasi,langsung,tentang,barang,anda,beli,jamin,anda,dapat,item', -1, '2022-05-24 16:50:39', 0),
(372, 'Produknya sangat bagus dan efektif dalam memperkuat sistem kekebalan tubuh kita.', 'produk,bagus,efektif,kuat,sistem,kebal,tubuh', -1, '2022-05-24 16:50:39', 0),
(373, 'Puas dengan pengirimannya, tidak merepotkan.', 'puas,kirim,tidak,repot', 1, '2022-05-24 16:50:39', 0),
(374, 'Pengiriman cepat. Saya selalu dapat memanfaatkan pengiriman gratis. Sangat bagus. Tidak pernah mengalami barang rusak.', 'kirim,cepat,dapat,manfaat,kirim,gratis,bagus,tidak,alami,barang,rusak', 1, '2022-05-24 16:50:39', 0),
(375, 'Nah aplikasi ini sangat luar biasa tanpa diragukan lagi, selalu berikan diskon gila-gilaan ????', 'nah,aplikasi,biasa,tanpa,raguk,berik,diskon,gilagilaan', -1, '2022-05-24 16:50:39', 0),
(376, 'Nyaman dan mudah untuk berbelanja', 'nyaman,mudah,belanja', 1, '2022-05-24 16:50:39', 0),
(377, 'Pengiriman cepat dan mudah digunakan.', 'kirim,cepat,mudah,guna', 1, '2022-05-24 16:50:39', 0),
(378, 'Aplikasi di sini tidak ada masalah. Tapi penjual tidak jujur ??dalam berbisnis. Saya membeli tirai biaya per pcs $6.65 x 6 tetapi mereka mengirim yang murah biaya $3.00 per pcs.', 'aplikasi,sini,tidak,ada,masalah,jual,tidak,jujur,bisnis,beli,tirai,biaya,per,pcs,x,kirim,murah,biaya,per,pcs', -1, '2022-05-24 16:50:39', 0),
(379, 'Aplikasi yang sangat bagus dan sangat terpercaya untuk berbelanja', 'aplikasi,bagus,percaya,belanja', -1, '2022-05-24 16:50:39', 0),
(380, 'Ini ramah pengguna dan umumnya cukup mudah digunakan. Ini pengalaman kedua saya menggunakan platform ini dan menurut saya sejauh ini sangat bagus. Terima kasih.', 'ramah,guna,umum,cukup,mudah,guna,alam,dua,guna,platform,turut,jauh,bagus,terima,kasih', 1, '2022-05-24 16:50:40', 0),
(381, 'berbagai macam barang dari dapur hingga luar ruangan untuk saya', 'bagai,macam,barang,dapur,hingga,ruang', -1, '2022-05-24 16:50:40', 0),
(382, 'Aplikasi yang bagus. Ramah pengguna dan mudah digunakan', 'aplikasi,bagus,ramah,guna,mudah,guna', -1, '2022-05-24 16:50:40', 0),
(383, 'Saya tidak dapat menambahkan ke keranjang barang yang ingin saya beli. Itu menjawab saya \"ada yang tidak beres di pihak kita\". Tolong, tolong, tolong segera perbaiki masalahnya. Terima kasih sebelumnya.', 'tidak,dapat,tambah,keranjang,barang,ingin,beli,jawab,ada,tidak,beres,pihak,tolong,tolong,tolong,segera,baik,masalah,terima,kasih,belum', 1, '2022-05-24 16:50:40', 0),
(384, 'Selalu mendapat diskon voucher. Platform yang bagus', 'dapat,diskon,voucher,platform,bagus', -1, '2022-05-24 16:50:40', 0),
(385, 'mereka terkadang harus menawarkan pengiriman gratis tanpa pengeluaran minimum seperti yang lain.', 'kadang,harus,awar,kirim,gratis,tanpa,keluar,minimum,seperti,lain', -1, '2022-05-24 16:50:40', 0),
(386, 'Transaksi cepat dan kurir sangat mudah didekati', 'transaksi,cepat,kurir,mudah,dekat', 1, '2022-05-24 16:50:40', 0),
(387, 'Memang yang terbaik untuk belanja online. Lazada benar-benar memberikan kembali rasa terima kasih mereka kepada pelanggan dengan memberikan banyak voucher dan kupon. Ini memang salah satu aplikasi favorit saya!', 'memang,baik,belanja,online,lazada,benarbenar,berik,kembali,rasa,terima,kasih,langgan,berik,banyak,voucher,kupon,memang,salah,satu,aplikasi,favorit', -1, '2022-05-24 16:50:40', 0),
(388, 'Sangat bermanfaat khususnya sekarang dan lebih banyak lagi di online na muna kesa ss labas. Semoga mas gumanda pa ung pagpapalakad atau paghandle ng order atau parsel. Dan kurang komplain sana kasi hampir 90% orang hari ini, belanja online na umaasa jadi mari kita teruskan pekerjaan yang baik dan kepuasan setiap orang Filipina??', 'manfaat,khusus,lebih,banyak,online,na,muna,sa,ss,labas,moga,mas,gumanda,pa,ung,pagpapalakad,paghandle,ng,order,parsel,kurang,komplain,sana,kasi,hampir,orang,hari,belanja,online,na,umaasa,jadi,mari,terus,kerja,baik,puas,tiap,orang,filipina', 1, '2022-05-24 16:50:41', 0),
(389, 'Mudah dinavigasi dan dapat diandalkan,, produk mudah dikembalikan dan pengiriman cepat dan aman..', 'mudah,navigasi,dapat,andal,produk,mudah,kembali,kirim,cepat,aman', 1, '2022-05-24 16:50:41', 0),
(390, 'Telah menggunakan platform ini sejak Circuit Breaker 2020, mendapatkan banyak produk bagus selama berbulan-bulan. Masih harus hati-hati dengan produk asli, tapi so far so good. Terima kasih telah memberikan layanan yang baik ini!', 'telah,guna,platform,sejak,circuit,breaker,dapat,banyak,produk,bagus,selama,berbulanbulan,masih,harus,hatihati,produk,asli,so,far,so,good,terima,kasih,telah,berik,layan,baik', 1, '2022-05-24 16:50:41', 0),
(391, 'Sejauh ini saya memiliki pengalaman hebat menggunakan aplikasi ini. Pengiriman cepat dan terpercaya, petugas pengiriman ang ramah. Menjadi senior dan penyandang disabilitas, aplikasi ini sangat membantu saya dan begitu banyak produk untuk dipilih. ????????????????', 'jauh,milik,alam,hebat,guna,aplikasi,kirim,cepat,percaya,tugas,kirim,ang,ramah,jadi,senior,sandang,disabilitas,aplikasi,bantu,banyak,produk,pilih', -1, '2022-05-24 16:50:41', 0),
(392, 'Saya mungkin merasa frustrasi terutama dengan waktu pengiriman, tetapi secara keseluruhan, saya puas dengan layanan ini sejak saya mulai menggunakan Lazada.', 'rasa,frustrasi,utama,waktu,kirim,cara,seluruh,puas,layan,sejak,mulai,guna,lazada', 1, '2022-05-24 16:50:42', 0),
(393, 'Aplikasi ini sangat berguna. Ini membantu orang-orang untuk orang-orang yang tidak bisa pergi ke luar atau jauh di pasar.', 'aplikasi,guna,bantu,orangorang,orangorang,tidak,pergi,jauh,pasar', -1, '2022-05-24 16:50:42', 0),
(394, 'Aplikasi yang bagus! Mudah digunakan. Layanan pelanggan mereka juga sangat efisien! Salah satu platform belanja online terbaik.', 'aplikasi,bagus,mudah,guna,layan,langgan,efisien,salah,satu,platform,belanja,online,baik', -1, '2022-05-24 16:50:42', 0),
(395, 'Saya suka itu tidak banyak iklan dan datang begitu cepat????????????????????????', 'suka,tidak,banyak,iklan,datang,cepat', 1, '2022-05-24 16:50:42', 0),
(396, 'Mudah digunakan, banyak promosi khususnya ongkos kirim dan banyak barang yang terjangkau.. sangat berterima kasih kepada lazada, sangat membantu khususnya bagi mereka yang tidak punya waktu untuk pergi ke mal dan pasar', 'mudah,guna,banyak,promosi,khusus,ongkos,kirim,banyak,barang,jangkau,terima,kasih,lazada,bantu,khusus,tidak,punya,waktu,pergi,mal,pasar', -1, '2022-05-24 16:50:42', 0),
(397, 'Pengalaman yang baik. Mudah untuk membeli.', 'alam,baik,mudah,beli', 1, '2022-05-24 16:50:42', 0),
(398, 'Super cepat dan mudah untuk memesan?', 'super,cepat,mudah,mesan', 1, '2022-05-24 16:50:42', 0),
(399, 'Saya suka aplikasi ini, tetapi setelah pembaruan saya pikir ada bug. Program terkadang memuat ulang atau menyegarkan layar atau melompat keluar. Harapan bisa memperbaikinya.', 'suka,aplikasi,sete,baru,pikir,ada,bug,program,kadang,muat,ulang,segar,layar,lompat,keluar,harap,baik', -1, '2022-05-24 16:50:43', 0),
(400, 'Lebih bagus dari shopee. Tapi UI cukup berantakan', 'lebih,bagus,shopee,u,cukup,berantak', -1, '2022-05-24 16:50:43', 0),
(401, 'Pelayanan bagus dan harga terjangkau', 'layan,bagus,harga,jangkau', -1, '2022-05-24 16:50:43', 0),
(402, 'Saya suka upaya kurir Anda, mereka benar-benar mengirimkan barang Anda ke depan pintu Anda sehingga tidak repot dan khawatir worry', 'suka,upaya,kurir,anda,benarbenar,kirim,barang,anda,depan,pintu,anda,sehingga,tidak,repot,khawatir,worry', 1, '2022-05-24 16:50:43', 0),
(403, 'pengiriman bagus tepat waktu harga wajar dan barang berkualitas', 'kirim,bagus,tepat,waktu,harga,wajar,barang,kualitas', -1, '2022-05-24 16:50:43', 0),
(404, 'Terkadang frustrasi karena barang yang salah dikirim oleh pemasok tetapi secara keseluruhan sangat senang terutama. untuk layanan pengiriman Anda, mereka sangat menghormati dan menyenangkan pelanggan!', 'kadang,frustrasi,barang,salah,kirim,pasok,cara,seluruh,senang,utama,layan,kirim,anda,hormat,senang,langgan', -1, '2022-05-24 16:50:43', 0),
(405, 'Aplikasi ini bagus. Berhati-hatilah dengan beberapa toko dan penjual. Selalu periksa ulasan sebelum Anda memesan.', 'aplikasi,bagus,berhatihati,beberapa,toko,jual,periksa,ulas,belum,anda,mesan', -1, '2022-05-24 16:50:43', 0),
(406, 'Selalu lebih cepat dan packing bagus sampai dengan selamat.', 'lebih,cepat,packing,bagus,sampai,selamat', -1, '2022-05-24 16:50:44', 0),
(407, 'puas karena pengiriman cepat dan packing rapi', 'puas,kirim,cepat,packing,rapi', -1, '2022-05-24 16:50:44', 0),
(408, 'Lazada adalah yang terbaik, saya menikmati berbelanja di lazada karena penawaran hebat mereka dan mereka memberikan gratis????. Saya senang karena mereka memberikan voucher jadi saya membeli kebutuhan saya dengan diskon. Terima kasih untuk aplikasi ini???????????????????????????? Suka.', 'lazada,baik,nikmat,belanja,lazada,awar,hebat,berik,gratis,senang,berik,voucher,jadi,beli,butuh,diskon,terima,kasih,aplikasi,suka', -1, '2022-05-24 16:50:44', 0),
(409, 'Sejauh saya memesan lazada, selalu dikirim tepat, kondisi baik, pengiriman cepat, Anda tidak akan berharap bahwa tanggal pengiriman lebih awal dari yang Anda harapkan', 'jauh,mesan,lazada,kirim,tepat,kondisi,baik,kirim,cepat,anda,tidak,harap,tanggal,kirim,lebih,awal,anda,harap', 1, '2022-05-24 16:50:44', 0),
(410, 'Aplikasi ini sangat bagus untuk berbelanja semua hal yang Anda butuhkan ada di sini dan penjual memiliki hati yang baik untuk produk di sana jadi itu sebabnya saya suka aplikasi belanja ini. ?????', 'aplikasi,bagus,belanja,semua,hal,anda,butuh,ada,sini,jual,milik,hati,baik,produk,sana,jadi,sebab,suka,aplikasi,belanja', -1, '2022-05-24 16:50:44', 0),
