(528, 'Hai uhm akhir-akhir ini Aplikasi Lazada sangat lambat berfungsi. Saya memiliki koneksi internet yang kuat tetapi terkadang ada kesalahan. Itu terus memuat dan kosong-- seperti Anda hanya dapat melihat layar putih. Saya harus me-restart lagi dan lagi. Meskipun aplikasi Lazada tidak memiliki toko pakaian yang bagus, ada juga hal bagus seperti ini tempat saya membeli produk perawatan kulit. Saya tidak terlalu bagus dalam teknologi dan saya harap saya tidak salah. Tapi saya harap Anda mendengar kekhawatiran saya dan membaik.', 'hai,uhm,akhirakhir,aplikasi,lazada,lambat,fungsi,milik,koneksi,internet,kuat,kadang,ada,salah,terus,muat,kosong,seperti,anda,dapat,lihat,layar,putih,harus,merestart,meski,aplikasi,lazada,tidak,milik,toko,pakai,bagus,ada,hal,bagus,seperti,tempat,beli,produk,rawat,kulit,tidak,bagus,teknologi,harap,tidak,salah,harap,anda,dengar,khawatir,baik', -1, '2022-05-24 16:51:01', 0),
