(531, 'Mungkin Anda bisa mencoba menghapus saran/rekomendasi untuk barang yang sudah saya beli (setidaknya untuk beberapa minggu?) Apa gunanya saya ditampilkan pada barang yang saya beli dan menyadari bahwa saya seharusnya membelinya dari pedagang lain dengan harga lebih rendah/ promosi yang lebih baik?', 'anda,coba,hapus,saranrekomendasi,barang,sudah,beli,tidak,beberapa,minggu,guna,tampil,barang,beli,sadar,harus,beli,dagang,lain,harga,lebih,rendah,promosi,lebih,baik', -1, '2022-05-24 16:51:02', 0),
