(536, 'Barang saya telah \"dalam perjalanan\" selama lebih dari 24 jam sekarang meskipun fasilitas logistik sudah dekat. Saya pikir pengiriman menjadi malas dan baru saja mengembalikan barang ke fasilitas. Tidak ada \"upaya pengiriman\" dalam pelacakan paket saya.', 'barang,telah,jalan,selama,lebih,jam,meski,fasilitas,logistik,sudah,dekat,pikir,kirim,jadi,malas,baru,saja,kembali,barang,fasilitas,tidak,ada,upaya,kirim,lacak,paket', -1, '2022-05-24 16:51:03', 0),
(537, 'Telah menggunakan Lazada selama bertahun-tahun sekarang, sejauh ini pengalamannya layak jika bukan karena beberapa bug yang diperkenalkan di beberapa pembaruan, meskipun mereka merilis patch pengoptimalan, hanya berharap itu terjadi lebih teratur.', 'telah,guna,lazada,selama,bertahuntahun,jauh,alam,layak,bukan,beberapa,bug,kenal,beberapa,baru,meski,rilis,patch,optimal,harap,jadi,lebih,atur', 1, '2022-05-24 16:51:04', 0),
(538, 'Pengalaman aplikasi bagus. Tetapi akan lebih baik jika lazada berhenti secara otomatis memunculkan tautan ke unduhan aplikasi di banyak situs web karena itu cukup mengganggu karena saya sudah menjadi pelanggan tetap lazada. Semoga tim Pengembang mempertimbangkan hal ini dan memberikan umpan balik kepada tim pemasaran Anda. Terima kasih', 'alam,aplikasi,bagus,lebih,baik,lazada,henti,cara,otomatis,muncul,taut,unduh,aplikasi,banyak,situs,web,cukup,ganggu,sudah,jadi,langgan,lazada,moga,tim,kembang,timbang,hal,berik,umpan,balik,tim,asar,anda,terima,kasih', -1, '2022-05-24 16:51:04', 0),
(539, 'Ini bagus sejauh yang saya gunakan ... Saya hanya memberi peringkat 4 hanya karena jika ada sesuatu yang ingin Anda laporkan.. dan perlu mengobrol dengan agen mana pun.. Anda harus melalui obrolan dengan bot terlebih dahulu ... Kesal saya... Maaf tidak seperti yang lain .. jika Anda mengobrol perlu agen.. otomatis agen membalas u', 'bagus,jauh,guna,beri,peringkat,ada,suatu,ingin,anda,lapor,perlu,obrol,agen,mana,anda,harus,obrol,bot,lebih,dahulu,kesal,maaf,tidak,seperti,lain,anda,obrol,perlu,agen,otomatis,agen,balas,u', -1, '2022-05-24 16:51:04', 0),
(540, 'saya suka aplikasi ini karena sangat membantu saya harga sesuai dengan barang walaupun ada sf. dibandingkan dengan yang lain tidak ada kerumitan bagi saya untuk membeli apa yang saya inginkan. jadi saya beri 4 bintang. hal buruknya terkadang terlalu lama untuk mengirimkan barang. makanya saya kasih bintang 4 bukan bintang 5', 'suka,aplikasi,bantu,harga,sesuai,barang,walaupun,ada,sf,banding,lain,tidak,ada,kerumit,beli,ingin,jadi,beri,bintang,hal,buruk,kadang,lama,kirim,barang,makanya,kasih,bintang,bukan,bintang', -1, '2022-05-24 16:51:05', 0),
(541, 'Alasan saya kasih bintang 4 karena Lazada harus lebih ketat dalam menilai sellernya. Toko online dalam bahaya! Saya pernah memesan jersey sepeda dan penjual TIDAK memberi saya desain yang tepat! Juga, saya sudah memesan sebelumnya di toko di sini dan saya belum pernah menerima paketnya. Meski kasusnya adil dan terisolasi, tetap harus dijaga.', 'alas,kasih,bintang,lazada,harus,lebih,ketat,nilai,seller,toko,online,bahaya,mesan,jersey,sepeda,jual,tidak,beri,desain,tepat,sudah,mesan,belum,toko,sini,belum,terima,paket,meski,kasus,adil,isolasi,harus,jaga', 1, '2022-05-24 16:51:05', 0),
(542, 'Lazada memang hebat! Tetapi ketika saya memesan fidget pack (saya memesan poppit infinity cube dan beberapa hal lainnya) Ini juga menunjukkan akan ada lesung pipit sederhana tetapi ketika paket tiba tidak ada lesung pipit sederhana. Harap pastikan ini tidak terjadi lagi.', 'lazada,memang,hebat,ketika,mesan,fidget,pack,mesan,poppit,infinity,cube,beberapa,hal,lain,tunjuk,ada,lesung,pipit,sederhana,ketika,paket,tiba,tidak,ada,lesung,pipit,sederhana,harap,pasti,tidak,jadi', -1, '2022-05-24 16:51:05', 0),
(543, 'Aplikasi ini sangat berantakan dan terus-menerus mendorong penjualan. Sangat merusak. Dan jangan gunakan poslaju karena jelek. Alih-alih meletakkan parsel di dalam gerbang, mereka membawanya kembali ke tempat yang jauh. Juga staf malas itu tidak menjawab telepon.', 'aplikasi,berantak,terusmenerus,dorong,jual,rusak,guna,poslaju,jelek,alihalih,letak,parsel,gerbang,bawa,kembali,tempat,jauh,staf,malas,tidak,jawab,telepon', -1, '2022-05-24 16:51:05', 0),
(544, 'Platform yang cukup bagus, tetapi Anda mungkin menemukan bug sial, yang tidak dapat mengakses pesanan riwayat Anda (yang mungkin termasuk pesanan yang tidak diterima). Tunggu saja selama satu jam untuk pemulihan kembali.', 'platform,cukup,bagus,anda,temu,bug,sial,tidak,dapat,akses,pesan,riwayat,anda,masuk,pesan,tidak,terima,tunggu,saja,selama,satu,jam,pulih,kembali', -1, '2022-05-24 16:51:06', 0),
(545, 'Itu terjadi sekali.. Saya tidak bisa menggunakan uang saya di ewallet dan harus menarik uangnya.. dan jika Anda menggunakan kartu kredit Anda membutuhkan waktu lebih lama untuk mendapatkan pengembalian dana.', 'jadi,sekali,tidak,guna,uang,ewallet,harus,tarik,uang,anda,guna,kartu,kredit,anda,butuh,waktu,lebih,lama,dapat,kembali,dana', -1, '2022-05-24 16:51:06', 0),
(546, 'Kekurangannya hanya tidak bisa mencari order by order I\'d or keywords yang kita beli sebelumnya..harus scroll ke bawah 1 per 1 untuk menemukan order sebelumnya', 'kurang,tidak,cari,order,by,order,id,or,keywords,beli,sebelumnyaharus,scroll,bawah,per,temu,order,belum', 1, '2022-05-24 16:51:06', 0),
(547, 'Saya suka aplikasi ini karena saya tidak akan menyimpan saya hanya akan mendapatkan ponsel saya dan mulai mengklik. Dan salah satu bagian favorit saya adalah saya dapat membeli beberapa lego salah satu favorit saya????????????', 'suka,aplikasi,tidak,simpan,dapat,ponsel,mulai,klik,salah,satu,favorit,dapat,beli,beberapa,lego,salah,satu,favorit', -1, '2022-05-24 16:51:06', 0);
INSERT INTO `skripsi_rekap` (`no`, `komentar`, `stem`, `sentimen`, `tgl`, `flag`) VALUES
(548, 'Terkadang sulit menemukan voucher. Promosi ada dimana-mana, tidak fokus. Bisa ditingkatkan agar lebih user friendly ????', 'kadang,sulit,temu,voucher,promosi,ada,dimanamana,tidak,fokus,tingkat,lebih,user,friendly', 1, '2022-05-24 16:51:06', 0),
(549, 'Aplikasi berfungsi. Satu-satunya masalah saya adalah selalu macet selama streaming Langsung itu sebabnya saya kehilangan game dan kontes Langsung.', 'aplikasi,fungsi,satusatu,masalah,macet,selama,streaming,langsung,sebab,hilang,game,kontes,langsung', -1, '2022-05-24 16:51:07', 0),
(550, 'Selamat berbelanja...praktis, mudah dan harga terjangkau apalagi di masa pandemi ini.', 'selamat,berbelanjapraktis,mudah,harga,jangkau,apalagi,masa,pandemi', 1, '2022-05-24 16:51:07', 0),
(551, 'Akhir-akhir ini, saya perhatikan, lazada baik-baik saja. Dari segi sistem sudah stabil. Dibandingkan dengan bencana sebelumnya. Hal tentang lazada adalah, terkadang persyaratan pengiriman gratis terlalu tinggi. Jadi itu sangat berharga ketika datang ke hari penjualan besar. Bagaimanapun, tidak ada masalah dengan 6.6. Masih belum puas mendapatkan 5 bintang karena beberapa persyaratan untuk menggunakan voucher.', 'akhirakhir,hati,lazada,baikbaik,saja,segi,sistem,sudah,stabil,banding,bencana,belum,hal,tentang,lazada,kadang,syarat,kirim,gratis,tinggi,jadi,harga,ketika,datang,hari,jual,besar,bagaimana,tidak,ada,masalah,masih,belum,puas,dapat,bintang,beberapa,syarat,guna,voucher', -1, '2022-05-24 16:51:07', 0),
(552, 'minimal 199 pembelanjaan gratis pengiriman setiap hari i love it!!!!! koin gratis yang mudah, tetapi aplikasi memuat terlalu lambat dan terlalu banyak halaman untuk dibalik membuatnya membingungkan', 'minimal,belanja,gratis,kirim,tiap,hari,i,love,it,koin,gratis,mudah,aplikasi,muat,lambat,banyak,halaman,balik,buat,bingung', -1, '2022-05-24 16:51:08', 0),
(553, 'itu bagus! tapi hanya ada masalah; aplikasi ini tidak terlalu dioptimalkan. lag di beberapa bagian', 'bagus,ada,masalah,aplikasi,tidak,optimal,lag,beberapa', -1, '2022-05-24 16:51:08', 0),
(554, 'Komprehensif, up to date dan sangat nyaman. Tetapi memiliki terlalu banyak pembaruan platform dan tidak berfungsi atau memuat dengan lancar pada smartphone kelas bawah.', 'komprehensif,up,to,date,nyaman,milik,banyak,baru,platform,tidak,fungsi,muat,lancar,smartphone,kelas,bawah', 1, '2022-05-24 16:51:08', 0),
(555, 'Beli jam tangan dari Lazada. Namun, satu tidak bekerja pada menerima. Tidak bisa mendapatkan pengembalian dana karena kesulitan memasukkan format. Masih ada jam di cold storage.', 'beli,jam,tangan,lazada,satu,tidak,kerja,terima,tidak,dapat,kembali,dana,sulit,masuk,format,masih,ada,jam,cold,storage', 1, '2022-05-24 16:51:08', 0),
(556, 'Bagus. Saya hanya menilai ini 4 karena saya tidak bisa memasukkan voucher ketika saya akan membeli sesuatu dan ketika saya akan membeli produk di keranjang saya, harganya akan naik, jadi seperti kita akan membayar uang tambahan daripada membayar harga yang tepat yang terdapat pada produk sebelum memesannya', 'bagus,nilai,tidak,masuk,voucher,ketika,beli,suatu,ketika,beli,produk,keranjang,harga,naik,jadi,seperti,bayar,uang,tambah,daripada,bayar,harga,tepat,dapat,produk,belum,mesan', -1, '2022-05-24 16:51:08', 0),
(557, 'sangat berguna tetapi saya merasa tidak ramah pengguna. Proses pengembalian dana sulit dipahami.', 'guna,rasa,tidak,ramah,guna,proses,kembali,dana,sulit,paham', -1, '2022-05-24 16:51:08', 0),
(558, 'Saya menggunakannya dan ini pertama kalinya. Saya suka harga. Semoga kualitas barang sangat baik.', 'guna,pertama,kali,suka,harga,moga,kualitas,barang,baik', 1, '2022-05-24 16:51:08', 0),
(559, 'Aplikasi ini mudah digunakan, penjualnya akomodatif dan pengirimannya ditangani dengan hati-hati.', 'aplikasi,mudah,guna,jual,akomodatif,kirim,tangan,hatihati', -1, '2022-05-24 16:51:09', 0),
(560, 'Sejauh ini pengalamannya bagus meski ada beberapa penjual yang tidak jujur ??kepada pembelinya. Berharap mereka dapat mengontrol dan menemukan cara untuk menyelesaikan masalah semacam ini. Tetapi secara keseluruhan, lebih mudah, membantu, dan lebih banyak item untuk dipilih daripada toko online lainnya. Dan itu lebih ramah pengguna daripada toko-toko itu.', 'jauh,alam,bagus,meski,ada,beberapa,jual,tidak,jujur,beli,harap,dapat,kontrol,temu,cara,selesai,masalah,macam,cara,seluruh,lebih,mudah,bantu,lebih,banyak,item,pilih,daripada,toko,online,lain,lebih,ramah,guna,daripada,tokotoko', -1, '2022-05-24 16:51:09', 0),
(561, 'Hai! Bisakah Anda memeriksa aplikasi. Saya telah mengalami pemberitahuan ini selama berhari-hari: \"Maaf, kami telah mendeteksi lalu lintas yang tidak biasa dari jaringan Anda.\" Ada tombol geser untuk memverifikasi tetapi tidak berfungsi atau membantu sama sekali. Ini bisa menjadi bug sistem!', 'hai,anda,periksa,aplikasi,telah,alami,beritahu,selama,berharihari,maaf,telah,deteksi,lintas,tidak,biasa,jaring,anda,ada,tombol,geser,verifikasi,tidak,fungsi,bantu,sama,sekali,jadi,bug,sistem', -1, '2022-05-24 16:51:09', 0),
(562, 'Saya sangat menyukai peta pelacak pengiriman karena cukup akurat untuk memantau pengendara terutama jika mereka berada di tikungan. Tetapi baru-baru ini saya pikir ada beberapa bug di mana peta tidak muncul. Perlu menutup dan membuka beberapa kali untuk membuatnya muncul. Tolong perbaiki bugnya.', 'suka,peta,lacak,kirim,cukup,akurat,pantau,kendara,utama,rada,tikung,barubaru,pikir,ada,beberapa,bug,mana,peta,tidak,muncul,perlu,tutup,buka,beberapa,kali,buat,muncul,tolong,baik,bug', 1, '2022-05-24 16:51:10', 0),
(563, 'Memuat terkadang lambat atau gagal, tetapi secara keseluruhan aplikasi bagus.', 'muat,kadang,lambat,gagal,cara,seluruh,aplikasi,bagus', -1, '2022-05-24 16:51:10', 0),
(564, 'Kadang-kadang membingungkan, karena sebagian besar dalam bahasa Thailand dan saya bahasa Inggris.', 'kadangkadang,bingung,besar,bahasa,thailand,bahasa,inggris', -1, '2022-05-24 16:51:10', 0),
(565, 'Ok untuk digunakan tapi saya tidak mengerti mengapa pengiriman itu tidak menambahkan pengiriman lain seperti jnt , poslaju , DHL Express , Ninja Express atau Century Express . Saya tidak dapat menerima penggunaan pengiriman standar hanya karena saya memesan sesuatu tentang RM150 dan petugas pengiriman tidak dapat menemukan rumah saya tetapi tidak apa-apa tetapi petugas pengiriman menelepon seperti hari ini dan produk belum tiba di rumah saya dan petugas pengiriman baru saja menandatangani terima dan tidak sampai seperti 2 hari sudah jadi tolong beri alasannya', 'ok,guna,tidak,erti,kirim,tidak,tambah,kirim,lain,seperti,jnt,poslaju,dhl,express,ninja,express,century,express,tidak,dapat,terima,guna,kirim,standar,mesan,suatu,tentang,rm,tugas,kirim,tidak,dapat,temu,rumah,tidak,apaapa,tugas,kirim,telepon,seperti,hari,produk,belum,tiba,rumah,tugas,kirim,baru,saja,menandatangani,terima,tidak,sampai,seperti,hari,sudah,jadi,tolong,beri,alas', -1, '2022-05-24 16:51:10', 0),
(566, 'Produk berkualitas dan otentik dalam aplikasi dan banyak promo pengiriman gratis! Sayangnya saya tidak dapat menggunakan koin di item APAPUN yang ingin saya beli sebagai diskon secara gratis (hanya berlaku untuk item tertentu). Juga tidak dapat menempatkan instruksi khusus untuk pengiriman sebelum check out. Saya juga memiliki masalah dengan lencana jumlah bagian Pesanan Saya karena tidak diperbarui secara real time dan terkadang tidak tetapi tidak akurat. Semoga tim pengembang dapat segera memperbaikinya.', 'produk,kualitas,otentik,aplikasi,banyak,promo,kirim,gratis,sayang,tidak,dapat,guna,koin,item,ingin,beli,bagai,diskon,cara,gratis,berla,item,tentu,tidak,dapat,tempat,instruksi,khusus,kirim,belum,check,out,milik,masalah,lencana,jumlah,pesan,tidak,baru,cara,real,time,kadang,tidak,tidak,akurat,moga,tim,kembang,dapat,segera,baik', -1, '2022-05-24 16:51:11', 0),
(567, 'Saya telah menjadi pelindung setia Lazada. Saya hanya mendapat satu pesanan yang gagal dan mereka tidak dapat mengirimkan hadiah untuk putri saya Mei lalu. Saya tidak tahu mungkin masalahnya ada di agen pengiriman. Tapi itu hanya terjadi sekali. Berharap itu tidak akan pernah terjadi lagi. Tapi secara keseluruhan saya suka aplikasinya. Memiliki banyak pilihan untuk memilih produk, koin, dan voucher untuk mendapatkan diskon dan berharap saya dapat memenangkan harga harian mereka. Terima kasih Lazada!', 'telah,jadi,lindung,setia,lazada,dapat,satu,pesan,gagal,tidak,dapat,kirim,hadiah,putri,mei,tidak,tahu,masalah,ada,agen,kirim,jadi,sekali,harap,tidak,jadi,cara,seluruh,suka,aplikasi,milik,banyak,pilih,pilih,produk,koin,voucher,dapat,diskon,harap,dapat,menang,harga,hari,terima,kasih,lazada', -1, '2022-05-24 16:51:11', 0),
(568, 'Saya mencoba untuk memesan flash deal dan mereka mengatakan jaringan sedang sibuk .. bahkan beban seluler mereka memberi tahu terlalu banyak lalu lintas .. Semua pesanan dikirim dan bahkan produknya bagus tetapi satu-satunya hal adalah flash deal yang ditunggu-tunggu penawaran flash tetapi hasilnya tidak bagus saya kecewa.????????', 'coba,mesan,flash,deal,atak,jaring,sibuk,bahkan,beban,seluler,beri,tahu,banyak,lintas,semua,pesan,kirim,bahkan,produk,bagus,satusatu,hal,flash,deal,ditunggutunggu,awar,flash,hasil,tidak,bagus,kecewa', 1, '2022-05-24 16:51:12', 0),
(569, 'Lebih murah hati dengan voucher tidak seperti aplikasi lain. Itu sebabnya saya sepenuhnya beralih menggunakan Lazada. Jika ada satu fitur yang ingin saya tambahkan, itu adalah fitur layar terpisah sehingga saya bisa melakukan screenshop sambil melakukan hal-hal lain. Terima kasih!', 'lebih,murah,hati,voucher,tidak,seperti,aplikasi,lain,sebab,penuh,alih,guna,lazada,ada,satu,fitur,ingin,tambah,fitur,layar,pisah,sehingga,laku,screenshop,sambil,laku,halhal,lain,terima,kasih', -1, '2022-05-24 16:51:12', 0),
(570, 'Aplikasi Lazada sangat bagus untuk digunakan dengan voucher pengiriman gratis! Satu hal yang saya tidak suka adalah verifikasi keamanan di sini dan browser ketika saya tidak dapat masuk karena waktu sibuk dan penjualan. Dan itu bahkan tidak berfungsi ketika meminta email atau teks.', 'aplikasi,lazada,bagus,guna,voucher,kirim,gratis,satu,hal,tidak,suka,verifikasi,aman,sini,browser,ketika,tidak,dapat,masuk,waktu,sibuk,jual,bahkan,tidak,fungsi,ketika,minta,email,teks', -1, '2022-05-24 16:51:12', 0),
(571, 'Semuanya bagus tetapi berharap memiliki mode lansekap di tablet... ini akan bagus di tablet Android. Kenapa Lazada kenapa!?', 'semua,bagus,harap,milik,mode,lansekap,tablet,bagus,tablet,android,kenapa,lazada,kenapa', -1, '2022-05-24 16:51:12', 0),
(572, 'Aplikasi ini sangat membantu dan nyaman, meskipun 4 bintang karena biaya pengiriman sangat mahal tetapi aplikasi ini benar-benar membuat saya takjub karena sangat nyaman untuk menggunakannya dan mudah, juga voucher saya menyukainyatt', 'aplikasi,bantu,nyaman,meski,bintang,biaya,kirim,mahal,aplikasi,benarbenar,buat,takjub,nyaman,guna,mudah,voucher,menyukainyatt', -1, '2022-05-24 16:51:12', 0),
(573, 'Layanan yang baik. Tindakan yang sangat cepat. Tapi entah kenapa kualitasnya tidak terlalu diantisipasi.', 'layan,baik,tindak,cepat,entah,kenapa,kualitas,tidak,antisipasi', 1, '2022-05-24 16:51:13', 0),
(574, '1. tidak bisa kembali berbelanja dengan mudah setelah memeriksa keranjang. 2. perkiraan tanggal pengiriman kacau. 3. Pencarian dapat ditingkatkan Jika tidak, tidak apa-apa', 'tidak,kembali,belanja,mudah,sete,periksa,keranjang,kira,tanggal,kirim,kacau,cari,dapat,tingkat,tidak,tidak,apaapa', -1, '2022-05-24 16:51:13', 0),
(575, 'Saya sering kali perlu menutup dan memulai ulang aplikasi agar saya dapat melihat gambar dan komentar ketika saya ingin menelusuri ulasan produk yang akan saya beli.', 'sering,kali,perlu,tutup,mulai,ulang,aplikasi,dapat,lihat,gambar,komentar,ketika,ingin,telusur,ulas,produk,beli', -1, '2022-05-24 16:51:13', 0),
(576, 'Pemilihan alamat sangat mengganggu, mengapa tidak pernah kembali ke alamat default setelah melakukan pemesanan menggunakan alamat opsional. Aplikasi seharusnya kembali ke alamat default setelah kami melakukan pemesanan! Saya telah memesan beberapa dengan pemilihan alamat yang salah!', 'pilih,alamat,ganggu,tidak,kembali,alamat,default,sete,laku,mesan,guna,alamat,opsional,aplikasi,harus,kembali,alamat,default,sete,laku,mesan,telah,mesan,beberapa,pilih,alamat,salah', -1, '2022-05-24 16:51:13', 0),
(577, 'Bagus, tapi vouchernya agak membingungkan saya, tidak tahu apakah itu tersedia untuk digunakan dan bagaimana menggunakannya, akan lebih baik untuk mengubah bagian ini.', 'bagus,voucher,agak,bingung,tidak,tahu,apakah,sedia,guna,bagaimana,guna,lebih,baik,ubah', -1, '2022-05-24 16:51:14', 0),
(578, 'Pada dasarnya aplikasi yang sangat bagus - tetapi jika ada yang salah dengan pesanan Anda, kemungkinan keluhan ditindaklanjuti oleh Lazada (dan bukan pemasok) terbatas.', 'dasar,aplikasi,bagus,ada,salah,pesan,anda,keluh,ditindaklanjuti,lazada,bukan,pasok,batas', -1, '2022-05-24 16:51:14', 0),
