(742, 'Saya menemukan Anda tidak dapat membuat keputusan cepat pada produk apapun. Memilih sepasang sepatu kets dan hendak membelinya ketika saya diarahkan ke sepasang sepatu yang tidak ditampilkan dalam daftar sepatu kets. Itu adalah perubahan yang mudah dilakukan. Bukan hanya harga tapi juga mereknya. Banyak jika tidak sebagian besar produk Anda luar biasa, masalahnya adalah ukuran dan konsistensi mengikuti grafik. Tampaknya juga ada sikap yang cukup dekat dan akan mengirimkannya meskipun itu tidak cocok dengan apa yang saya pilih. Mengecewakan!', 'temu,anda,tidak,dapat,buat,putus,cepat,produk,pilih,pasang,sepatu,kets,hendak,beli,ketika,arah,pasang,sepatu,tidak,tampil,daftar,sepatu,kets,rubah,mudah,laku,bukan,harga,merek,banyak,tidak,besar,produk,anda,biasa,masalah,ukur,konsistensi,ikut,grafik,tampak,ada,sikap,cukup,dekat,kirim,meski,tidak,cocok,pilih,kecewa', -1, '2022-05-24 16:51:41', 0),
