(747, 'Aplikasi itu sendiri sangat bagus. Ini ramah pengguna. Tapi takut ditipu. Saya ditipu berkali-kali tetapi saya ingin memberi lazada keuntungan dari keraguan. Saya tidak memiliki kemewahan untuk membeli barang-barang mahal itu sebabnya saya mengambil kesempatan untuk memesan item kotak misteri yang menjanjikan untuk mengirimi saya ponsel yang sah dan kelas atas dengan gadget elektronik gratis. Terima kasih.', 'aplikasi,sendiri,bagus,ramah,guna,takut,tipu,tipu,berkalikali,ingin,beri,lazada,untung,ragu,tidak,milik,mewah,beli,barangbarang,mahal,sebab,ambil,sempat,mesan,item,kotak,misteri,janji,kirim,ponsel,sah,kelas,gadget,elektronik,gratis,terima,kasih', -1, '2022-05-24 16:51:42', 0),
