(765, 'Saya tidak tahu apakah itu hanya di pihak saya, tetapi Daftar Keinginan Saya kacau. Tidak dapat menemukan beberapa item yang telah saya sematkan dan tidak diatur dalam urutan yang logis. Beberapa item bahkan hilang. Lebih baik jika Daftar Keinginan memiliki beberapa opsi pengurutan, seperti naik/turun berdasarkan tanggal. Selain itu, aplikasi ini cukup layak untuk mengumpulkan 5 bintang dari saya.', 'tidak,tahu,apakah,pihak,daftar,ingin,kacau,tidak,dapat,temu,beberapa,item,telah,sematkan,tidak,atur,urut,logis,beberapa,item,bahkan,hilang,lebih,baik,daftar,ingin,milik,beberapa,opsi,urut,seperti,naikturun,dasar,tanggal,selain,aplikasi,cukup,layak,kumpul,bintang', -1, '2022-05-24 16:51:45', 0),
