(767, 'Mudah digunakan untuk pembelian normal tetapi jika Anda perlu menggunakan fungsi lain seperti obrolan dll. Masih lebih intuitif untuk menggunakan portal berbasis browser. Perbaikan yang mungkin dilakukan adalah dengan mengizinkan fungsi pencarian dari riwayat pembelian. Setiap kali saya perlu merujuk ke pembelian saya sebelumnya, saya harus menelusuri setiap item yang hanya membuang-buang waktu. Agar adil, situs web juga memiliki kelemahan serupa.', 'mudah,guna,beli,normal,anda,perlu,guna,fungsi,lain,seperti,obrol,dll,masih,lebih,intuitif,guna,portal,basis,browser,baik,laku,izin,fungsi,cari,riwayat,beli,tiap,kali,perlu,rujuk,beli,belum,harus,telusur,tiap,item,membuangbuang,waktu,adil,situs,web,milik,lemah,rupa', 1, '2022-05-24 16:51:46', 0),
