(778, 'Aplikasi jauh lebih ramah pengguna dibandingkan dengan Shopee. Hal terbaik adalah dapat melacak pengiriman pada hari itu dengan melihat di mana truk itu berada. Sekarang kita dapat menempatkan catatan pengiriman mis. Pengambilan oleh penjaga pintu atau berikan instruksi untuk menyerahkannya kepada petugas/tetangga. Mirip dengan cara kerja Amazon. Kelemahannya adalah harga di sini untuk barang yang sama lebih tinggi dibandingkan dengan Shopee. Seleksi juga terbatas. Bagus untuk barang-barang fashion China, banyak tersedia.', 'aplikasi,jauh,lebih,ramah,guna,banding,shopee,hal,baik,dapat,lacak,kirim,hari,lihat,mana,truk,rada,dapat,tempat,catat,kirim,mis,ambil,jaga,pintu,berik,instruksi,serah,petugastetangga,mirip,cara,kerja,amazon,lemah,harga,sini,barang,sama,lebih,tinggi,banding,shopee,seleksi,batas,bagus,barangbarang,fashion,china,banyak,sedia', -1, '2022-05-24 16:51:49', 0),
(779, 'Sangat nyaman untuk berbelanja', 'nyaman,belanja', -1, '2022-05-24 16:51:49', 0),
(780, 'Telah menggunakan Aplikasi ini sejak 2017, Sangat suka menggunakan dan bertahan karena peningkatan yang baik dari pengembang, dan membeli 185 produk hingga hari ini. Semuanya bagus! Tapi 4 Bintang hanya untuk yang satu ini, Mengunggah foto di bagian ulasan, Mengapa Anda tidak mengunggahnya satu batch dari 5 foto seperti teman Anda Pak S, alih-alih mengunggahnya satu per satu, Itu saja, lainnya selain itu Aplikasi ini lebih dari sempurna, Terima kasih telah membuat belanja kami cepat dan mudah. ????', 'telah,guna,aplikasi,sejak,suka,guna,tahan,tingkat,baik,kembang,beli,produk,hingga,hari,semua,bagus,bintang,satu,unggah,foto,ulas,anda,tidak,unggah,satu,batch,foto,seperti,teman,anda,s,alihalih,unggah,satu,per,satu,saja,lain,selain,aplikasi,lebih,sempurna,terima,kasih,telah,buat,belanja,cepat,mudah', -1, '2022-05-24 16:51:50', 0),
(781, 'Aplikasinya oke, hanya saja tidak ada cara untuk menaruh petunjuk pengiriman. Sangat penting bagi pelanggan yang tidak ingin paketnya diterima oleh orang lain selain pembeli itu sendiri, atau mereka yang alamatnya tidak terlalu spesifik (di luar Metro Manila)', 'aplikasi,oke,saja,tidak,ada,cara,taruh,tunjuk,kirim,penting,langgan,tidak,ingin,paket,terima,orang,lain,selain,beli,sendiri,alamat,tidak,spesifik,metro,manila', -1, '2022-05-24 16:51:51', 0),
