(783, 'Toko tidak memeriksa apakah penjual mereka menjual barang yang sah dan jika barang melebihi harga, mereka tidak melarang toko ini bahkan jika Anda melaporkannya', 'toko,tidak,periksa,apakah,jual,jual,barang,sah,barang,lebih,harga,tidak,larang,toko,bahkan,anda,lapor', 1, '2022-05-24 16:51:51', 0),
(784, 'Sungguh menakjubkan bahwa sebagai aplikasi lokal saya pikir itu akan memiliki banyak masalah tetapi secara keseluruhan pekerjaan yang baik dalam memasang aplikasi ini selama bertahun-tahun, dengan semua staf Anda yang hebat dan pengiriman yang cepat, semoga masih akan melakukan pekerjaan dengan baik di masa depan dan tidak berantakan up barang yang dipesan. Terima kasih banyak, Selamat Ulang Tahun Lazada.', 'sungguh,takjub,bagai,aplikasi,lokal,pikir,milik,banyak,masalah,cara,seluruh,kerja,baik,pasang,aplikasi,selama,bertahuntahun,semua,staf,anda,hebat,kirim,cepat,moga,masih,laku,kerja,baik,masa,depan,tidak,berantak,up,barang,pesan,terima,kasih,banyak,selamat,ulang,tahun,lazada', -1, '2022-05-24 16:51:52', 0),
(785, 'Aplikasi Hebat, Tapi Harus Ada pilihan untuk menjadwalkan kapan menerima paket Anda, berdasarkan perkiraan tanggal.. saya harap fitur ini akan diterapkan karena Anda dapat menjadwalkan semua pesanan/paket Anda satu kali.. dan Anda hanya perlu bertemu kurir sekali.. kurang repot untuk saya dan untuk mitra pengiriman.. terima kasih', 'aplikasi,hebat,harus,ada,pilih,jadwal,kapan,terima,paket,anda,dasar,kira,tanggal,harap,fitur,terap,anda,dapat,jadwal,semua,pesananpaket,anda,satu,kali,anda,perlu,berte,kurir,sekali,kurang,repot,mitra,kirim,terima,kasih', -1, '2022-05-24 16:51:52', 0),
