(1040, 'Aplikasi Lazada untuk pembelian berbagai jenis barang memang luar biasa. Tapi masalahnya, layanan pengiriman perlu ditingkatkan dan memiliki perutean dan penjadwalan yang baik untuk manajemen masa depan. Setelah pelanggan selesai membeli barang, akan ada menunggu barang mereka sesegera mungkin. Jadi, pastikan untuk memberikan standar yang tinggi untuk layanan pengiriman.', 'aplikasi,lazada,beli,bagai,jenis,barang,memang,biasa,masalah,layan,kirim,perlu,tingkat,milik,rute,jadwal,baik,manajemen,masa,depan,sete,langgan,selesai,beli,barang,ada,tunggu,barang,segera,jadi,pasti,berik,standar,tinggi,layan,kirim', -1, '2022-05-24 16:52:41', 0),
(1041, 'Berbelanja di Lazada sangat menyenangkan. Kebijakan pengembalian adalah adil dan mudah. Tapi ... aplikasi ini semakin buruk dengan setiap pembaruan. Seolah-olah pengembang tidak pernah berbelanja online. Masalah terbaru: Anda tidak dapat lagi memilih (dan menyalin) teks ulasan, sehingga Anda tidak dapat lagi menerjemahkannya. Mengambil atau melampirkan foto (wajib) ke pengembalian beberapa item akan menghapus seluruh layar pengembalian. Dan seterusnya.... Lazada, dengarkan pelanggan Anda.', 'belanja,lazada,senang,bijak,kembali,adil,mudah,aplikasi,makin,buruk,tiap,baru,seolaho,kembang,tidak,belanja,online,masalah,baru,anda,tidak,dapat,pilih,salin,teks,ulas,sehingga,anda,tidak,dapat,terjemah,ambil,lampir,foto,wajib,kembali,beberapa,item,hapus,seluruh,layar,kembali,terus,lazada,dengar,langgan,anda', -1, '2022-05-24 16:52:42', 0),
(1042, 'Saya mengedit ulasan saya sejak Sudah bertahun-tahun sekarang. Aplikasinya bagus dan semua kecuali beberapa penjual harus memberi pelajaran. Mereka secara acak menempatkan beberapa judul produk dan menipu pelanggan. Seperti aku sudah melakukan ini ratusan kali. Jika saja Anda bisa memberikan pilihan untuk melaporkan toko atau penjual itu, itu akan sangat membantu semua orang. Uang tidak hanya tumbuh di pohon dan beberapa toko tidak hanya mengambil uang orang tetapi juga kebahagiaan mereka. Saya tidak puas dengan ini. Lebih baik periksa ulang aplikasi mereka terlebih dahulu .', 'edit,ulas,sejak,sudah,bertahuntahun,aplikasi,bagus,semua,kecuali,beberapa,jual,harus,beri,ajar,cara,acak,tempat,beberapa,judul,produk,tipu,langgan,seperti,sudah,laku,ratus,kali,saja,anda,berik,pilih,lapor,toko,jual,bantu,semua,orang,uang,tidak,tumbuh,pohon,beberapa,toko,tidak,ambil,uang,orang,bahagia,tidak,puas,lebih,baik,periksa,ulang,aplikasi,lebih,dahulu', -1, '2022-05-24 16:52:42', 0),
(1043, 'TOLONG PERBAIKI. Ketika saya melihat barang-barang itu di \'\'keranjang saya\'\', misalnya saya mengklik item 15 di daftar keranjang saya untuk melihat produk, dan ketika saya mengklik \'kembali\', itu akan kembali ke daftar teratas dan saya perlu schroll semua jalan ke bawah untuk memeriksa produk lain. Bagaimana jika saya memiliki banyak barang di keranjang saya? Setiap kali saya harus menanggung dengan antarmuka yang tidak ramah pengguna ini?', 'tolong,baik,ketika,lihat,barangbarang,keranjang,misal,klik,item,daftar,keranjang,lihat,produk,ketika,klik,kembali,kembali,daftar,perlu,schroll,semua,jalan,bawah,periksa,produk,lain,bagaimana,milik,banyak,barang,keranjang,tiap,kali,harus,tanggung,antarmuka,tidak,ramah,guna', -1, '2022-05-24 16:52:43', 0),
(1044, '6.77.0 pesan obrolan streaming langsung tidak berfungsi. Pesan sepertinya hilang. Banyak streaming, tuan rumah meminta pemirsa untuk mengirim komentar sebanyak mungkin untuk terlibat dan saya pikir aplikasi baru memblokir pesan-pesan ini. Bagaimana kami membalas host jika Anda memfilter pesan ini? Dan jika saya keluar dan masuk ke aliran, saya tidak dapat memeriksa kembali pesan yang telah dikirim, bagaimana kami mengetahui produk apa yang sedang dipromosikan?', 'pesan,obrol,streaming,langsung,tidak,fungsi,pesan,seperti,hilang,banyak,streaming,tuan,rumah,minta,pirsa,kirim,komentar,banyak,libat,pikir,aplikasi,baru,blokir,pesanpesan,bagaimana,balas,host,anda,filter,pesan,keluar,masuk,alir,tidak,dapat,periksa,kembali,pesan,telah,kirim,bagaimana,mengetahui,produk,promosi', -1, '2022-05-24 16:52:43', 0),
(1045, 'Ada beberapa penjual yang tidak pernah mengecek barang yang akan dikirim, Ada beberapa yang cacat, terutama barang yang menggunakan baterai atau listrik. Semoga komentar ini dapat memberikan perhatian dan kesadaran kepada penjual yang tidak bertanggung jawab tidak memeriksa barang, dan hanya menjual, pembeli membayar mereka uang yang diperoleh dengan susah payah.', 'ada,beberapa,jual,tidak,ecek,barang,kirim,ada,beberapa,cacat,utama,barang,guna,baterai,listrik,moga,komentar,dapat,berik,hati,sadar,jual,tidak,tanggung,jawab,tidak,periksa,barang,jual,beli,bayar,uang,susah,payah', -1, '2022-05-24 16:52:44', 0),
(1046, 'Antarmuka pengguna berantakan, tidak terorganisir, sehingga sulit untuk menemukan item tertentu. Fitur pemfilteran item bisa lebih baik. Kriteria filter terbatas. Navigasi melalui aplikasi tidak menyenangkan, perlu banyak menggulir. Saya berharap akan ada opsi untuk memblokir obrolan dari orang/penjual tertentu. Iklan Lazada: Di mana-mana online. Fasilitas: kalkulator pengiriman otomatis, voucher gratis.', 'antarmuka,guna,berantak,tidak,terorganisir,sehingga,sulit,temu,item,tentu,fitur,filter,item,lebih,baik,kriteria,filter,batas,navigasi,aplikasi,tidak,senang,perlu,banyak,gulir,harap,ada,opsi,blokir,obrol,orangpenjual,tentu,iklan,lazada,manamana,online,fasilitas,kalkulator,kirim,otomatis,voucher,gratis', -1, '2022-05-24 16:52:44', 0),
(1047, 'Hal yang baik tentang lazada adalah apa pun yang Anda cari, jika tidak ada di shopee, ada di lazada. Bagus sih tapi ongkos kirimnya terlalu mahal dibanding shopee, isi tidak tertata saat mencari produk, dan harga produk lebih mahal dari shopee.', 'hal,baik,tentang,lazada,anda,cari,tidak,ada,shopee,ada,lazada,bagus,sih,ongkos,kirim,mahal,banding,shopee,isi,tidak,tata,cari,produk,harga,produk,lebih,mahal,shopee', 1, '2022-05-24 16:52:44', 0),
(1048, 'Lebih sedikit buggy dan lebih banyak opsi filter daripada aplikasi Shopee, tetapi antarmuka pengguna dikemas dengan terlalu banyak informasi -- benar-benar harus disederhanakan: Saya terkadang pusing hanya dengan melihatnya, terutama saat mengendarai kendaraan selama perjalanan saya.', 'lebih,sedikit,buggy,lebih,banyak,opsi,filter,daripada,aplikasi,shopee,antarmuka,guna,kemas,banyak,informasi,benarbenar,harus,sederhana,kadang,pusing,lihat,utama,kendara,kendara,selama,jalan', -1, '2022-05-24 16:52:45', 0),
(1049, 'Saya sudah banyak membeli banyak barang melalui Lazada dan puas dengan barangnya sampai sekarang. Saya mengambil pengiriman driver golf yang dibuat oleh Taylormade SIM MAX 9.0..Gagal.. Retak muncul di tepi depan atas dan pelat sekrup pemberat di bagian belakang kepala terlipat ke dalam tidak ada cara untuk mengambil pelat dan sekrup. .Biaya ini adalah 4800 bht ..Ini adalah salinan yang buruk dan saya ingin kompensasi Saya menantikan balasan Anda .Atau Anda bisa mengganti kepala .', 'sudah,banyak,beli,banyak,barang,lazada,puas,barang,sampai,ambil,kirim,driver,golf,buat,taylormade,sim,max,gagal,retak,muncul,tepi,depan,pelat,sekrup,berat,belakang,kepala,lipat,tidak,ada,cara,ambil,pelat,sekrup,biaya,bht,salin,buruk,ingin,kompensasi,balas,anda,anda,ganti,kepala', 1, '2022-05-24 16:52:45', 0),
(1050, 'Navigasi aplikasi tidak ramah, terutama jika Anda ingin kembali ke halaman utama. Akan sulit bagi pengguna yang tidak mau belajar sendiri tentang cara menggunakannya secara efektif, tetapi bagi seseorang seperti saya, yang suka menjelajahi fungsi aplikasi, akan dapat menavigasi kembali.', 'navigasi,aplikasi,tidak,ramah,utama,anda,ingin,kembali,halaman,utama,sulit,guna,tidak,ajar,sendiri,tentang,cara,guna,cara,efektif,seseorang,seperti,suka,jelajah,fungsi,aplikasi,dapat,navigasi,kembali', -1, '2022-05-24 16:52:45', 0),
(1051, 'harga barangnya terjangkau, tapi ongkos kirimnya, omg,, saya benar-benar tidak mampu???? berharap Anda akan menurunkan biaya pengiriman Anda lain kali, saya akan uninstall jika untuk sementara lol.', 'harga,barang,jangkau,ongkos,kirim,omg,benarbenar,tidak,mampu,harap,anda,turun,biaya,kirim,anda,lain,kali,uninstall,sementara,lol', 1, '2022-05-24 16:52:46', 0),
(1052, 'Setelah pembaruan terbaru, saya tidak dapat melihat semua daftar keinginan saya. Jumlahnya benar tetapi halaman tidak menampilkan apa-apa. Ini hal yang buruk untuk dialami', 'sete,baru,baru,tidak,dapat,lihat,semua,daftar,ingin,jumlah,benar,halaman,tidak,tampil,apaapa,hal,buruk,alami', 1, '2022-05-24 16:52:46', 0),
(1053, 'Antarmuka pengguna yang buruk seperti yang disebutkan orang lain. Apakah penjual cerdik mengirim produk yang salah (versi lebih murah). Sempat kerepotan mengembalikan produk. Saya telah mencari pengembalian dana sebelumnya dan antarmuka yang membingungkan dan fakta bahwa tidak ada yang mendesak yang ingin saya beli, saya tidak melihat ke dalamnya. Sekarang Ketika saya pergi untuk membeli sesuatu, voucher pengembalian dana telah kedaluwarsa dan meskipun petugas layanan pelanggan menemukan infonya, tidak dapat mengembalikan pengembalian dana. Perbarui_ mereka datang dengan pengembalian dana.', 'antarmuka,guna,buruk,seperti,sebut,orang,lain,apakah,jual,cerdik,kirim,produk,salah,versi,lebih,murah,sempat,kerepot,kembali,produk,telah,cari,kembali,dana,belum,antarmuka,bingung,fakta,tidak,ada,desak,ingin,beli,tidak,lihat,ketika,pergi,beli,suatu,voucher,kembali,dana,telah,kedaluwarsa,meski,tugas,layan,langgan,temu,info,tidak,dapat,kembali,kembali,dana,baru,datang,kembali,dana', -1, '2022-05-24 16:52:47', 0),
(1054, 'Tidak ada pembelanjaan min dengan voucher pengiriman gratis rm5 (cukup sering bisa mendapatkan ini) -sikap kurir yang baik (menelepon Anda begitu mereka tiba) -hadiah harian, lebih sedikit pilihan untuk produk (tidak banyak pilihan) -pengiriman lambat (memakan waktu 4 hari ke atas) - penukaran koin hanya untuk produk tertentu - voucher kemungkinan tidak jelas (tidak dapat benar-benar mengetahui voucher untuk item apa? voucher untuk produk yang tersedia yang muncul setelah Anda mengklik tombol \"gunakan\" & keluar produk tidak semuanya relevan/mampu menggunakan', 'tidak,ada,belanja,min,voucher,kirim,gratis,rm,cukup,sering,dapat,sikap,kurir,baik,telepon,anda,tiba,hadiah,hari,lebih,sedikit,pilih,produk,tidak,banyak,pilih,kirim,lambat,makan,waktu,hari,tukar,koin,produk,tentu,voucher,tidak,jelas,tidak,dapat,benarbenar,mengetahui,voucher,item,voucher,produk,sedia,muncul,sete,anda,klik,tombol,guna,keluar,produk,tidak,semua,relevanmampu,guna', 1, '2022-05-24 16:52:48', 0),
(1055, 'Saya baru mengenal aplikasi ini. Anda perlu membuktikan diri Anda layak. Tidak apa-apa untuk memulai dengan 3 bintang karena saya telah mendengar cukup banyak tentang layanan Anda. Saya sudah memesan 3 item (ini yang ke 4) dan saya masih menunggu pengirimannya. Semoga Anda akan hidup sesuai dengan nama Anda. Semoga sukses.', 'baru,kenal,aplikasi,anda,perlu,bukti,diri,anda,layak,tidak,apaapa,mulai,bintang,telah,dengar,cukup,banyak,tentang,layan,anda,sudah,mesan,item,masih,tunggu,kirim,moga,anda,hidup,sesuai,nama,anda,moga,sukses', -1, '2022-05-24 16:52:48', 0),
(1056, 'Setiap kali saya mengajukan pengembalian/pengembalian dana, selalu tertulis \"ada yang tidak beres\" Saya harap Anda dapat memperbaikinya sehingga saya dapat mengembalikan dan mengembalikan barang tersebut.', 'tiap,kali,ajuk,pengembalianpengembalian,dana,tulis,ada,tidak,beres,harap,anda,dapat,baik,sehingga,dapat,kembali,kembali,barang,sebut', 1, '2022-05-24 16:52:48', 0),
(1057, 'Ini adalah aplikasi yang bagus untuk digunakan, tetapi saya memiliki masalah dalam menggunakannya. Itu mulai macet setiap kali saya mencoba mencari sesuatu untuk dibeli. Dan juga, itu kadang-kadang tertinggal. Saya harap ini akan segera diperbaiki.', 'aplikasi,bagus,guna,milik,masalah,guna,mulai,macet,tiap,kali,coba,cari,suatu,beli,kadangkadang,tinggal,harap,segera,baik', -1, '2022-05-24 16:52:49', 0),
(1058, 'Sulit untuk mengetahui dari mana penjual berasal atau dari mana produk dikirim. Dan saya harus menggulir ke atas di situs beranda, akan lebih baik hanya mengetuk ikon beranda untuk naik.', 'sulit,mengetahui,mana,jual,asal,mana,produk,kirim,harus,gulir,situs,beranda,lebih,baik,ketuk,ikon,beranda,naik', -1, '2022-05-24 16:52:49', 0),
(1059, 'Tidak dapat menguangkan idk mengapa .. Saya pikir internet saya lambat atau koneksi saluran disadap. Saya mencoba membuka dan saya masih bisa menonton youtube.. kadang-kadang macet selalu macet saat transaksi', 'tidak,dapat,uang,idk,pikir,internet,lambat,koneksi,salur,sadap,coba,buka,masih,tonton,youtube,kadangkadang,macet,macet,transaksi', 1, '2022-05-24 16:52:49', 0),
(1060, 'Aplikasinya bagus dan semuanya tetapi saya berharap Anda dapat mengaktifkan dompet lazada Anda dengan email Anda atau menghapus akun lazada jika Anda memiliki 2 akun karena itulah masalah yang saya hadapi sekarang dengan aplikasi dan saya punya uang di dompet lazada saya dan tidak dapat mengaktifkan saya t. Semoga mereka bisa menyelesaikan masalah', 'aplikasi,bagus,semua,harap,anda,dapat,aktif,dompet,lazada,anda,email,anda,hapus,akun,lazada,anda,milik,akun,masalah,hadap,aplikasi,punya,uang,dompet,lazada,tidak,dapat,aktif,t,moga,selesai,masalah', -1, '2022-05-24 16:52:49', 0),
(1061, 'Pelayanan dan penjual bagus, tapi aplikasinya mengganggu, kadang gambar di review tidak muncul dan gambar produknya sendiri.', 'layan,jual,bagus,aplikasi,ganggu,kadang,gambar,review,tidak,muncul,gambar,produk,sendiri', -1, '2022-05-24 16:52:50', 0),
(1062, 'berfungsi sebagaimana mestinya, tetapi tiba-tiba daftar keinginan saya rusak. itu hanya menampilkan 3 item dan tidak akan memuat sisanya (saya memiliki lebih dari 3 di daftar keinginan) ...', 'fungsi,bagaimana,mesti,tibatiba,daftar,ingin,rusak,tampil,item,tidak,muat,sisa,milik,lebih,daftar,ingin', 1, '2022-05-24 16:52:50', 0),
(1063, 'Aplikasi bagus dengan banyak diskon dan fitur. Tapi UI-nya mengerikan, bahkan tidak terlihat seperti aplikasi dari tahun 2021. Tolong sederhanakan.', 'aplikasi,bagus,banyak,diskon,fitur,u,ngeri,bahkan,tidak,lihat,seperti,aplikasi,tahun,tolong,sederhana', -1, '2022-05-24 16:52:50', 0),
(1064, 'Sangat bermanfaat.. tapi perlu ditingkatkan lagi feedback customernya... Jika customer memberikan feedback yg bermanfaat ke orang lain.. contoh customer bilang kualitas produk... beri reward saja..', 'manfaat,perlu,tingkat,feedback,customer,customer,berik,feedback,manfaat,orang,lain,contoh,customer,bilang,kualitas,produk,beri,reward,saja', 1, '2022-05-24 16:52:50', 0),
(1065, 'Bagian ulasan adalah situs yang memuat sangat lambat. Benar-benar menjengkelkan. mau kasih rating seller tapi jadi beban pembeli.', 'ulas,situs,muat,lambat,benarbenar,jengkel,kasih,rating,seller,jadi,beban,beli', 1, '2022-05-24 16:52:51', 0),
(1066, 'Senang melihat dan membawa sesuatu di dalamnya. Tapi belakangan ini Lazada punya halaman depan untuk memasang iklan lingerie di flash sale-nya, yang membuat saya menolak untuk membuka aplikasi Lazada di depan umum. Semoga Lazada dapat mencari masalah ini dan menyelesaikannya.', 'senang,lihat,bawa,suatu,belakang,lazada,punya,halaman,depan,pasang,iklan,lingerie,flash,sale,buat,tolak,buka,aplikasi,lazada,depan,umum,moga,lazada,dapat,cari,masalah,selesai', -1, '2022-05-24 16:52:51', 0),
(1067, 'Silakan periksa di kolom Pesan. Pesan terus bermunculan bahkan setelah saya menghapus semuanya. Mereka selamanya muncul tanpa henti. Ini membuat frustrasi.', 'sila,periksa,kolom,pesan,pesan,terus,muncul,bahkan,sete,hapus,semua,selama,muncul,tanpa,henti,buat,frustrasi', -1, '2022-05-24 16:52:51', 0),
(1068, 'Penggunaan baterai dan ram ponsel yang tinggi. Terkadang gambar produk tidak ditampilkan lagi, harus ditutup dan dicari lagi.', 'guna,baterai,ram,ponsel,tinggi,kadang,gambar,produk,tidak,tampil,harus,tutup,cari', -1, '2022-05-24 16:52:51', 0),
(1069, 'Peringkat saya sebelumnya adalah 1 bintang, sekarang 3 bintang dengan beberapa peningkatan .. aplikasi tetap menggantung dan layanan pelanggan tidak menjawab. Saya tidak dapat memeriksa pesanan saya, mengirimkan dan bahkan menilai pembelian saya selama berhari-hari. Aplikasi Anda benar-benar membutuhkan banyak peningkatan. Tolong lakukan sesuatu.', 'peringkat,belum,bintang,bintang,beberapa,tingkat,aplikasi,gantung,layan,langgan,tidak,jawab,tidak,dapat,periksa,pesan,kirim,bahkan,nilai,beli,selama,berharihari,aplikasi,anda,benarbenar,butuh,banyak,tingkat,tolong,laku,suatu', -1, '2022-05-24 16:52:52', 0),
(1070, 'Saya membeli headphone dan itu keren, tapi saya benci iklan pop up dari aplikasi Anda, bisakah Anda menghapus iklan pop up dari ponsel saya atau siapa pun yang melihat iklan pop up dari lazada sehingga kami tidak terganggu dan terima kasih.', 'beli,headphone,keren,benci,iklan,pop,up,aplikasi,anda,anda,hapus,iklan,pop,up,ponsel,siapa,lihat,iklan,pop,up,lazada,sehingga,tidak,ganggu,terima,kasih', -1, '2022-05-24 16:52:52', 0),
(1071, 'Lazada saya tidak berfungsi dengan baik sejak beberapa hari yang lalu. Selalu katakan menemukan lalu lintas jaringan! Ketika semua aplikasi berfungsi dan saya baik-baik saja dengan streaming dan video.', 'lazada,tidak,fungsi,baik,sejak,beberapa,hari,katak,temu,lintas,jaring,ketika,semua,aplikasi,fungsi,baikbaik,saja,streaming,video', -1, '2022-05-24 16:52:52', 0),
(1072, 'Sebelum lazada ini sangat bagus dalam semua aspek. Saya suka menggunakan aplikasi lazada sejak hari 1. Saya check-in setiap hari untuk mendapatkan uang yang diberikan dan setelah beberapa kali saya mendapatkan uang yang rm40. Penarikan bisa kapan saja selama Anda tersedia di dunia ini. Dan uang itu tidak dapat kedaluwarsa selama Anda tidak checkout. Tapi sekarang, lazada sudah banyak berubah. Saya mengumpulkan rm40 dari login harian tetapi sekarang saya tidak dapat menariknya. Bahkan mereka disuruh withdraw jam 10 pagi setiap hari, tapi tetap saja tidak bisa withdraw. Tolong perbaiki ini. Tq.', 'belum,lazada,bagus,semua,aspek,suka,guna,aplikasi,lazada,sejak,hari,checkin,tiap,hari,dapat,uang,berik,sete,beberapa,kali,dapat,uang,rm,tarik,kapan,saja,selama,anda,sedia,dunia,uang,tidak,dapat,kedaluwarsa,selama,anda,tidak,checkout,lazada,sudah,banyak,rubah,kumpul,rm,login,hari,tidak,dapat,tarik,bahkan,suruh,withdraw,jam,pagi,tiap,hari,saja,tidak,withdraw,tolong,baik,tq', -1, '2022-05-24 16:52:53', 0),
(1073, 'Saya suka membeli dari Lazada karena mereka dekat dengan tunangan saya, harga terjangkau, dan PHILPOST TIDAK MENCIPTAKAN MERCHANDISE SAYA & MEMINTA TEBUSAN UNTUK MENDAPATKAN APA YANG SAYA BELI BULAN SAYA\'! Aplikasi masih perlu bekerja, tetapi saya yakin mereka cukup responsif untuk membuat segalanya lebih baik & lebih nyaman untuk digunakan! Bravo! 80/100! Kent Johnson. Pelanggan Amerika', 'suka,beli,lazada,dekat,tunang,harga,jangkau,philpost,tidak,cipta,merchandise,minta,tebus,dapat,beli,bulan,aplikasi,masih,perlu,kerja,yakin,cukup,responsif,buat,segala,lebih,baik,lebih,nyaman,guna,bravo,kent,johnson,langgan,amerika', -1, '2022-05-24 16:52:53', 0),
(1074, 'Halo, dibandingkan dengan aplikasi Shopee, aplikasi Shopee lebih mudah digunakan dan desain aplikasi minimalis yang menyenangkan bagi saya untuk mencari dan membeli barang. Harap perbaiki desain aplikasi Anda.', 'halo,banding,aplikasi,shopee,aplikasi,shopee,lebih,mudah,guna,desain,aplikasi,minimalis,senang,cari,beli,barang,harap,baik,desain,aplikasi,anda', -1, '2022-05-24 16:52:53', 0),
(1075, 'Toko-toko yang terdaftar di platform perlu dikelola dengan lebih baik dalam hal kualitas, gambar asli, dan deskripsi produk.', 'tokotoko,daftar,platform,perlu,kelola,lebih,baik,hal,kualitas,gambar,asli,deskripsi,produk', -1, '2022-05-24 16:52:53', 0),
(1076, 'Saya berharap platform akan mewajibkan penjual untuk menyatakan barang palsu atau tidak asli seperti jam tangan, parfum, dll2. Selain itu, mesin pencari Anda juga harus ditingkatkan sehingga misalnya ketika orang mencari \"hoverboard\" itu tidak akan menampilkan \"stiker\" atau \"speaker\" hoverboard di daftar kecuali pembeli menyatakan \"stiker\" atau speaker \"dalam pencarian .. jika itu menunjukkan daftar di paling belakang saya bisa mengerti tapi daftar di halaman depan? Konyol..', 'harap,platform,wajib,jual,nyata,barang,palsu,tidak,asli,seperti,jam,tangan,parfum,dll,selain,mesin,pencar,anda,harus,tingkat,sehingga,misal,ketika,orang,cari,hoverboard,tidak,tampil,stiker,speaker,hoverboard,daftar,kecuali,beli,nyata,stiker,speaker,cari,tunjuk,daftar,paling,belakang,erti,daftar,halaman,depan,konyol', 1, '2022-05-24 16:52:54', 0),
(1077, 'Saya selalu memesan di sini di lazada tetapi sesuatu yang saya perhatikan adalah kadang-kadang fitur lain tidak berfungsi seperti ketika saya pergi ke \"akun saya\" butuh waktu lama untuk memuat dan setelah itu sesuatu akan muncul mengatakan \"ada yang tidak beres\" dan itu terus mengulangi seperti itu setiap kali saya mencoba untuk pergi ke sana.', 'mesan,sini,lazada,suatu,hati,kadangkadang,fitur,lain,tidak,fungsi,seperti,ketika,pergi,akun,butuh,waktu,lama,muat,sete,suatu,muncul,atak,ada,tidak,beres,terus,ulang,seperti,tiap,kali,coba,pergi,sana', 1, '2022-05-24 16:52:54', 0);
INSERT INTO `skripsi_rekap` (`no`, `komentar`, `stem`, `sentimen`, `tgl`, `flag`) VALUES
(1078, 'Tidak dapat membantu dalam masalah saya karena seseorang mencoba masuk ke akun saya di tempat lain tetapi bantuan obrolan AI mereka tidak memiliki opsi untuk agen langsung. Kurang perlindungan dan kurang bantuan jika ingin membuat laporan anti cybercrime', 'tidak,dapat,bantu,masalah,seseorang,coba,masuk,akun,tempat,lain,bantu,obrol,a,tidak,milik,opsi,agen,langsung,kurang,lindung,kurang,bantu,ingin,buat,lapor,anti,cybercrime', 1, '2022-05-24 16:52:54', 0),
(1079, 'Layanan pelanggan sangat sulit dijangkau ... Saya hanya ingin tahu jawaban sederhana untuk pertanyaan saya apakah voucher saya akan dikembalikan jika saya membatalkan pesanan COD ???? penjual menyuruh saya menghubungi layanan pelanggan tetapi obrolan tidak membantu dan saya tidak nyaman untuk memanggil mereka. Selain itu saya suka antarmuka dan biaya pengiriman yang murah', 'layan,langgan,sulit,jangkau,ingin,tahu,jawab,sederhana,tanya,apakah,voucher,kembali,batal,pesan,cod,jual,suruh,hubung,layan,langgan,obrol,tidak,bantu,tidak,nyaman,panggil,selain,suka,antarmuka,biaya,kirim,murah', 1, '2022-05-24 16:52:55', 0),
