(1168, 'Satu hal yang mengganggu saya adalah bahwa tidak ada keamanan. Orang hanya bisa membeli barang jika mereka memegang telepon saya. Anda harus menempatkan perlindungan sidik jari dan kata sandi.', 'satu,hal,ganggu,tidak,ada,aman,orang,beli,barang,pegang,telepon,anda,harus,tempat,lindung,sidik,jari,kata,sandi', 1, '2022-05-24 16:53:17', 0),
(1169, '-Tidak ada voucher pengiriman gratis yang disediakan -Tidak menunjukkan kurir apa yang digunakan untuk mengirimkan barang -Biaya pengiriman cukup mahal dari pedagang lain *Berharap Lazada dapat memperbaiki masalah di atas. Saya menantikan aplikasi Lazada yang lebih baik????????', 'tidak,ada,voucher,kirim,gratis,sedia,tidak,tunjuk,kurir,guna,kirim,barang,biaya,kirim,cukup,mahal,dagang,lain,harap,lazada,dapat,baik,masalah,aplikasi,lazada,lebih,baik', -1, '2022-05-24 16:53:17', 0),
(1170, 'Notifikasi selalu terlambat dan saat saya refresh, aplikasi selalu error..', 'notifikasi,lambat,refresh,aplikasi,error', -1, '2022-05-24 16:53:17', 0),
(1171, 'Pengembalian & pengembalian dana ke reseller sangat sulit? Juga barang yang dikirim agak tidak sesuai dengan gambar barang? Reseller BURUK?', 'kembali,kembali,dana,reseller,sulit,barang,kirim,agak,tidak,sesuai,gambar,barang,reseller,buruk', 1, '2022-05-24 16:53:18', 0),
