(1173, 'Terlalu banyak gangguan di situs web lain bahkan ketika lazada tidak digunakan. Iklan pop up dan buka otomatis lazada', 'banyak,ganggu,situs,web,lain,bahkan,ketika,lazada,tidak,guna,iklan,pop,up,buka,otomatis,lazada', -1, '2022-05-24 16:53:18', 0),
(1174, 'Lazada harus benar-benar meningkatkan fungsi pencarian. Terkadang bahkan 10 hasil pencarian teratas tidak terkait. Apakah Lazada mengalihdayakan fungsi pencarian ke freelance? lol', 'lazada,harus,benarbenar,tingkat,fungsi,cari,kadang,bahkan,hasil,cari,tidak,kait,apakah,lazada,mengalihdayakan,fungsi,cari,freelance,lol', 1, '2022-05-24 16:53:18', 0),
(1175, 'tidak mudah menggunakan voucher, tidak diterapkan secara otomatis atau ditampilkan di dalam keranjang', 'tidak,mudah,guna,voucher,tidak,terap,cara,otomatis,tampil,keranjang', -1, '2022-05-24 16:53:19', 0),
(1176, 'Situs belanja yang bagus tetapi tidak ingin saya mengklaim koin di aplikasi ini. Sangat mengecewakan tapi tetap situs yang bagus.', 'situs,belanja,bagus,tidak,ingin,klaim,koin,aplikasi,kecewa,situs,bagus', -1, '2022-05-24 16:53:19', 0),
(1177, 'Saya telah menggunakan lazada selama 2 tahun tetapi saya sangat kecewa dengan hadiah cashback saya tidak ada jumlah koin cashback saya yang dikreditkan ke dompet saya meskipun pesanan saya memenuhi syarat untuk cashback', 'telah,guna,lazada,selama,tahun,kecewa,hadiah,cashback,tidak,ada,jumlah,koin,cashback,kredit,dompet,meski,pesan,penuh,syarat,cashback', -1, '2022-05-24 16:53:19', 0),
