(1179, 'Beberapa produk jauh lebih mahal daripada toko ritel. Namun, secara keseluruhan aplikasi yang bagus.', 'beberapa,produk,jauh,lebih,mahal,daripada,toko,ritel,cara,seluruh,aplikasi,bagus', -1, '2022-05-24 16:53:20', 0),
