(1181, 'Aplikasinya kadang-kadang hang, saya tidak bisa mengaksesnya. Untuk minggu ini, saya telah dua kali mencopot dan menginstal aplikasi ini', 'aplikasi,kadangkadang,hang,tidak,akses,minggu,telah,dua,kali,copot,menginstal,aplikasi', -1, '2022-05-24 16:53:20', 0),
(1182, 'Saya beri 3 dari 5 bcs pengiriman paket saya terlalu lama untuk dikirim dan terlebih lagi ada atau tidak ada pembaruan pada paket saya saat ini, saya sudah menghubungi penjual dan mereka mengatakan bahwa itu sudah dikirim jadi itu perusahaan lazada atau idk yang saat ini mengelola paket saya (bukan dari negara lain btw).', 'beri,bcs,kirim,paket,lama,kirim,lebih,ada,tidak,ada,baru,paket,sudah,hubung,jual,atak,sudah,kirim,jadi,usaha,lazada,idk,kelola,paket,bukan,negara,lain,btw', -1, '2022-05-24 16:53:21', 0),
(1183, 'Saya tidak dapat melihat pesanan saya, pesanan saya tidak muncul jika sudah \"Membayar\"\"untuk mengirim\" atau \"menerima\"', 'tidak,dapat,lihat,pesan,pesan,tidak,muncul,sudah,membayaruntuk,kirim,terima', 1, '2022-05-24 16:53:21', 0),
(1184, 'akan lebih baik jika memiliki ukuran font yang lebih besar agar mudah dilihat', 'lebih,baik,milik,ukur,font,lebih,besar,mudah,lihat', 1, '2022-05-24 16:53:21', 0),
