(1187, 'Harap tingkatkan perasaan pengalaman pengguna dengan membuat GUI sederhana dan prosedur pengambilan promosi. Lazada kini membuat pembeli pusing dan bingung karena banyak pop up dan fungsi yang saling bersinggungan.', 'harap,tingkat,rasa,alam,guna,buat,gu,sederhana,prosedur,ambil,promosi,lazada,buat,beli,pusing,bingung,banyak,pop,up,fungsi,saling,singgung', 1, '2022-05-24 16:53:21', 0),
