(1200, 'Tidak apa-apa Tapi mungkin proses pemesanannya sangat lambat pengirimannya dan sekitar 1 minggu sebelum produk dikirim bahkan di Valenzuela ke Valenzuela saja yang saya pesan', 'tidak,apaapa,proses,mesan,lambat,kirim,kitar,minggu,belum,produk,kirim,bahkan,valenzuela,valenzuela,saja,pesan', -1, '2022-05-24 16:53:23', 0),
(1201, 'Saya merasa jijik ketika saya memesan ponsel android dari sini ketika tombol volume berhasil.', 'rasa,jijik,ketika,mesan,ponsel,android,sini,ketika,tombol,volume,hasil', -1, '2022-05-24 16:53:23', 0),
(1202, 'Membingungkan di kali ... menunjukkan pengiriman voucher gratis beli setelah kunci tidak punya', 'bingung,kali,tunjuk,kirim,voucher,gratis,beli,sete,kunci,tidak,punya', 1, '2022-05-24 16:53:23', 0),
