(1209, 'Sejauh ini tidak apa-apa. Lebih cepat memberikan layanan yang baik untuk pelanggan itu sebabnya saya memberi bintang 3 Saya harap tidak ada masalah untuk menjadi incounter', 'jauh,tidak,apaapa,lebih,cepat,berik,layan,baik,langgan,sebab,beri,bintang,harap,tidak,ada,masalah,jadi,incounter', -1, '2022-05-24 16:53:24', 0),
(1210, 'Tidak dapat menggunakan pengembalian/pengembalian dana. Tolong perbaiki', 'tidak,dapat,guna,pengembalianpengembalian,dana,tolong,baik', -1, '2022-05-24 16:53:24', 0),
(1211, 'Saya telah menerima pesanan saya. Saya berharap terlalu banyak untuk memenangkan hadiah impian tapi coba tebak apa itu hidup. Jadi saya memberikan 3 bintang untuk saat ini, karena biaya pengiriman lebih tinggi dari pesanan saya.', 'telah,terima,pesan,harap,banyak,menang,hadiah,impi,coba,tebak,hidup,jadi,berik,bintang,biaya,kirim,lebih,tinggi,pesan', 1, '2022-05-24 16:53:25', 0),
(1212, 'Ops periksa koneksi Anda. Ops periksa koneksi Anda. Ops periksa koneksi Anda. Namun saya bisa membuat ulasan ini.', 'ops,periksa,koneksi,anda,ops,periksa,koneksi,anda,ops,periksa,koneksi,anda,buat,ulas', -1, '2022-05-24 16:53:25', 0),
(1213, 'Dengan pembaruan terbaru, tidak ada gambar yang diterima meskipun sinyal wifi sangat tinggi. Hasil pencarian sangat buruk dengan pencarian yang menunjukkan produk yang sama sekali tidak terkait dengan parameter pencarian yang sangat spesifik. Beberapa penjual tidak begitu dapat diandalkan. Anda benar-benar harus membaca cetakan kecil dan deskripsi dengan sangat sangat hati-hati. Jika Anda mengandalkan foto dan deskripsi awal, Anda akan membuang-buang uang. Jika Anda membaca dan memahami sebelum membeli, Anda biasanya akan mendapatkan nilai uang Anda.', 'baru,baru,tidak,ada,gambar,terima,meski,sinyal,wifi,tinggi,hasil,cari,buruk,cari,tunjuk,produk,sama,sekali,tidak,kait,parameter,cari,spesifik,beberapa,jual,tidak,dapat,andal,anda,benarbenar,harus,baca,cetak,kecil,deskripsi,hatihati,anda,andal,foto,deskripsi,awal,anda,membuangbuang,uang,anda,baca,paham,belum,beli,anda,biasa,dapat,nilai,uang,anda', 1, '2022-05-24 16:53:25', 0),
(1214, 'Sangat buruk jika Anda mencari produk berdasarkan gambar. Shopee sangat baik itu.', 'buruk,anda,cari,produk,dasar,gambar,shopee,baik', -1, '2022-05-24 16:53:26', 0),
(1215, 'Silakan coba pencarian menggunakan aplikasi Anda, Anda mencari sesuatu yang menunjukkan sesuatu yang lain dan tidak terkait. Tolong tingkatkan di bagian ini.', 'sila,coba,cari,guna,aplikasi,anda,anda,cari,suatu,tunjuk,suatu,lain,tidak,kait,tolong,tingkat', -1, '2022-05-24 16:53:26', 0),
(1216, 'Akhir-akhir ini, Lazada telah berubah menjadi aplikasi yang sangat mengganggu. Iklannya datang setiap jam!? Jika Anda menelepon dan terhubung, Anda mendapatkan satu set opsi pra-rekaman dan panggilan Anda terputus. Seorang pelanggan menelepon karena dia memiliki masalah yang tidak dapat ditangani oleh chatbot Anda! Sederhana, bukan? Ketika aplikasi Anda memiliki bug, aplikasi mengatakan, \"ada yang salah, periksa koneksi internet Anda.\" Ketika saya menolak kurir, Lazada bersikeras untuk menggunakan kurir tersebut. r cara Lazada selalu. Saya berharap Anda baik-baik saja. Saya 3+ tahun w / u telah memuaskan.', 'akhirakhir,lazada,telah,rubah,jadi,aplikasi,ganggu,iklan,datang,tiap,jam,anda,telepon,hubung,anda,dapat,satu,set,opsi,prarekam,panggil,anda,putus,orang,langgan,telepon,milik,masalah,tidak,dapat,tangan,chatbot,anda,sederhana,bukan,ketika,aplikasi,anda,milik,bug,aplikasi,atak,ada,salah,periksa,koneksi,internet,anda,ketika,tolak,kurir,lazada,sikeras,guna,kurir,sebut,r,cara,lazada,harap,anda,baikbaik,saja,tahun,w,u,telah,muas', -1, '2022-05-24 16:53:27', 0),
(1217, 'Jangan benar-benar membeli barang di sini tetapi saya tahu mereka memiliki barang bagus untuk orang lain!', 'benarbenar,beli,barang,sini,tahu,milik,barang,bagus,orang,lain', -1, '2022-05-24 16:53:27', 0),
(1218, 'Baru-baru ini saya mendapatkan prompt \"kami telah mendeteksi lalu lintas yang tidak biasa dari jaringan Anda, silakan coba lagi nanti\", jadi saya ditolak masuk ke aplikasi untuk memesan bahan makanan, dll. Semua aplikasi lain termasuk Shopee, Q10, ezbuy memberi saya akses tanpa masalah, dengan demikian masalahnya jelas ada di aplikasi Lazada. Saya harap Lazada melihat masalahnya dan memberi saya akses segera untuk melanjutkan patronase saya.', 'barubaru,dapat,prompt,telah,deteksi,lintas,tidak,biasa,jaring,anda,sila,coba,jadi,tolak,masuk,aplikasi,mesan,bahan,makan,dll,semua,aplikasi,lain,masuk,shopee,q,ezbuy,beri,akses,tanpa,masalah,demikian,masalah,jelas,ada,aplikasi,lazada,harap,lazada,lihat,masalah,beri,akses,segera,lanjut,patronase', -1, '2022-05-24 16:53:28', 0);
INSERT INTO `skripsi_rekap` (`no`, `komentar`, `stem`, `sentimen`, `tgl`, `flag`) VALUES
(1219, 'Saya pikir Lazada harus mengatur aplikasi Anda seperti Shopee sehingga orang akan dengan mudah membeli produk dengan baik bahkan pemula.. Itu karena aplikasi Anda sangat rumit dan tidak terstruktur seperti aplikasi Shopee.. Terutama dalam hal ongkos kirim, check out, pembayaran, dan sebagainya on.. Juga ketika Anda ingin mencari sesuatu yang berhubungan dengan produk serupa.. Itu saja dari saya.. Semoga Anda dapat meningkatkannya.. Terima kasih', 'pikir,lazada,harus,atur,aplikasi,anda,seperti,shopee,sehingga,orang,mudah,beli,produk,baik,bahkan,mula,aplikasi,anda,rumit,tidak,struktur,seperti,aplikasi,shopee,utama,hal,ongkos,kirim,check,out,bayar,bagai,on,ketika,anda,ingin,cari,suatu,hubung,produk,rupa,saja,moga,anda,dapat,tingkat,terima,kasih', -1, '2022-05-24 16:53:28', 0),
(1220, 'Baru pertama kali order saya coba kalau ada apa sampai ke saya.semoga barangnya ok dan bagus.', 'baru,pertama,kali,order,coba,ada,sampai,sayasemoga,barang,ok,bagus', -1, '2022-05-24 16:53:28', 0),
(1221, 'Mudah untuk menemukan barang yang Anda inginkan...', 'mudah,temu,barang,anda,ingin', 1, '2022-05-24 16:53:28', 0),
(1222, 'Sekarang saya hanya membeli dari Lazada karena saya ingin barang itu dijual. Saya telah pergi untuk beberapa waktu karena pengalaman yang tidak menyenangkan dengan pengiriman hanya pel alih-alih ember dengan pel yang merupakan semacam posting yang menipu. Jika Anda hanya menjual pel, maka perjelas dan letakkan gambar pel saja. Seperti yang disebutkan, harap berhati-hati dengan pedagang Anda saat mereka membuat atau membatalkan Lazada. Terima kasih', 'beli,lazada,ingin,barang,jual,telah,pergi,beberapa,waktu,alam,tidak,senang,kirim,l,alihalih,ember,l,rupa,macam,posting,tipu,anda,jual,l,maka,jelas,letak,gambar,l,saja,seperti,sebut,harap,berhatihati,dagang,anda,buat,batal,lazada,terima,kasih', -1, '2022-05-24 16:53:29', 0),
(1223, 'Rata-rata. terkadang saya mendapatkan produk cacat, terkadang kualitas sangat baik.', 'ratarata,kadang,dapat,produk,cacat,kadang,kualitas,baik', -1, '2022-05-24 16:53:29', 0),
(1224, 'Meskipun saya dapat membeli barang, saya tampaknya bingung mengapa Lazada menunjukkan pembelian orang lain kepada saya dan ketika saya mengkliknya, ia mengatakan identitas pembeli Anda ilegal. Jadi saya bingung mengapa aplikasi menunjukkan pembelian orang lain juga', 'meski,dapat,beli,barang,tampak,bingung,lazada,tunjuk,beli,orang,lain,ketika,klik,ia,atak,identitas,beli,anda,ilegal,jadi,bingung,aplikasi,tunjuk,beli,orang,lain', -1, '2022-05-24 16:53:29', 0),
(1225, 'Pembaruan pesanan luar negeri tertunda dan pelacakan tidak berfungsi.', 'baru,pesan,neger,tunda,lacak,tidak,fungsi', 1, '2022-05-24 16:53:29', 0),
(1226, 'Ini luar biasa tetapi terkadang memberi jeda di ponsel saya', 'biasa,kadang,beri,jeda,ponsel', -1, '2022-05-24 16:53:29', 0),
(1227, 'Begitu banyak pesan yang datang kembali n lagi n lagi bahkan sudah dihapus berkali-kali. Dan lazada menyisipkan di mana-mana di semua situs, n itu menjengkelkan. Tapi bagaimanapun, layanan mereka baik.', 'banyak,pesan,datang,kembali,bahkan,sudah,hapus,berkalikali,lazada,sisip,manamana,semua,situs,jengkel,bagaimana,layan,baik', 1, '2022-05-24 16:53:30', 0),
