(1231, 'Ini seperti undian, Terkadang Anda mungkin telah Menerima barang dalam kondisi baik. tetapi sebagian besar waktu Anda akan menerima pesan \"Pengembalian dana atau pembatalan\" Itu membuat Anda bertanya-tanya apakah mereka benar-benar memiliki produk atau tidak? Saya memesan produk serupa 3 kali dari penjual yang berbeda di Lazada. Setelah menerima pesan barang dikemas dan dalam perjalanan, tetapi dalam beberapa hari berikutnya saya menerima Pengembalian Dana/Batal. Kebayang kan betapa kecewanya saya?', 'seperti,undi,kadang,anda,telah,terima,barang,kondisi,baik,besar,waktu,anda,terima,pesan,kembali,dana,batal,buat,anda,bertanyata,apakah,benarbenar,milik,produk,tidak,mesan,produk,rupa,kali,jual,beda,lazada,sete,terima,pesan,barang,kemas,jalan,beberapa,hari,ikut,terima,kembali,danabatal,bayang,kan,betapa,kecewa', -1, '2022-05-24 16:53:31', 0),
