(1236, 'Ini adalah aplikasi yang bagus. Tetapi sulit untuk menerapkan voucher dan mendapatkannya. itu juga sangat menjengkelkan bagaimana itu hanya muncul dan membuka aplikasi di setiap penambahan seperti, ayolah! Saya hanya ingin menonton dengan jelas! Sangat menjengkelkan', 'aplikasi,bagus,sulit,terap,voucher,dapat,jengkel,bagaimana,muncul,buka,aplikasi,tiap,tambah,seperti,ayo,ingin,tonton,jelas,jengkel', -1, '2022-05-24 16:53:32', 0),
(1237, 'Pengalaman pencarian bagus, sebagian besar waktu Anda dapat menemukan apa yang Anda cari. Namun, pengaturan notifikasi disadap. Saat Anda menyetel pemberitahuan yang ingin Anda terima, aplikasi mengabaikan prasetel Anda dan hanya mengirimkan semuanya kepada Anda. Frekuensi notifikasinya bikin galau, kayak dihantui mantan gila. CS juga bercanda. Selamanya dipaksa untuk berurusan dengan chatbot CLEO, tidak dapat menjangkau bantuan manusia apa pun. Setidaknya memiliki pilihan untuk berbicara dengan agen manusia.', 'alam,cari,bagus,besar,waktu,anda,dapat,temu,anda,cari,atur,notifikasi,sadap,anda,setel,beritahu,ingin,anda,terima,aplikasi,abai,prasetel,anda,kirim,semua,anda,frekuensi,notifikasi,bikin,galau,kayak,hantu,mantan,gila,cs,canda,selama,paksa,urus,chatbot,cleo,tidak,dapat,jangkau,bantu,manusia,tidak,milik,pilih,bicara,agen,manusia', -1, '2022-05-24 16:53:33', 0),
(1238, 'Ini telah menjadi belanja online nomor satu saya bahkan sebelum pandemi. Saat ini, saya mengalami kesulitan dalam menggunakannya. Aplikasi mogok setiap kali saya memeriksa barang dari keranjang saya dan saya harus melakukannya dua kali sebelum saya berhasil melakukan pemesanan. Terkadang saya bahkan butuh 4 kali. Itu hanya memakan waktu. Saya sudah menginstal ulang aplikasi tetapi masih macet. Semoga Anda bisa memperbaikinya.', 'telah,jadi,belanja,online,nomor,satu,bahkan,belum,pandemi,alami,sulit,guna,aplikasi,mogok,tiap,kali,periksa,barang,keranjang,harus,laku,dua,kali,belum,hasil,laku,mesan,kadang,bahkan,butuh,kali,makan,waktu,sudah,menginstal,ulang,aplikasi,masih,macet,moga,anda,baik', -1, '2022-05-24 16:53:33', 0),
(1239, 'Ini adalah aplikasi yang bagus. Saya hanya mengalami kesulitan mencari tahu banyak hal dan saya berharap itu sedikit lebih sederhana. Juga, ketika saya akan mengklaim hadiah itu akan mengatakan \"oops koneksi hilang\" meskipun koneksi saya baik-baik saja. Itu juga terjadi ketika saya ingin meninjau beberapa item yang saya beli mengatakan bahwa ada sesuatu yang salah dengan koneksi saya.', 'aplikasi,bagus,alami,sulit,cari,tahu,banyak,hal,harap,sedikit,lebih,sederhana,ketika,klaim,hadiah,atak,oops,koneksi,hilang,meski,koneksi,baikbaik,saja,jadi,ketika,ingin,tinjau,beberapa,item,beli,atak,ada,suatu,salah,koneksi', -1, '2022-05-24 16:53:33', 0),
