(1241, 'Masalah Keamanan Besar pada pembayaran TnG dipotong langsung di TnG eWallet tanpa mendapatkan persetujuan kata sandi pembeli. Harap ubah ini demi keamanan daripada untuk kenyamanan pembeli dan/atau Lazada!', 'masalah,aman,besar,bayar,tng,potong,langsung,tng,ewallet,tanpa,dapat,persetujuan,kata,sandi,beli,harap,ubah,demi,aman,daripada,nyaman,beli,danatau,lazada', -1, '2022-05-24 16:53:34', 0),
(1242, 'Soal layanan, bagi saya tidak ada masalah. Tapi saya harus mengatakan, UI telah buruk selama bertahun-tahun. Saya menghargai peningkatan desain UI terbaru, tetapi saya khawatir aplikasinya masih sangat berantakan. \"Daftar Keinginan\" saya memiliki 150+ item tetapi, setiap kali saya memeriksanya, itu menunjukkan \"tidak ada item\". Terkadang itu akan muncul melalui peralihan kategori lalu kembali ke daftar keinginan lagi. Jika muncul, sulit untuk menemukan item terbaru yang ditambahkan karena kurangnya fitur \"sort\". Telah menggunakan ini selama 2 tahun, UI masih menjadi masalah. Semoga diperbaiki.', 'soal,layan,tidak,ada,masalah,harus,atak,u,telah,buruk,selama,bertahuntahun,harga,tingkat,desain,u,baru,khawatir,aplikasi,masih,berantak,daftar,ingin,milik,item,tiap,kali,periksa,tunjuk,tidak,ada,item,kadang,muncul,alih,kategori,kembali,daftar,ingin,muncul,sulit,temu,item,baru,tambah,kurang,fitur,sort,telah,guna,selama,tahun,u,masih,jadi,masalah,moga,baik', -1, '2022-05-24 16:53:35', 0),
(1243, 'Aplikasi ini rentan untuk mendapatkan kesalahan atau menolak untuk menerapkan VALID & voucher yang berlaku ketika ada pembaruan yang tersedia dan Anda belum memperbarui – setidaknya untuk saya. Pembaruan terbaru juga menguras baterai yang sangat besar. Ini satu-satunya aplikasi yang telah menonaktifkan peringatan \"Aplikasi Intensif Daya\" di tablet saya sejak saya memperbaruinya pada 04 Feb 2021.', 'aplikasi,rentan,dapat,salah,tolak,terap,valid,voucher,berla,ketika,ada,baru,sedia,anda,belum,baru,tidak,baru,baru,uras,baterai,besar,satusatu,aplikasi,telah,nonaktif,ingat,aplikasi,intensif,daya,tablet,sejak,baru,feb', -1, '2022-05-24 16:53:35', 0),
(1244, 'Saya sudah berkomentar berkali-kali sebelumnya, di email survei tetapi tidak ada yang berubah. Fitur apps masih seperti biasa. Tapi ada satu lagi hal aneh di \'pilihan pembeli\', saya pergi ke kamar untuk melihat barang apa yang kebanyakan orang beli atau rekomendasikan dan itu menyatakan rekomendasi teratas juga sehingga waktu saya tidak terbuang untuk menggulir ke bawah, tetapi banyak item bahkan tidak punya pembeli, orang bahkan belum membeli, dan tidak ada penilaian atau komentar sama sekali, kok bisa di kamar itu? Tidak ada tujuan menciptakan kamar yang direkomendasikan teratas, kurasa.', 'sudah,komentar,berkalikali,belum,email,survei,tidak,ada,rubah,fitur,apps,masih,seperti,biasa,ada,satu,hal,aneh,pilih,beli,pergi,kamar,lihat,barang,banyak,orang,beli,rekomendasi,nyata,rekomendasi,sehingga,waktu,tidak,buang,gulir,bawah,banyak,item,bahkan,tidak,punya,beli,orang,bahkan,belum,beli,tidak,ada,nilai,komentar,sama,sekali,kok,kamar,tidak,ada,tuju,cipta,kamar,rekomendasi,kurasa', 1, '2022-05-24 16:53:36', 0),
