(1247, 'Saya membayar untuk produk yang tidak dijamin pengirimannya hanya karena gagal sekali, Anda harus mengisi formulir dalam waktu 12 jam, dan jika tidak, pengisian formulir yang terlambat tidak akan menjamin produk Anda dari pengiriman ulang, apa? Ini belum pernah terjadi sebelumnya tidak ada formulir dan mereka hanya akan terus mencoba pengiriman ulang yang merupakan kesalahan di pihak saya karena saya terlalu mempercayai aplikasi ini. Pada dasarnya tidak mengisi formulir dalam 12 jam = 50/50, betapa nyamannya. Pelajaran tidak pernah bayar kecuali COD.', 'bayar,produk,tidak,jamin,kirim,gagal,sekali,anda,harus,isi,formulir,waktu,jam,tidak,isi,formulir,lambat,tidak,jamin,produk,anda,kirim,ulang,belum,jadi,belum,tidak,ada,formulir,terus,coba,kirim,ulang,rupa,salah,pihak,percaya,aplikasi,dasar,tidak,isi,formulir,jam,betapa,nyaman,ajar,tidak,bayar,kecuali,cod', -1, '2022-05-24 16:53:36', 0),
(1248, 'Kapasitas troli terlalu rendah. Dan Anda tidak dapat menyimpan banyak item dalam daftar keinginan juga. Jadi tidak dapat menyimpan item di akun Anda untuk dibandingkan dan dibeli nanti. Juga voucher tidak dapat berlaku sesuai keinginan Anda seperti aplikasi lainnya. Dan akhirnya voucher tidak diterapkan dengan benar padahal sudah memenuhi kriteria. Sangat lucu. Perlu mengembangkan aplikasi mereka. Tidak ada opsi kontak langsung juga.', 'kapasitas,troli,rendah,anda,tidak,dapat,simpan,banyak,item,daftar,ingin,jadi,tidak,dapat,simpan,item,akun,anda,banding,beli,voucher,tidak,dapat,berla,sesuai,ingin,anda,seperti,aplikasi,lain,akhir,voucher,tidak,terap,benar,padahal,sudah,penuh,kriteria,lucu,perlu,kembang,aplikasi,tidak,ada,opsi,kontak,langsung', -1, '2022-05-24 16:53:37', 0),
(1249, 'Mengaktifkan voucher itu merepotkan. Daripada langsung melamar ke produk yang berlaku saat checkout, Anda harus mengklik voucher yang tersedia, lalu menelusuri item yang berlaku dari daftar yang disediakan', 'aktif,voucher,repot,daripada,langsung,lamar,produk,berla,checkout,anda,harus,klik,voucher,sedia,telusur,item,berla,daftar,sedia', -1, '2022-05-24 16:53:37', 0),
(1250, 'Saya pikir masalah mengapa sebagian besar pengguna lebih memilih aplikasi belanja online lain seperti shopee adalah karena desain sistemnya. Sangat user friendly sehingga setiap klik, user selalu mengerti artinya sehingga alur belanja jadi mudah. Sementara itu, lazada tidak ramah pengguna terutama untuk pengguna baru! Mereka tidak tahu cara menambahkan produk yang telah mereka pilih ke keranjang karena satu-satunya pilihan adalah menambahkan daftar keinginan, lalu Anda perlu menemukan daftar keinginan itu dan kemudian Anda dapat menambahkannya ke keranjang.', 'pikir,masalah,besar,guna,lebih,pilih,aplikasi,belanja,online,lain,seperti,shopee,desain,sistem,user,friendly,sehingga,tiap,klik,user,erti,arti,sehingga,alur,belanja,jadi,mudah,sementara,lazada,tidak,ramah,guna,utama,guna,baru,tidak,tahu,cara,tambah,produk,telah,pilih,keranjang,satusatu,pilih,tambah,daftar,ingin,anda,perlu,temu,daftar,ingin,kemudian,anda,dapat,tambah,keranjang', -1, '2022-05-24 16:53:38', 0),
