(1253, 'Saya tidak yakin apakah ada bug di aplikasi ini atau di perangkat saya. Itu selalu menunjukkan tanda notifikasi di atas ikon tetapi ketika saya membuka aplikasi, tidak ada. Saya sudah menginstalnya ke ponsel saya yang lain dan tidak ada masalah. Saya sudah menghapus dan menginstal tetapi tidak ada perubahan.', 'tidak,yakin,apakah,ada,bug,aplikasi,angkat,tunjuk,tanda,notifikasi,ikon,ketika,buka,aplikasi,tidak,ada,sudah,menginstal,ponsel,lain,tidak,ada,masalah,sudah,hapus,menginstal,tidak,ada,rubah', -1, '2022-05-24 16:53:38', 0),
(1254, 'Akan lebih baik jika semua item yang sold out dihilangkan daripada harus dimasukkan ke dalam wishlist. Saya selalu kecewa ketika saya mencari sesuatu untuk dibeli dan memilikinya tetapi ternyata tidak tersedia dan saya harus memasukkannya ke dalam daftar keinginan. Tolong jangan beri kami harapan palsu', 'lebih,baik,semua,item,sold,out,hilang,daripada,harus,masuk,wishlist,kecewa,ketika,cari,suatu,beli,milik,nyata,tidak,sedia,harus,masuk,daftar,ingin,tolong,beri,harap,palsu', 1, '2022-05-24 16:53:39', 0),
(1255, 'sejauh ini bagus tapi tolong perbaiki bug biaya pengiriman, ada beberapa daerah yang lebih mahal daripada yang lain, dan yang mahal hanya di samping daerah lain yang biaya pengirimannya murah. lebih banyak orang ingin memesan di lazada tetapi bug dan gangguan biaya pengiriman Anda menjadikannya pilihan untuk platform penjualan online yang berbeda seperti shopee. tolong di perbaiki, terima kasih', 'jauh,bagus,tolong,baik,bug,biaya,kirim,ada,beberapa,daerah,lebih,mahal,daripada,lain,mahal,samping,daerah,lain,biaya,kirim,murah,lebih,banyak,orang,ingin,mesan,lazada,bug,ganggu,biaya,kirim,anda,jadi,pilih,platform,jual,online,beda,seperti,shopee,tolong,baik,terima,kasih', 1, '2022-05-24 16:53:39', 0),
(1256, 'Saya seorang pembelanja berat dengan aplikasi ini sebelumnya tetapi kemudian saya mencoba shoppee dan jalannya lebih lurus ke depan dan ramah pengguna, voucher sudah tersedia saat checkout tidak seperti Lazada di mana Anda harus menavigasi ke akun Anda terlebih dahulu untuk mengklaim voucher pengiriman gratis dll .. yang sangat merepotkan. Mereka menawarkan lebih mahal dibandingkan dengan produk yang sama di shoppee. Tapi yang paling saya benci, mitra shippimg mereka LBC dan Entrego yang hampir dua kali lebih lambat dibandingkan dengan NinjaVan dan J&T.', 'orang,belanja,berat,aplikasi,belum,kemudian,coba,shoppee,jalan,lebih,lurus,depan,ramah,guna,voucher,sudah,sedia,checkout,tidak,seperti,lazada,mana,anda,harus,navigasi,akun,anda,lebih,dahulu,klaim,voucher,kirim,gratis,dll,repot,awar,lebih,mahal,banding,produk,sama,shoppee,paling,benci,mitra,shippimg,lbc,entrego,hampir,dua,kali,lebih,lambat,banding,ninjavan,jt', -1, '2022-05-24 16:53:40', 0),
(1257, 'Sangat nyaman untuk membeli berbagai produk di satu tempat. Namun, biaya pengiriman tidak masuk akal (biaya meningkat dalam jumlah yang lebih besar ketika setiap item ditambahkan) dan menawarkan vocher diskon yang sangat sedikit. Harga produk dikenakan biaya pengiriman (harga murah tertera di profile produk).', 'nyaman,beli,bagai,produk,satu,tempat,biaya,kirim,tidak,masuk,akal,biaya,tingkat,jumlah,lebih,besar,ketika,tiap,item,tambah,awar,vocher,diskon,sedikit,harga,produk,kena,biaya,kirim,harga,murah,tera,profile,produk', 1, '2022-05-24 16:53:40', 0),
(1258, 'Menarik terlalu banyak daya, membuat ponsel panas.', 'tarik,banyak,daya,buat,ponsel,panas', -1, '2022-05-24 16:53:40', 0),
(1259, 'Aplikasi yang membingungkan. Anda menambahkan barang ke keranjang Anda, lalu harus menambahkannya lagi untuk check out. Mudah ketinggalan barang. Juga berhati-hatilah karena Redmart tidak selalu menyesuaikan tagihan jika mereka hanya menyelesaikan sebagian dari pesanan. Mereka mengembalikan uang Anda jika Anda perhatikan tetapi itu tidak otomatis.', 'aplikasi,bingung,anda,tambah,barang,keranjang,anda,harus,tambah,check,out,mudah,tinggal,barang,berhatihati,redmart,tidak,sesuai,tagih,selesai,pesan,kembali,uang,anda,anda,hati,tidak,otomatis', -1, '2022-05-24 16:53:41', 0),
