(1261, 'Pembelian produk lancar tetapi sangat membingungkan untuk menerapkan kode pengiriman gratis. Promosinya benar-benar menyesatkan. Mereka menyatakan pengiriman gratis dan banyak diskon tetapi itu hanya berlaku untuk mereka yang memiliki dompet Lazada. Itu hanya mengecewakan pelanggan baru Anda yang tidak memiliki kemampuan untuk memiliki rekening bank untuk memverifikasi dompet.', 'beli,produk,lancar,bingung,terap,kode,kirim,gratis,promosi,benarbenar,sesat,nyata,kirim,gratis,banyak,diskon,berla,milik,dompet,lazada,kecewa,langgan,baru,anda,tidak,milik,mampu,milik,rekening,bank,verifikasi,dompet', 1, '2022-05-24 16:53:41', 0),
