(1308, 'im menikmati ini dan mencintai aplikasi ini. tetapi satu-satunya hal yang saya benci adalah ketika saya mengundang seorang teman dan dia dapat masuk ke lazada untuk mengklaim hadiah voucher 200 php-nya. tetapi lazada tidak mengizinkannya untuk masuk, saya sangat membenci ituhhh. kami berdua akan mendapatkan penghasilan pada saat itu tetapi karena itu terjadi oh itu benar-benar membuatku kesal. saya berharap tim lazada bahwa Anda akan memperbaikinya secepat mungkin, tidak ingin membenci kalian, pastikan itu akan berhasil lain kali', 'im,nikmat,cinta,aplikasi,satusatu,hal,benci,ketika,undang,orang,teman,dapat,masuk,lazada,klaim,hadiah,voucher,php,lazada,tidak,izin,masuk,benci,ituhhh,dua,dapat,hasil,jadi,oh,benarbenar,buat,kesal,harap,tim,lazada,anda,baik,cepat,tidak,ingin,benci,pasti,hasil,lain,kali', -1, '2022-05-24 16:53:52', 0),
(1309, 'Voucher yang kami kumpulkan harus ditunjukkan secara otomatis ke pembayaran akhir. Itu tidak ramah pengguna karena saya telah melewatkan semua voucher yang dikumpulkan .... jadi sia-sia! ????????????', 'voucher,kumpul,harus,tunjuk,cara,otomatis,bayar,akhir,tidak,ramah,guna,telah,lewat,semua,voucher,kumpul,jadi,siasia', -1, '2022-05-24 16:53:52', 0),
(1310, 'Aplikasi ini tidak ramah pengguna. Saya harap Lazada mempertimbangkan kembali untuk mengganti Dompet Lazada mereka. Saya berharap Anda dapat menarik sisa saldo di Dompet Lazada Anda dengan menggunakan gcash atau bank/kartu apa pun tanpa kerumitan. Sangat sulit untuk mencari cara untuk mendapatkan kembali uang yang Anda perlukan selain membelanjakannya di aplikasi.', 'aplikasi,tidak,ramah,guna,harap,lazada,timbang,kembali,ganti,dompet,lazada,harap,anda,dapat,tarik,sisa,saldo,dompet,lazada,anda,guna,gcash,bankkartu,tanpa,kerumit,sulit,cari,cara,dapat,kembali,uang,anda,perlu,selain,belanja,aplikasi', -1, '2022-05-24 16:53:53', 0),
(1311, 'kenapa sih penjual diperbolehkan menghapus komentar negatif? bagaimana pelanggan akan dipandu jika Anda mengizinkan mereka untuk menghapus ulasan rendah, apa gunanya peringkat?', 'kenapa,sih,jual,boleh,hapus,komentar,negatif,bagaimana,langgan,pandu,anda,izin,hapus,ulas,rendah,guna,peringkat', 1, '2022-05-24 16:53:53', 0),
(1312, 'Periode pengiriman selalu tepat waktu dan sebagian besar waktu lebih awal dari yang diharapkan, tetapi ditemui beberapa kali Penjual hanya mengemas 1 item, bukan 2 menjadi satu paket. Saya menulis kepada mereka tetapi TIDAK ada tanggapan, sangat tidak bertanggung jawab!!', 'periode,kirim,tepat,waktu,besar,waktu,lebih,awal,harap,temu,beberapa,kali,jual,emas,item,bukan,jadi,satu,paket,tulis,tidak,ada,tanggap,tidak,tanggung,jawab', -1, '2022-05-24 16:53:53', 0),
(1313, 'Aplikasi ini sangat membantu kita yang tidak punya waktu untuk berbelanja, tetapi tidak membeli laptop dengan garansi, itu tidak benar, sulit untuk mengklaim garansi.', 'aplikasi,bantu,tidak,punya,waktu,belanja,tidak,beli,laptop,garansi,tidak,benar,sulit,klaim,garansi', -1, '2022-05-24 16:53:53', 0),
