(1316, 'Sudah mengubah alamat default tetapi setelah pembayaran dilakukan masih menggunakan alamat lama, pekerjaan lain dan uang untuk dikirim kembali ke alamat terbaru', 'sudah,ubah,alamat,default,sete,bayar,laku,masih,guna,alamat,lama,kerja,lain,uang,kirim,kembali,alamat,baru', -1, '2022-05-24 16:53:54', 0),
(1317, 'Saya memeriksa status pesanan saya dan kemudian ada satu untuk menerima 2 untuk dikirim, ketika saya memeriksa tab untuk menerima saya tidak memiliki paket untuk diterima. Seperti serius Anda telah merayakan ulang tahun 27 Maret lalu dan aplikasi Anda masih buggy atau mungkin diretas yang lebih buruk daripada bug.', 'periksa,status,pesan,kemudian,ada,satu,terima,kirim,ketika,periksa,tab,terima,tidak,milik,paket,terima,seperti,serius,anda,telah,raya,ulang,tahun,maret,aplikasi,anda,masih,buggy,retas,lebih,buruk,daripada,bug', -1, '2022-05-24 16:53:54', 0),
(1318, 'aplikasi ok tapi penjualnya adalah SCAM BESAR. Aku punya riff off sepanjang waktu. saya berharap saya bisa meretas seluruh aplikasi dan menghapusnya untuk BAIK ... vendor Anda seperti tentara yang memikat orang dan memanfaatkan setiap kesempatan yang mereka dapatkan. maaf tapi itu pengalaman saya dalam aplikasi ini', 'aplikasi,ok,jual,scam,besar,punya,riff,off,panjang,waktu,harap,retas,seluruh,aplikasi,hapus,baik,vendor,anda,seperti,tentara,mikat,orang,manfaat,tiap,sempat,dapat,maaf,alam,aplikasi', -1, '2022-05-24 16:53:54', 0),
(1319, 'Ini adalah aplikasi hebat pandemi ini, tetapi kekhawatiran saya adalah, ada banyak penjual palsu di lazada sekarang. Tolong perbaiki hal ini!', 'aplikasi,hebat,pandemi,khawatir,ada,banyak,jual,palsu,lazada,tolong,baik,hal', -1, '2022-05-24 16:53:54', 0),
(1320, 'Saya senang menggunakan ini karena saya melihat apa pun yang saya ingin membelinya. dan saya bersyukur aplikasi ini karena saya menemukan barang-barang saya yang saya inginkan. itu luar biasa yeheyy saya senang menjadi bagian dari LAZADA ..', 'senang,guna,lihat,ingin,beli,syukur,aplikasi,temu,barangbarang,ingin,biasa,yeheyy,senang,jadi,lazada', -1, '2022-05-24 16:53:54', 0),
(1321, 'lazada, penjual online, kurir tidak pernah mengecewakan saya sejak hari 1. tidak ada aplikasi belanja lain. satu-satunya hal adalah toko hadiah Anda. setelah Anda menukarkan item dan poin Anda dikurangi, tidak ada cara untuk melacak item GRATIS Anda.', 'lazada,jual,online,kurir,tidak,kecewa,sejak,hari,tidak,ada,aplikasi,belanja,lain,satusatu,hal,toko,hadiah,anda,sete,anda,tukar,item,poin,anda,kurang,tidak,ada,cara,lacak,item,gratis,anda', -1, '2022-05-24 16:53:55', 0),
(1322, 'itu sangat buruk. terlalu lama untuk melakukan pembelian. membeli di lazada membuat saya semakin stress.', 'buruk,lama,laku,beli,beli,lazada,buat,makin,stress', -1, '2022-05-24 16:53:55', 0),
(1323, 'Bagus, tapi beberapa seller kurang responsif. Saya harap saya bisa memenangkan kotak misteri, karena sejak saya belum memenangkan misteri Anda, saya masih berharap kali ini untuk menang. Thx atas transaksi yg cepat dan pengiriman yg baik.', 'bagus,beberapa,seller,kurang,responsif,harap,menang,kotak,misteri,sejak,belum,menang,misteri,anda,masih,harap,kali,menang,thx,transaksi,cepat,kirim,baik', -1, '2022-05-24 16:53:55', 0),
(1324, 'Bisakah kamu berhenti mengirimiku hadiah yang menyebalkan dan tidak berguna itu? Itu membuat saya kesal karena saya mendapatkan hadiah setiap kali saya meluncurkan aplikasi hanya untuk mengetahui bahwa apa yang ada di dalamnya adalah voucher untuk pelanggan baru saja. Jadi mengapa repot-repot meletakkannya di sana jika itu sama sekali tidak berguna untuk pelanggan lain? Bahkan Shopee memiliki UI yang lebih baik dari ini.', 'kamu,henti,kirim,hadiah,sebal,tidak,guna,buat,kesal,dapat,hadiah,tiap,kali,luncur,aplikasi,mengetahui,ada,voucher,langgan,baru,saja,jadi,repotrepot,letak,sana,sama,sekali,tidak,guna,langgan,lain,bahkan,shopee,milik,u,lebih,baik', -1, '2022-05-24 16:53:55', 0),
(1325, 'saya sekarang akan mengalami keterlambatan besar pada pembaruan atau pelacakan pengiriman .. seperti misalnya pengiriman telah tiba di pagi hari .. tetapi statusnya akan diperbarui pada hari berikutnya', 'alami,lambat,besar,baru,lacak,kirim,seperti,misal,kirim,telah,tiba,pagi,hari,status,baru,hari,ikut', 1, '2022-05-24 16:53:56', 0),
(1326, 'Saya tidak dapat mengkonfirmasi pesanan menggunakan perangkat android saya, selalu mengaktifkan kembali tombol, membuat saya merasa pesanan saya akan dibatalkan karena pesanan yang terlihat belum dikonfirmasi. Silakan periksa.', 'tidak,dapat,konfirmasi,pesan,guna,angkat,android,aktif,kembali,tombol,buat,rasa,pesan,batal,pesan,lihat,belum,konfirmasi,sila,periksa', -1, '2022-05-24 16:53:56', 0),
(1327, 'Aplikasi tidak terlalu mudah dinavigasi. Ketika saya mencoba untuk memeriksa, aplikasi hanya mengatakan ada yang tidak beres tetapi tidak dapat memberi tahu saya apa yang salah.', 'aplikasi,tidak,mudah,navigasi,ketika,coba,periksa,aplikasi,atak,ada,tidak,beres,tidak,dapat,beri,tahu,salah', -1, '2022-05-24 16:53:56', 0),
