(1331, 'Saya harus mengubah tarif, maaf karena pembaruan baru ya ... Semua orang membicarakannya. Anda tahu masalah dengan Pengiriman Aplikasi, barang Pembatalan, barang hilang dan Lainnya. Ya itu memang mempengaruhi saya jadi ya turunkan tarif.', 'harus,ubah,tarif,maaf,baru,baru,ya,semua,orang,bicara,anda,tahu,masalah,kirim,aplikasi,barang,batal,barang,hilang,lain,ya,memang,pengaruh,jadi,ya,turun,tarif', -1, '2022-05-24 16:53:57', 0),
(1332, 'Aplikasi yang bagus tapi saya harap seperti di Shopee bahwa hanya dengan satu klik kita bisa melihat voucher apa yang bisa kita gunakan ketika kita ingin melihat barangnya. Karena hanya tertulis Masukkan Voucher', 'aplikasi,bagus,harap,seperti,shopee,satu,klik,lihat,voucher,guna,ketika,ingin,lihat,barang,tulis,masuk,voucher', -1, '2022-05-24 16:53:57', 0),
(1333, 'Lazada adalah media penjualan yang bagus untuk Indonesia. Siapa pun yang memiliki masalah dengan pencarian, mengunggah video, foto, dll dengan aplikasi yang mogok atau pintu belakang ke layar beranda, layar indeks atau sejenisnya, JANGAN hubungi Lazada karena mereka akan mencatatnya tetapi tidak melakukan apa-apa. Copot pemasangan tampilan web sistem android.. Buka toko APP & cari ini. Ketika dikatakan perbarui, itu akan menghapus versi saat ini tetapi JANGAN kemudian menginstal yang baru.. Keluar, reboot dan fungsionalitas akan kembali. Lazada tidak menawarkan atau mencari solusi, tetapi inilah saya', 'lazada,media,jual,bagus,indonesia,siapa,milik,masalah,cari,unggah,video,foto,dll,aplikasi,mogok,pintu,belakang,layar,beranda,layar,indeks,jenis,hubung,lazada,catat,tidak,laku,apaapa,copot,pasang,tampil,web,sistem,android,buka,toko,app,cari,ketika,katak,baru,hapus,versi,kemudian,menginstal,baru,keluar,reboot,fungsionalitas,kembali,lazada,tidak,awar,cari,solusi', -1, '2022-05-24 16:53:57', 0),
