(1335, 'Ini memiliki beberapa kesalahan. Saya tidak dapat melihat barang yang saya pesan. Saya pikir saya hanya perlu memperbaruinya tetapi tidak. Ini benar-benar memiliki beberapa kesalahan.', 'milik,beberapa,salah,tidak,dapat,lihat,barang,pesan,pikir,perlu,baru,tidak,benarbenar,milik,beberapa,salah', 1, '2022-05-24 16:53:57', 0),
(1336, 'Produk bagus dan banyak pilihan, harga murah tapi ongkos kirim lebih mahal dari barang yang ingin dipesan.', 'produk,bagus,banyak,pilih,harga,murah,ongkos,kirim,lebih,mahal,barang,ingin,pesan', -1, '2022-05-24 16:53:58', 0),
