(1339, 'Saya ditagih seolah-olah saya telah membuat pesanan pembelian setelah hanya melihat katalog padahal sebenarnya saya tidak membuat pesanan, berkali-kali.', 'tagih,seolaho,telah,buat,pesan,beli,sete,lihat,katalog,padahal,benar,tidak,buat,pesan,berkalikali', 1, '2022-05-24 16:53:58', 0),
