(1341, 'Ayah saya membelikan saya sesuatu di sini dan itu adalah keyboard satu tangan tetapi ketika dia memesan satu-satunya konektor di mana itu dan kadang-kadang pengirimannya sangat lama dan aplikasi ini agak bagus tetapi beberapa dari pengiriman itu tidak nyata', 'ayah,belikan,suatu,sini,keyboard,satu,tangan,ketika,mesan,satusatu,konektor,mana,kadangkadang,kirim,lama,aplikasi,agak,bagus,beberapa,kirim,tidak,nyata', -1, '2022-05-24 16:53:58', 0),
(1342, 'Ini adalah aplikasi yang bagus tetapi saya hanya dapat memeriksanya dan menyukai harganya karena aplikasi ini tidak mengirim ke negara saya (Kamboja)????????', 'aplikasi,bagus,dapat,periksa,suka,harga,aplikasi,tidak,kirim,negara,kamboja', -1, '2022-05-24 16:53:58', 0),
(1343, 'Penjual Anda selalu membatalkan pesanan. Bikin uang dompet lazada saya stuck disana. Benar-benar membuang waktu saya menunggu pesanan dikirim tetapi barang dibatalkan setelah seminggu. Hal ini membuat saya lebih memilih membeli dari shopee. Kurangi masalah lucu semacam ini', 'jual,anda,batal,pesan,bikin,uang,dompet,lazada,stuck,sana,benarbenar,buang,waktu,tunggu,pesan,kirim,barang,batal,sete,minggu,hal,buat,lebih,pilih,beli,shopee,kurang,masalah,lucu,macam', -1, '2022-05-24 16:53:59', 0),
(1344, 'aplikasi ini bagus tapi tidak ada voucher diskon & voucher pengiriman gratis. saya ingin menambahkan lebih banyak 2x voucher.', 'aplikasi,bagus,tidak,ada,voucher,diskon,voucher,kirim,gratis,ingin,tambah,lebih,banyak,x,voucher', -1, '2022-05-24 16:53:59', 0),
(1345, 'Loadingnya sangat lambat!!! Tingkatkan sistem Anda!!! Perangkat Keras pasti tidak cukup baik !!! Anda sudah mendapatkan begitu banyak, mengapa pelit itu??? Begitu banyak orang yang menggunakan dan sistem Anda tidak dapat menanganinya!!! Bagaimana cara berbisnis?!!!', 'loading,lambat,tingkat,sistem,anda,angkat,keras,pasti,tidak,cukup,baik,anda,sudah,dapat,banyak,pelit,banyak,orang,guna,sistem,anda,tidak,dapat,tangan,bagaimana,cara,bisnis', -1, '2022-05-24 16:53:59', 0),
(1346, 'setelah update, gambar/gambar produk tidak dimuat dengan benar.. harap Anda memperbaikinya sebelum bday sale. Terima kasih...', 'sete,update,gambargambar,produk,tidak,muat,benar,harap,anda,baik,belum,bday,sale,terima,kasih', 1, '2022-05-24 16:53:59', 0),
(1347, 'Saya tidak dapat meninggalkan ulasan, itu terus menyatakan masalah koneksi. Jika saya dapat menggunakan koneksi saya di aplikasi lain, itu bukan koneksi tetapi masalah aplikasi', 'tidak,dapat,tinggal,ulas,terus,nyata,masalah,koneksi,dapat,guna,koneksi,aplikasi,lain,bukan,koneksi,masalah,aplikasi', -1, '2022-05-24 16:53:59', 0),
(1348, 'Beberapa barang yang saya pesan tidak begitu oke meja belajarnya ada yang rusak..celana yang saya pesan tidak yang dikirim..tapi tidak apa-apa mungkin lain kali akan lebih baik.. selebihnya parsel.. semuanya bagus???????????? ????', 'beberapa,barang,pesan,tidak,oke,meja,ajar,ada,rusakcelana,pesan,tidak,dikirimtapi,tidak,apaapa,lain,kali,lebih,baik,lebih,parsel,semua,bagus', 1, '2022-05-24 16:54:00', 0),
(1349, 'Saya pelanggan tetap di sini. Beberapa penjual tidak jujur. Berharap lazada akan memblokir penjual yang tidak jujur. Jangan biarkan penjual yang tidak jujur, itu akan memiliki reputasi buruk Anda. Aplikasi Lazada bagus, tetapi beberapa penjual tidak.', 'langgan,sini,beberapa,jual,tidak,jujur,harap,lazada,blokir,jual,tidak,jujur,biar,jual,tidak,jujur,milik,reputasi,buruk,anda,aplikasi,lazada,bagus,beberapa,jual,tidak', -1, '2022-05-24 16:54:00', 0),
(1350, 'Lazada perlu melakukan seperti Shopee, di mana penjual HANYA MENDAPATKAN uang setelah pelanggan mengkonfirmasi bahwa mereka mendapatkan produk yang tepat karena saya melihat beberapa penjual mengirim produk yang salah dan tidak mengembalikan uang kepada pelanggan mereka.', 'lazada,perlu,laku,seperti,shopee,mana,jual,dapat,uang,sete,langgan,konfirmasi,dapat,produk,tepat,lihat,beberapa,jual,kirim,produk,salah,tidak,kembali,uang,langgan', 1, '2022-05-24 16:54:01', 0),
(1351, 'Aplikasi ini bagus tapi tidak bagus.. aplikasi tidak ramah pengguna, terutama dalam menerapkan voucher mereka. Tidak seperti toko online lainnya, ini sangat ramah pengguna..', 'aplikasi,bagus,tidak,bagus,aplikasi,tidak,ramah,guna,utama,terap,voucher,tidak,seperti,toko,online,lain,ramah,guna', -1, '2022-05-24 16:54:01', 0),
