(1393, 'Pengalaman setelah pembelian bagus. Tetapi fungsi pencarian hampir tidak berguna, tidak dapat mendeteksi kata kunci dengan benar, lebih cepat untuk mencari nama merek dan menelusuri halaman item untuk menemukan modelnya. Mengatakan banyak tentang pencarian mereka. Banyak bug mengenai daftar keinginan, baik itu tidak dimuat, atau disadap, membuat sebagian besar item saya berwarna abu-abu. Jika dibandingkan dengan pesaing seperti Shopee, pengalaman setelah pembelian yang baik saja tidak cukup baik.', 'alam,sete,beli,bagus,fungsi,cari,hampir,tidak,guna,tidak,dapat,deteksi,kata,kunci,benar,lebih,cepat,cari,nama,merek,telusur,halaman,item,temu,model,atak,banyak,tentang,cari,banyak,bug,kena,daftar,ingin,baik,tidak,muat,sadap,buat,besar,item,warna,abuabu,banding,saing,seperti,shopee,alam,sete,beli,baik,saja,tidak,cukup,baik', -1, '2022-05-24 16:54:09', 0),
(1394, 'Saya senang menggunakan Lazada baru-baru ini, tetapi saya merasa masih banyak yang harus ditingkatkan. Aplikasi ini bermasalah. Desain, antarmuka sangat berantakan dan membingungkan. Warnanya, *menghela nafas*. Ini tidak ramah pengguna dibandingkan dengan shopee. Sistem pelacakan membingungkan, sistem voucher membingungkan, cara menggunakan koin juga membingungkan, semuanya membingungkan. Mencari item, itu lebih buruk, tidak pernah dapat menemukan apa pun menggunakan kata kunci. Silakan belajar dari shopee dalam hal membuat aplikasi lebih ramah pengguna.', 'senang,guna,lazada,barubaru,rasa,masih,banyak,harus,tingkat,aplikasi,masa,desain,antarmuka,berantak,bingung,warna,hela,nafas,tidak,ramah,guna,banding,shopee,sistem,lacak,bingung,sistem,voucher,bingung,cara,guna,koin,bingung,semua,bingung,cari,item,lebih,buruk,tidak,dapat,temu,guna,kata,kunci,sila,ajar,shopee,hal,buat,aplikasi,lebih,ramah,guna', -1, '2022-05-24 16:54:10', 0),
(1395, 'Checkout ke halaman pembayaran terkadang ditutup paksa. Dan yang paling penting halaman ulasannya menyebalkan. Terutama ketika Anda menyelesaikan ulasan produk Anda mengetik begitu lama dan saat mengunggah foto dan video, itu macet. Sangat membuat frustrasi dan tidak pernah diperbaiki sejak hari pertama saya menggunakan aplikasi ini. Selain itu, terlalu banyak produk yang tidak terkait pada penjualan. Jangan hanya fokus pada uang dan live streaming. Kami membeli produk berdasarkan ulasan juga. Saya orang yang pekerja keras dan tidak berusaha, tetapi saya tidak mau mengulas karena merepotkan.', 'checkout,halaman,bayar,kadang,tutup,paksa,paling,penting,halaman,ulas,sebal,utama,ketika,anda,selesai,ulas,produk,anda,etik,lama,unggah,foto,video,macet,buat,frustrasi,tidak,baik,sejak,hari,pertama,guna,aplikasi,selain,banyak,produk,tidak,kait,jual,fokus,uang,live,streaming,beli,produk,dasar,ulas,orang,kerja,keras,tidak,usaha,tidak,ulas,repot', -1, '2022-05-24 16:54:10', 0),
