(1431, 'Ada beberapa hal yang dapat Anda tingkatkan 1. Jangan pernah mengonfirmasi status pengiriman kami secara otomatis tanpa izin pembeli kami 2. tingkatkan lebih banyak opsi kurir pengiriman yang memenuhi syarat untuk dipilih oleh pembeli. 3.desain ulang halaman daftar keinginan. Organisasi untuk item sangat mengganggu saya. Tidak begitu ramah pengguna. 4.jangan batasi jumlah minimum top-up di lazwallet. Itu juga tidak ramah pengguna.', 'ada,beberapa,hal,dapat,anda,tingkat,konfirmasi,status,kirim,cara,otomatis,tanpa,izin,beli,tingkat,lebih,banyak,opsi,kurir,kirim,penuh,syarat,pilih,beli,desain,ulang,halaman,daftar,ingin,organisasi,item,ganggu,tidak,ramah,guna,batas,jumlah,minimum,topup,lazwallet,tidak,ramah,guna', -1, '2022-05-24 16:54:22', 0),
(1432, 'Terlalu banyak iklan. Iklan paksa setiap kali aplikasi dibuka. Gak nyangka lazada bakal serendah ini. Saya sudah memulai belanja online saya dengan lazada dua tahun lalu. Membandingkannya dengan sekarang, saya benar-benar tahu bagaimana UX menjadi sangat buruk. Tim pengembang harus melihat aplikasi saingan seperti Shopee. Mereka telah melakukan pekerjaan yang jauh lebih baik bagi kami konsumen. Kami tidak membutuhkan terlalu banyak iklan. Anda membuat kekacauan total bagi kami, Lazada. Saat ini, saya hanya membuka ini jika ada item yang tidak tersedia di Shopee.', 'banyak,iklan,iklan,paksa,tiap,kali,aplikasi,buka,gak,nyangka,lazada,bakal,serendah,sudah,mulai,belanja,online,lazada,dua,tahun,banding,benarbenar,tahu,bagaimana,ux,jadi,buruk,tim,kembang,harus,lihat,aplikasi,saing,seperti,shopee,telah,laku,kerja,jauh,lebih,baik,konsumen,tidak,butuh,banyak,iklan,anda,buat,kacau,total,lazada,buka,ada,item,tidak,sedia,shopee', -1, '2022-05-24 16:54:22', 0),
