(1438, 'Aplikasi ini benar-benar menyebalkan. Ketika saya membeli 4 atau 5 item, itu tidak dapat dimuat untuk check out & pembayaran karena banyak membeli produk & memeriksanya membuat bug pada aplikasi. Jadi saya harus membayar biaya pengiriman x2 atau x3 untuk mendapatkan barang yang saya inginkan atau saya tidak bisa mendapatkan diskon yang ditawarkan untuk pelanggan besar. Sangat menyedihkan :\') Semoga tim produk aplikasi Lazada dapat melihat ulasan ini & lebih memperhatikan pelanggan & perbaiki kesalahannya. Tolong jadilah aplikasi yang lebih baik :))', 'aplikasi,benarbenar,sebal,ketika,beli,item,tidak,dapat,muat,check,out,bayar,banyak,beli,produk,periksa,buat,bug,aplikasi,jadi,harus,bayar,biaya,kirim,x,x,dapat,barang,ingin,tidak,dapat,diskon,ditawarkan,langgan,besar,sedih,moga,tim,produk,aplikasi,lazada,dapat,lihat,ulas,lebih,hati,langgan,baik,salah,tolong,jadi,aplikasi,lebih,baik', -1, '2022-05-24 16:54:25', 0),
(1439, 'Ada item dalam daftar \"Untuk Ditinjau\" yang macet di sana meskipun saya telah meninjau item tersebut beberapa kali. Ini sangat mengganggu! Saya hanya menerima pesan \"Anda telah mengirimkan\" ini setelah saya mengirimkan ulasan saya. Item seharusnya sudah dihapus dari daftar to-review saya.', 'ada,item,daftar,tinjau,macet,sana,meski,telah,tinjau,item,sebut,beberapa,kali,ganggu,terima,pesan,anda,telah,kirim,sete,kirim,ulas,item,harus,sudah,hapus,daftar,toreview', 1, '2022-05-24 16:54:26', 0),
(1440, 'Situs web yang sangat berantakan mengklaim bahasa Inggris tetapi sebagian besar vendor di situs tidak memposting deskripsi produk dalam bahasa Inggris. Bahkan tidak dapat menyalin dan menempelkan deskripsi untuk aplikasi terjemahan. Tidak memiliki standar yang seragam bagi vendornya untuk memposting informasi produk lengkap pada sebagian besar produk. Perlu memotong iklan, promo, dan halaman iklan spam yang mengganggu pencarian pembelian yang sah. Proses pembayaran dengan visa/MC adalah mimpi buruk.', 'situs,web,berantak,klaim,bahasa,inggris,besar,vendor,situs,tidak,memposting,deskripsi,produk,bahasa,inggris,bahkan,tidak,dapat,salin,tempel,deskripsi,aplikasi,terjemah,tidak,milik,standar,ragam,vendor,memposting,informasi,produk,lengkap,besar,produk,perlu,potong,iklan,promo,halaman,iklan,spam,ganggu,cari,beli,sah,proses,bayar,visamc,mimpi,buruk', -1, '2022-05-24 16:54:27', 0),
(1441, 'Fitur yang sangat tidak aman! Kartu kredit secara otomatis disimpan dan tidak diperlukan OTP lagi setelahnya!', 'fitur,tidak,aman,kartu,kredit,cara,otomatis,simpan,tidak,perlu,otp,telah', 1, '2022-05-24 16:54:27', 0),
(1442, 'Tingkat persediaan tidak ditampilkan untuk memberikan pandangan kepada pelanggan apakah barang masih tersedia atau tidak. Dalam upaya pertama saya untuk membeli, diberitahu bahwa barang itu tidak tersedia. Penjual cukup baik untuk menawarkan sesuatu yang lain tetapi masih mematikan dalam hal pengalaman pelanggan.', 'tingkat,sedia,tidak,tampil,berik,pandang,langgan,apakah,barang,masih,sedia,tidak,upaya,pertama,beli,beritahu,barang,tidak,sedia,jual,cukup,baik,awar,suatu,lain,masih,mati,hal,alam,langgan', 1, '2022-05-24 16:54:28', 0),
(1443, 'Mengunggah ulasan video 20 detik saja membutuhkan banyak waktu dan aplikasi terus dimulai ulang. Jangan salahkan ini ke ponsel saya karena memiliki kinerja yang baik dan saya memiliki koneksi internet yang baik. Dan juga tolong periksa penjual yang memiliki ulasan palsu tentang 5 bintang itu mengganggu, scam, dan tidak aman untuk pembeli asli.', 'unggah,ulas,video,detik,saja,butuh,banyak,waktu,aplikasi,terus,mulai,ulang,salah,ponsel,milik,kinerja,baik,milik,koneksi,internet,baik,tolong,periksa,jual,milik,ulas,palsu,tentang,bintang,ganggu,scam,tidak,aman,beli,asli', -1, '2022-05-24 16:54:28', 0),
(1444, 'UI aplikasi ini sangat membingungkan dan berantakan. Ini sangat lambat.. Ponsel cerdas saya memiliki benchmark antutu 300.000+ jadi saya yakin itu bukan masalah ponsel saya? Sangat lamban. Membuka gambar di bagian ulasan oleh pembeli lain membutuhkan waktu lama untuk dimuat. Memuat gambar di fb n ig r jauh lebih cepat. Tolong perbaiki ini. Sangat sulit berbelanja dengan aplikasi ini.', 'u,aplikasi,bingung,berantak,lambat,ponsel,cerdas,milik,benchmark,antutu,jadi,yakin,bukan,masalah,ponsel,lamban,buka,gambar,ulas,beli,lain,butuh,waktu,lama,muat,muat,gambar,fb,ig,r,jauh,lebih,cepat,tolong,baik,sulit,belanja,aplikasi', -1, '2022-05-24 16:54:29', 0),
(1445, 'Tidak dapat menggunakan uang yang dikembalikan dengan mudah. Butuh waktu lama untuk mengetahui cara menggunakannya. Maka tidak akan membiarkan saya melihat kode voucher. Itu menawarkan untuk menyalin kode tetapi tidak ada opsi untuk menempelkannya. Akhirnya saya tahu saya bisa menempelkan kode di aplikasi lain, lalu perlahan-lahan ketik kode besar-besaran sambil beralih antar aplikasi. Masalah yang sama di iPad juga. Juga mungkin pop-up dan ekstra konyol juga. Harus menjadi pengalaman e-niaga yang lebih lancar dan lebih sederhana seperti Amazon. Aplikasi yang cukup spam.', 'tidak,dapat,guna,uang,kembali,mudah,butuh,waktu,lama,mengetahui,cara,guna,maka,tidak,biar,lihat,kode,voucher,awar,salin,kode,tidak,ada,opsi,tempel,akhir,tahu,tempel,kode,aplikasi,lain,perlahanlahan,ketik,kode,besarbesaran,sambil,alih,antar,aplikasi,masalah,sama,ipad,popup,ekstra,konyol,harus,jadi,alam,eniaga,lebih,lancar,lebih,sederhana,seperti,amazon,aplikasi,cukup,spam', -1, '2022-05-24 16:54:29', 0),
(1446, 'Itu tidak baik. Saya tidak dapat menempatkan pesanan saya. Aku sangat kecewa. Mohon untuk memudahkan pembeli dalam membeli produk yang diinginkan dengan menggunakan voucher.', 'tidak,baik,tidak,dapat,tempat,pesan,kecewa,mohon,mudah,beli,beli,produk,ingin,guna,voucher', -1, '2022-05-24 16:54:30', 0),
(1447, 'Saya suka aplikasi ini sebenarnya saya sudah membeli banyak barang di sini tapi masalahnya adalah petugas pengiriman harus memberi tahu pelanggan sehari sebelum hari pengirimannya sehingga kami sudah siap ...', 'suka,aplikasi,benar,sudah,beli,banyak,barang,sini,masalah,tugas,kirim,harus,beri,tahu,langgan,hari,belum,hari,kirim,sehingga,sudah,siap', -1, '2022-05-24 16:54:30', 0),
(1448, 'Lazada berfungsi sebagaimana mestinya. Namun pop-up, iklan, dan pengalihan telah menjadi sangat mengganggu sehingga terus terbuka entah dari mana ketika saya menggunakan aplikasi lain atau menggunakan browser. Saya sudah mencoba mencari cara untuk menghentikan ini tetapi sejauh ini tidak berhasil.', 'lazada,fungsi,bagaimana,mesti,popup,iklan,alih,telah,jadi,ganggu,sehingga,terus,buka,entah,mana,ketika,guna,aplikasi,lain,guna,browser,sudah,coba,cari,cara,henti,jauh,tidak,hasil', -1, '2022-05-24 16:54:30', 0),
(1449, 'Saya adalah pengguna Lazada. Saya membeli beberapa barang yang harganya mahal. Saya memilih Lazada daripada Shopee, karena beberapa penjual memberikan harga yang kompetitif di atas Shopee, tetapi baru-baru ini tidak demikian. Hasil pencarian setelah pembaruan benar-benar rusak dan biaya pengiriman standar meningkat drastis. Antarmuka menjadi sangat membingungkan untuk digunakan dan lembur penjual luar negeri, yang saya belanjakan dari aplikasi ini entah bagaimana berkurang. Saya harap ini akan diperbaiki pada pembaruan berikutnya.', 'guna,lazada,beli,beberapa,barang,harga,mahal,pilih,lazada,daripada,shopee,beberapa,jual,berik,harga,kompetitif,shopee,barubaru,tidak,demikian,hasil,cari,sete,baru,benarbenar,rusak,biaya,kirim,standar,tingkat,drastis,antarmuka,jadi,bingung,guna,lembur,jual,neger,belanja,aplikasi,entah,bagaimana,kurang,harap,baik,baru,ikut', -1, '2022-05-24 16:54:31', 0),
(1450, 'Berguna jika Anda perlu memesan barang saat bepergian atau di luar rumah. Namun, saya tidak dapat memaafkan penyalahgunaan pemberitahuan push mereka untuk mengelabui orang agar berpikir bahwa mereka telah melewatkan panggilan. Itu hanya buang-buang waktu IMO. Saya tidak berpartisipasi dalam pencarian kupon jadi itu sama sekali tidak berguna bagi saya.', 'guna,anda,perlu,mesan,barang,bepergian,rumah,tidak,dapat,maaf,penyalahgunaan,beritahu,push,kelabu,orang,pikir,telah,lewat,panggil,buangbuang,waktu,imo,tidak,partisipasi,cari,kupon,jadi,sama,sekali,tidak,guna', -1, '2022-05-24 16:54:31', 0),
(1451, 'Pengiriman lambat, selalu tertunda, tidak memberikan hak ketika saya bertanya. Yang paling saya benci adalah iklan lazada selalu muncul di mana saja ketika saya menjelajah internet bahkan saya sudah mengunduhnya.. saya tahu kapan saya perlu berbelanja jadi jangan selalu munculkan aplikasi Anda. Sebenarnya saya hanya ingin memberikan 1 bintang tetapi saya memberikan kesepakatan 2 bcs untuk barang yang sangat² terjangkau dan saya menyukainya.', 'kirim,lambat,tunda,tidak,berik,hak,ketika,berta,paling,benci,iklan,lazada,muncul,mana,saja,ketika,jelajah,internet,bahkan,sudah,unduh,tahu,kapan,perlu,belanja,jadi,muncul,aplikasi,anda,benar,ingin,berik,bintang,berik,sepakat,bcs,barang,jangkau,suka', -1, '2022-05-24 16:54:32', 0),
(1452, 'Banyak barang palsu dan bajakan. Dan untuk penjual palsu/scam, melaporkan saja tidak cukup, ratusan muncul saat mencari komponen komputer dan perangkat elektronik lainnya. Sudah seperti ini sejak saya mulai menggunakan aplikasi ini bertahun-tahun yang lalu.', 'banyak,barang,palsu,bajak,jual,palsuscam,lapor,saja,tidak,cukup,ratus,muncul,cari,komponen,komputer,angkat,elektronik,lain,sudah,seperti,sejak,mulai,guna,aplikasi,bertahuntahun', -1, '2022-05-24 16:54:33', 0),
(1453, 'Hai Pengembang!!! Apakah Anda memiliki cukup waktu untuk mengubah antarmuka aplikasi sebanyak yang Anda inginkan? Pernahkah Anda berpikir untuk pengguna yang terbiasa dengan antarmuka lama Anda? Ini adalah warna hidup kelas rendah yang bukan warna ramah pengguna lagi. Saya mungkin mempertimbangkan untuk beralih ke Shoppee !!!', 'hai,kembang,apakah,anda,milik,cukup,waktu,ubah,antarmuka,aplikasi,banyak,anda,ingin,anda,pikir,guna,biasa,antarmuka,lama,anda,warna,hidup,kelas,rendah,bukan,warna,ramah,guna,timbang,alih,shoppee', -1, '2022-05-24 16:54:33', 0),
(1454, 'Shopee adalah alternatif yang jauh lebih baik. Pengiriman Lazada SUKSES saat Anda berada di wilayah provinsi. Pengiriman dari Metro Manila bisa memakan waktu hingga lebih dari seminggu! Sebagai perbandingan, pesanan Shopee dari NCR hanya membutuhkan waktu 3 hari saja. Dapatkan kurir Lazada yang lebih baik, dan saya mungkin akan menaikkan peringkat saya.', 'shopee,alternatif,jauh,lebih,baik,kirim,lazada,sukses,anda,rada,wilayah,provinsi,kirim,metro,manila,makan,waktu,hingga,lebih,minggu,bagai,banding,pesan,shopee,ncr,butuh,waktu,hari,saja,dapat,kurir,lazada,lebih,baik,naik,peringkat', 1, '2022-05-24 16:54:33', 0),
(1455, 'tidak dapat mendeteksi gambar untuk dipindai, lebih baik shopee.', 'tidak,dapat,deteksi,gambar,pindai,lebih,baik,shopee', 1, '2022-05-24 16:54:33', 0);
INSERT INTO `skripsi_rekap` (`no`, `komentar`, `stem`, `sentimen`, `tgl`, `flag`) VALUES
(1456, 'Fakta bahwa Anda menghargai koin orang karena meninggalkan ulasan spam paling bodoh di dunia merusak seluruh pengalaman aplikasi. Saya juga berpikir mesin pencari entah bagaimana lebih buruk daripada shopee, dan mereka sudah cukup buruk. Sulit untuk menemukan hal-hal. Dan kemudian ketika Anda menemukannya, itu berantakan.', 'fakta,anda,harga,koin,orang,tinggal,ulas,spam,paling,bodoh,dunia,rusak,seluruh,alam,aplikasi,pikir,mesin,pencar,entah,bagaimana,lebih,buruk,daripada,shopee,sudah,cukup,buruk,sulit,temu,halhal,kemudian,ketika,anda,temu,berantak', -1, '2022-05-24 16:54:34', 0),
(1457, 'Antarmuka pengguna yang buruk. Ada banyak hal yang terjadi di aplikasi, dan banyak hal yang dimuat sangat lambat. Ini juga tidak ramah pengguna, beberapa fitur pada aplikasi membutuhkan waktu untuk ditemukan.', 'antarmuka,guna,buruk,ada,banyak,hal,jadi,aplikasi,banyak,hal,muat,lambat,tidak,ramah,guna,beberapa,fitur,aplikasi,butuh,waktu,temu', -1, '2022-05-24 16:54:34', 0),
(1458, 'Voucher pengembalian dana lambat Lazada untuk Pengiriman yang Dibatalkan atau Gagal, melewatkan Penjualan Besar. Tidak ada lagi voucher kegembiraan, selalu tunjukkan diskon $1 yang ditukarkan dengan Lazcoins saya. Bonus Lazada tidak bisa digunakan juga. Voucher Lazada tidak dapat digunakan untuk RedMart, membuat hidup menjadi rumit. Tidak mengerti kebutuhan pelanggan, bahkan mendapat umpan balik Obrolan Dukungan Agen Langsung. Agen malas Lazada tidak membantu memperbarui status.????Lazada terburuk dari dukungan aplikasi lain tidak dapat memperbarui status untuk segera dikirim jika dikirimkan melalui surat biasa SingPost.', 'voucher,kembali,dana,lambat,lazada,kirim,batal,gagal,lewat,jual,besar,tidak,ada,voucher,gembira,tunjuk,diskon,tukar,lazcoins,bonus,lazada,tidak,guna,voucher,lazada,tidak,dapat,guna,redmart,buat,hidup,jadi,rumit,tidak,erti,butuh,langgan,bahkan,dapat,umpan,balik,obrol,dukung,agen,langsung,agen,malas,lazada,tidak,bantu,baru,statuslazada,buruk,dukung,aplikasi,lain,tidak,dapat,baru,status,segera,kirim,kirim,surat,biasa,singpost', 1, '2022-05-24 16:54:35', 0),
(1459, 'Saya mencoba menggunakan aplikasi man. Saya benar-benar ingin mencobanya. Tetapi setiap saya punya waktu untuk berbelanja online, aplikasinya sangat lambat. Untuk wanita yang sibuk sepanjang waktu, saya tidak sabar menunggunya bekerja. Membutuhkan waktu yang sangat lama untuk memuat apa pun.', 'coba,guna,aplikasi,man,benarbenar,ingin,coba,tiap,punya,waktu,belanja,online,aplikasi,lambat,wanita,sibuk,panjang,waktu,tidak,sabar,tunggu,kerja,butuh,waktu,lama,muat', -1, '2022-05-24 16:54:35', 0),
(1460, 'Bahkan tidak dapat mengumpulkan voucher di aplikasi. Hanya terus menampilkan Opps... Sistem salah.. pesan. Data yang dihapus dan aplikasi yang diinstal ulang masih memberikan kesalahan yang sama. Pengumpulan voucher hanya berfungsi di browser desktop. Aplikasi ini hanya gajah putih.', 'bahkan,tidak,dapat,kumpul,voucher,aplikasi,terus,tampil,opps,sistem,salah,pesan,data,hapus,aplikasi,diinstal,ulang,masih,berik,salah,sama,kumpul,voucher,fungsi,browser,desktop,aplikasi,gajah,putih', -1, '2022-05-24 16:54:35', 0),
(1461, 'Masalah saya adalah aplikasi ini sangat buggy. Membuka gambar pada ulasan terlalu lama dan sangat lamban, hal yang sama juga terjadi di situs web. Saya suka lazada, tetapi aplikasinya sendiri sangat buruk sekarang.', 'masalah,aplikasi,buggy,buka,gambar,ulas,lama,lamban,hal,sama,jadi,situs,web,suka,lazada,aplikasi,sendiri,buruk', -1, '2022-05-24 16:54:36', 0),
(1462, 'Saya harap Anda dapat meningkatkan antarmuka aplikasi Anda. Membingungkan untuk menelusuri, satu-satunya alasan saya masih menginstalnya adalah karena beberapa toko hanya tersedia di Lazada. Kalau tidak, saya lebih suka tidak menggunakannya.', 'harap,anda,dapat,tingkat,antarmuka,aplikasi,anda,bingung,telusur,satusatu,alas,masih,menginstal,beberapa,toko,sedia,lazada,tidak,lebih,suka,tidak,guna', -1, '2022-05-24 16:54:36', 0),
(1463, 'satu-satunya masalah adalah iklannya massal, dan itu terus mengarahkan saya untuk menginstalnya meskipun saya telah mengunduhnya', 'satusatu,masalah,iklan,massal,terus,arah,menginstal,meski,telah,unduh', -1, '2022-05-24 16:54:36', 0),
(1464, 'Pertama-tama, terlalu banyak bug seperti saya memiliki 200 item di daftar keinginan saya tetapi ketika saya membukanya tidak ada apa-apa selain setelah di-refresh menjadi normal. kedua, daftar keinginan seharusnya diurutkan berdasarkan waktu penambahan item tetapi diurutkan berdasarkan abjad sehingga sulit untuk menemukan produk yang saya suka', 'pertamatama,banyak,bug,seperti,milik,item,daftar,ingin,ketika,buka,tidak,ada,apaapa,selain,sete,direfresh,jadi,normal,dua,daftar,ingin,harus,urut,dasar,waktu,tambah,item,urut,dasar,abjad,sehingga,sulit,temu,produk,suka', -1, '2022-05-24 16:54:37', 0),
(1465, 'UI dan UX yang tidak terlalu ramah pengguna. Tidak terlalu jelas tentang cara mencari produk atau voucher tertentu. Proses pembayaran lurus ke depan, namun.', 'u,ux,tidak,ramah,guna,tidak,jelas,tentang,cara,cari,produk,voucher,tentu,proses,bayar,lurus,depan', -1, '2022-05-24 16:54:37', 0),
(1466, 'aplikasi lambat dan berat.. perlu dioptimalkan agar bandwidth lebih sedikit dan memuat lebih cepat.. mungkin merapikannya atau membuat UI yang lebih sederhana.. aplikasi terlihat seperti versi situs web terkompresi', 'aplikasi,lambat,berat,perlu,optimal,bandwidth,lebih,sedikit,muat,lebih,cepat,rapik,buat,u,lebih,sederhana,aplikasi,lihat,seperti,versi,situs,web,kompresi', -1, '2022-05-24 16:54:37', 0),
(1467, 'App adalah kekacauan visual yang lengkap. Terlalu banyak iklan dan elemen UI yang bentrok untuk menarik perhatian Anda. Juga mengirimkan ulasan masih bermasalah - bidang teks terus disetel ulang dan Anda hanya dapat mengunggah satu foto pada satu waktu karena alasan tertentu.', 'app,kacau,visual,lengkap,banyak,iklan,elemen,u,bentrok,tarik,hati,anda,kirim,ulas,masih,masa,bidang,teks,terus,setel,ulang,anda,dapat,unggah,satu,foto,satu,waktu,alas,tentu', -1, '2022-05-24 16:54:38', 0),
(1468, 'Ada bug yang perlu diperbaiki pada tahap checkout, memberi tahu layanan pelanggan dua kali sekarang, masih belum diperbaiki, 2 minggu kemudian. Semua orang sekarang mengeluh tentang hal itu.', 'ada,bug,perlu,baik,tahap,checkout,beri,tahu,layan,langgan,dua,kali,masih,belum,baik,minggu,kemudian,semua,orang,keluh,tentang,hal', -1, '2022-05-24 16:54:39', 0),
(1469, 'Jika pembatalan pesanan dibuat untuk 200 item yang sama, aplikasi ini akan mencantumkan 200 item untuk dijelajahi pelanggan, itu juga mengulangi hal yang sama di email Anda. Sungguh cara yang konyol untuk menelusuri riwayat pembelian.', 'batal,pesan,buat,item,sama,aplikasi,cantum,item,jelajah,langgan,ulang,hal,sama,email,anda,sungguh,cara,konyol,telusur,riwayat,beli', -1, '2022-05-24 16:54:40', 0),
(1470, 'Proses pendaftaran yang buruk. Proses penghapusan akun yang buruk. Tidak bisa lebih buruk. Pencarian, penyaringan, dan penyortiran tidak efisien. Sangat membutuhkan perbaikan', 'proses,daftar,buruk,proses,hapus,akun,buruk,tidak,lebih,buruk,cari,nyaring,sortir,tidak,efisien,butuh,baik', 1, '2022-05-24 16:54:40', 0),
(1471, 'Pembaruan terbaru membuatnya tidak mungkin untuk digunakan. Saya tidak dapat mengakses item, foto tidak dimuat, dan ketika saya mengatur ulang seluruh aplikasi, saya tidak dapat masuk.', 'baru,baru,buat,tidak,guna,tidak,dapat,akses,item,foto,tidak,muat,ketika,atur,ulang,seluruh,aplikasi,tidak,dapat,masuk', -1, '2022-05-24 16:54:40', 0),
