(1578, 'Platform yang bagus tetapi biaya pengiriman membuat saya mati. Juga, iklan pop-up yang tiba-tiba itu setiap kali saya menelusuri sesuatu yang tidak terkait dengan belanja online. Menunggu waktu yang tepat untuk mencopot pemasangan aplikasi ini.', 'platform,bagus,biaya,kirim,buat,mati,iklan,popup,tibatiba,tiap,kali,telusur,suatu,tidak,kait,belanja,online,tunggu,waktu,tepat,copot,pasang,aplikasi', -1, '2022-05-24 16:55:04', 0),
(1579, 'Aplikasi memuat lambat di ponsel saya dan membuatnya memanas. Pemuatan gambar yang lambat dan menghabiskan lebih banyak data seluler. Saya tidak bisa menikmati berbelanja dengan aplikasi yang lambat. Dulu bagus, sayang, saya suka bagaimana mereka menambahkan fitur untuk mengomentari ulasan.', 'aplikasi,muat,lambat,ponsel,buat,panas,muat,gambar,lambat,habis,lebih,banyak,data,seluler,tidak,nikmat,belanja,aplikasi,lambat,dulu,bagus,sayang,suka,bagaimana,tambah,fitur,komentar,ulas', -1, '2022-05-24 16:55:05', 0),
(1580, 'Saya dulu suka LAZADA tetapi akhir-akhir ini aplikasi ini, dan layanan yang disediakan perusahaan ini, telah berubah dari buruk menjadi lebih buruk. Aplikasi ini menjadi sangat berantakan dengan fitur-fitur yang tidak berfungsi. Pesanan muncul di menu \"Untuk Dikirim\" dan \"Untuk Menerima\". Sistem hadiah atau koin berantakan. Mencari fitur yang Anda butuhkan menjadi sangat sulit karena semua \"fitur\" yang tidak perlu bahkan tidak berfungsi. Saya sarankan menjaga hal-hal sederhana. Lebih sedikit lebih banyak (selama semua fitur berfungsi).', 'dulu,suka,lazada,akhirakhir,aplikasi,layan,sedia,usaha,telah,rubah,buruk,jadi,lebih,buruk,aplikasi,jadi,berantak,fiturfitur,tidak,fungsi,pesan,muncul,menu,kirim,terima,sistem,hadiah,koin,berantak,cari,fitur,anda,butuh,jadi,sulit,semua,fitur,tidak,perlu,bahkan,tidak,fungsi,saran,jaga,halhal,sederhana,lebih,sedikit,lebih,banyak,selama,semua,fitur,fungsi', -1, '2022-05-24 16:55:05', 0),
(1581, 'Saya mencoba memesan barang. Setelah melakukan pemesanan, aplikasi mengatakan barang sudah dikemas dan siap dikirim. Ini membuat entri di bawah \'Untuk Mengirim\' dan \'Untuk Menerima\'. Itu membingungkan. Sudah dikirim atau belum?? Kemudian 4 hari kemudian penjual memberi tahu saya bahwa barang akan tersedia dalam dua hari. Hah? Saya pikir itu sudah dikemas? Sekarang penjual memberi tahu saya bahwa barang telah dikirim, tetapi entri di bawah To Ship dan To Receive tidak berubah. Keduanya merujuk pada item yang sama. Saya juga tidak bisa melacak paket saya. Aneh.', 'coba,mesan,barang,sete,laku,mesan,aplikasi,atak,barang,sudah,kemas,siap,kirim,buat,entri,bawah,kirim,terima,bingung,sudah,kirim,belum,kemudian,hari,kemudian,jual,beri,tahu,barang,sedia,dua,hari,hah,pikir,sudah,kemas,jual,beri,tahu,barang,telah,kirim,entri,bawah,to,ship,to,receive,tidak,rubah,dua,rujuk,item,sama,tidak,lacak,paket,aneh', -1, '2022-05-24 16:55:06', 0),
(1582, '1/ Itu tidak akan membiarkan saya mendaftarkan dompet dan tanpa menyebutkan masalahnya. 2 / Saya memiliki masalah dengan pembayaran yang tidak berhasil ketika uang sudah dipotong dari akun saya. Saya tidak dapat menemukan alamat email untuk mengangkat masalah ini. Dan obrolan online? Siapa yang akan punya waktu untuk menunggu balasan Anda? Ketika Anda mengobrol dengan mereka dan tidak mendapatkan balasan dalam 5 menit, saya baru saja menyebutkan masalahnya dan semuanya secara detail tetapi Anda tidak akan melihat mereka menghubungi atau saat Anda kembali.', 'tidak,biar,daftar,dompet,tanpa,sebut,masalah,milik,masalah,bayar,tidak,hasil,ketika,uang,sudah,potong,akun,tidak,dapat,temu,alamat,email,angkat,masalah,obrol,online,siapa,punya,waktu,tunggu,balas,anda,ketika,anda,obrol,tidak,dapat,balas,menit,baru,saja,sebut,masalah,semua,cara,detail,anda,tidak,lihat,hubung,anda,kembali', -1, '2022-05-24 16:55:07', 0),
(1583, 'Saya dulu suka layanan ini ketika saya masih kuliah tapi itu 5 tahun yang lalu. Dan terakhir kali saya memesan biaya pengiriman lebih dari 100 plus peso. Ongkos kirim per barang bukan per pesanan.', 'dulu,suka,layan,ketika,masih,kuliah,tahun,akhir,kali,mesan,biaya,kirim,lebih,plus,peso,ongkos,kirim,per,barang,bukan,per,pesan', -1, '2022-05-24 16:55:07', 0),
(1584, 'Pencarian benar-benar menyakitkan, dengan hasil yang tidak relevan sebagian besar waktu. Beberapa produk yang tersedia entah bagaimana masuk ke mode tak terlihat di aplikasi, sedangkan mereka ada di sana jika Anda mencarinya menggunakan browser. Navigasinya lumayan tetapi terkadang aplikasi kesulitan memuat gambar dll (kelancaran hidup dan mati). Bukan pengalaman berbelanja yang menyenangkan tetapi entah bagaimana berhasil (tentu saja tidak mendekati sempurna, jauh dari itu).', 'cari,benarbenar,sakit,hasil,tidak,relevan,besar,waktu,beberapa,produk,sedia,entah,bagaimana,masuk,mode,tak,lihat,aplikasi,ada,sana,anda,cari,guna,browser,navigasi,lumayan,kadang,aplikasi,sulit,muat,gambar,dll,lancar,hidup,mati,bukan,alam,belanja,senang,entah,bagaimana,hasil,tentu,saja,tidak,dekat,sempurna,jauh', -1, '2022-05-24 16:55:07', 0),
(1585, 'Saya harap Anda mencoba untuk meningkatkan platform dan antarmuka Anda, grafik dan semuanya sangat menyenangkan dan bagus tetapi pengalaman pengguna sangat buruk, Anda memiliki banyak bug dan sangat sulit untuk digunakan karena sangat ramai dan sulit untuk dilihat, banyak penipu juga. Bahkan ketika menulis ulasan itu sulit karena terus tutup saat saya mengetik, saya baru saja lelah, toko malang yang tidak bisa mendapatkan ulasan karena platform Anda yang buruk.', 'harap,anda,coba,tingkat,platform,antarmuka,anda,grafik,semua,senang,bagus,alam,guna,buruk,anda,milik,banyak,bug,sulit,guna,ramai,sulit,lihat,banyak,tipu,bahkan,ketika,tulis,ulas,sulit,terus,tutup,etik,baru,saja,lelah,toko,malang,tidak,dapat,ulas,platform,anda,buruk', -1, '2022-05-24 16:55:08', 0),
(1586, 'Pesanan ada di \'Untuk Dikirim\' dan di \'Untuk Menerima\' pada saat yang sama, sangat membingungkan terutama. ketika Anda ingin membatalkan. Selalu menunjukkan kesalahan jaringan, FYI aplikasi diperbarui dan saya mencoba beberapa koneksi internet dari ISP yang berbeda. Mengikuti tautan dari mesin pencari (Google, Bing) mengarah ke produk yang berbeda. UI TIDAK intuitif. Memprioritaskan promosi daripada fungsi dasar.', 'pesan,ada,kirim,terima,sama,bingung,utama,ketika,anda,ingin,batal,tunjuk,salah,jaring,fyi,aplikasi,baru,coba,beberapa,koneksi,internet,isp,beda,ikut,taut,mesin,pencar,google,bing,arah,produk,beda,u,tidak,intuitif,prioritas,promosi,daripada,fungsi,dasar', -1, '2022-05-24 16:55:09', 0),
(1587, 'Sulit untuk memesan terutama ketika Anda memiliki lebih dari satu kuantitas untuk ditempatkan. Ini sangat membingungkan dan membuat frustrasi karena Anda masih tidak dapat menambahkan jumlah produk yang sama saat melakukan pemesanan dan Anda masih harus melakukannya sebagai pesanan lain hanya untuk menempatkan jumlah paket yang tepat. Membingungkan, karena Anda tidak tahu apakah ini memiliki biaya pengiriman terpisah atau tidak. Saya berharap ini akan menjangkau Anda.', 'sulit,mesan,utama,ketika,anda,milik,lebih,satu,kuantitas,tempat,bingung,buat,frustrasi,anda,masih,tidak,dapat,tambah,jumlah,produk,sama,laku,mesan,anda,masih,harus,laku,bagai,pesan,lain,tempat,jumlah,paket,tepat,bingung,anda,tidak,tahu,apakah,milik,biaya,kirim,pisah,tidak,harap,jangkau,anda', 1, '2022-05-24 16:55:10', 0),
(1588, 'Beri tahu saya cara menarik hadiah check-in harian setelah pengumpulan RM40. Tidak ada instruksi untuk itu.. apa peringkat saya atau kapan saya bisa menarik diri, apa artinya yang pertama datang pertama yang dilayani? Setiap hari saya memeriksa tepat jam 8 pagi tetapi saya menemukan hanya datang besok, maafkan saya aturan Anda!', 'beri,tahu,cara,tarik,hadiah,checkin,hari,sete,kumpul,rm,tidak,ada,instruksi,peringkat,kapan,tarik,diri,arti,pertama,datang,pertama,layan,tiap,hari,periksa,tepat,jam,pagi,temu,datang,besok,maaf,atur,anda', -1, '2022-05-24 16:55:10', 0);
INSERT INTO `skripsi_rekap` (`no`, `komentar`, `stem`, `sentimen`, `tgl`, `flag`) VALUES
(1589, 'Pekerjaan bagus sejauh ini sangat bagus, tetapi saya sepenuhnya setuju dengan sebagian besar pengguna karena situs/platform terlalu kikuk & tidak perlu mendorong barang penjualan terlalu banyak karena pengguna akan kesal & akan berhenti membeli. Hanya perlu menempatkan barang-barang penjualan di situs, harga, detail, voucher promo, gratis, dll. Juga harap fokus pada peningkatan dari ulasan negatif jika tidak pasti akan kehilangan pelanggan seperti banyak bisnis ritel online lainnya. Semoga ini membantu. Terima kasih :-)', 'kerja,bagus,jauh,bagus,penuh,tuju,besar,guna,situsplatform,kikuk,tidak,perlu,dorong,barang,jual,banyak,guna,kesal,henti,beli,perlu,tempat,barangbarang,jual,situs,harga,detail,voucher,promo,gratis,dll,harap,fokus,tingkat,ulas,negatif,tidak,pasti,hilang,langgan,seperti,banyak,bisnis,ritel,online,lain,moga,bantu,terima,kasih', -1, '2022-05-24 16:55:11', 0),
(1590, 'Kesalahan voucher dompet Truemoney, setiap kali saya mencoba memesan dengan dompet truemoney dan menerapkan diskon voucher 100 baht hanya ketika membayar dengan dompet truemoney, selalu muncul peringatan bahwa \"Pembayaran gagal\" tidak memberi kami gimmick saat promosi itu tidak berfungsi, lebih baik Anda mencabutnya atau memperbaikinya. #$*k', 'salah,voucher,dompet,truemoney,tiap,kali,coba,mesan,dompet,truemoney,terap,diskon,voucher,baht,ketika,bayar,dompet,truemoney,muncul,ingat,bayar,gagal,tidak,beri,gimmick,promosi,tidak,fungsi,lebih,baik,anda,cabut,baik,k', 1, '2022-05-24 16:55:12', 0),
(1591, 'dulu hidup dan memesan banyak barang di sana tetapi beberapa bagaimana saya mendapatkan pengalaman buruk dengan aplikasi lagi dan lagi dan lagi. Sangat kecewa karena sekarang saya hanya menggunakan shoppee. Koin tidak berguna. Dan untuk sekali ini saya tebus untuk pertama kalinya. Hanya untuk mendapatkan es krim tetapi saya menerima kesalahan pada tautan dompet, setelah menerima email. Mencoba menyambung ke obrolan... membeku dan tidak berfungsi. buang-buang waktu. Oleh lazada.', 'dulu,hidup,mesan,banyak,barang,sana,beberapa,bagaimana,dapat,alam,buruk,aplikasi,kecewa,guna,shoppee,koin,tidak,guna,sekali,tebus,pertama,kali,dapat,es,krim,terima,salah,taut,dompet,sete,terima,email,coba,sambung,obrol,membe,tidak,fungsi,buangbuang,waktu,lazada', -1, '2022-05-24 16:55:13', 0),
(1592, 'Sangat tidak ramah pengguna dan terlalu rumit untuk berbelanja! Saya bisa pergi ke department store n supermarket untuk berbelanja n pulang ke rumah dan tidur selama lebih dari setengah hari, dibandingkan dengan berbelanja di sini saya menghabiskan lebih dari 24 jam upaya berulang hanya untuk berbelanja beberapa item! Plus membuatnya sederhana, lurus ke depan dan USER FRIENDLY! Plus coba belanja di Amazon dan bandingkan! Terima kasih!', 'tidak,ramah,guna,rumit,belanja,pergi,department,store,supermarket,belanja,pulang,rumah,tidur,selama,lebih,tengah,hari,banding,belanja,sini,habis,lebih,jam,upaya,ulang,belanja,beberapa,item,plus,buat,sederhana,lurus,depan,user,friendly,plus,coba,belanja,amazon,banding,terima,kasih', -1, '2022-05-24 16:55:13', 0),
(1593, '1 bintang untuk aplikasi. Ada cacat di aplikasi, saya mendaftar dengan email ketika saya membuat akun, setelah beberapa bulan tidak menggunakannya saya masuk lagi dan itu (secara default) masuk menggunakan nomor telepon. Ketika saya mengedit profil saya dan menambahkan email saya, itu tidak bisa (cs email sudah digunakan yang merupakan acc saya). Sekarang saya ingin email dan nomor saya dalam satu acc tapi saya tidak bisa cz satu acc menggunakan email bukan telepon dan sebaliknya. Saya menghubungi layanan pelanggan tetapi tidak ada solusi yang solid, tetapi gercep-ness membuat 1 bintang.', 'bintang,aplikasi,ada,cacat,aplikasi,daftar,email,ketika,buat,akun,sete,beberapa,bulan,tidak,guna,masuk,cara,default,masuk,guna,nomor,telepon,ketika,edit,profil,tambah,email,tidak,cs,email,sudah,guna,rupa,acc,ingin,email,nomor,satu,acc,tidak,cz,satu,acc,guna,email,bukan,telepon,balik,hubung,layan,langgan,tidak,ada,solusi,solid,gercepness,buat,bintang', 1, '2022-05-24 16:55:14', 0),
(1594, 'Saya telah menggunakan Lazada selama 3 tahun sekarang, satu hal yang sangat saya benci tentang aplikasi ini adalah bagaimana tidak mempercayai indikator pengiriman gratis. Karena semua orang melihat Lazada Pride\'ing sendiri tentang pengiriman gratis mereka, Anda bahkan dapat memiliki hadiah pengiriman gratis yang muncul di layar Anda setiap lima menit. Tapi ketika Anda benar-benar berada di \"halaman checkout\", yang disebutkan Pengiriman Gratis tiba-tiba menghilang begitu saja dan karenanya, sebenarnya tidak ada pengiriman gratis di Lazada. Ini hanya cara untuk menarik orang untuk $ mereka.', 'telah,guna,lazada,selama,tahun,satu,hal,benci,tentang,aplikasi,bagaimana,tidak,percaya,indikator,kirim,gratis,semua,orang,lihat,lazada,prideing,sendiri,tentang,kirim,gratis,anda,bahkan,dapat,milik,hadiah,kirim,gratis,muncul,layar,anda,tiap,lima,menit,ketika,anda,benarbenar,rada,halaman,checkout,sebut,kirim,gratis,tibatiba,hilang,saja,benar,tidak,ada,kirim,gratis,lazada,cara,tarik,orang', -1, '2022-05-24 16:55:15', 0),
(1595, 'Sekarang tidak ada lagi pengumpulan poin, lazada tidak berguna. Layanan pengiriman mereka mengerikan. Mereka tidak pernah menelepon atau mengirim pesan sebelumnya, hanya datang kapan saja mereka mau. Jika mereka tidak dapat menangkap Anda di rumah 2 kali, mereka mengirim paket Anda kembali. Dan tentu saja tidak mungkin berbicara dengan kurir untuk orang asing.', 'tidak,ada,kumpul,poin,lazada,tidak,guna,layan,kirim,ngeri,tidak,telepon,kirim,pesan,belum,datang,kapan,saja,tidak,dapat,tangkap,anda,rumah,kali,kirim,paket,anda,kembali,tentu,saja,tidak,bicara,kurir,orang,asing', -1, '2022-05-24 16:55:15', 0),
(1596, 'Saya kesal karena promo 1400 mengatakan itu 8 peso dan 25 peso tetapi ketika saya hampir selesai dan saya akan mengklaim promo, saya hanya memiliki 65 peso ketika mereka tiba-tiba menurunkan jumlahnya dan meskipun aplikasi sudah diinstal, mereka mengatakan juga bahwa Anda perlu menginstal pada akhirnya satu-satunya hal yang bisa Anda dapatkan adalah 50 sen itu hanya mengganggu karena sulit untuk menemukan seseorang untuk diundang dan kemudian Anda belum memperbaiki aturan Anda', 'kesal,promo,atak,peso,peso,ketika,hampir,selesai,klaim,promo,milik,peso,ketika,tibatiba,turun,jumlah,meski,aplikasi,sudah,diinstal,atak,anda,perlu,menginstal,akhir,satusatu,hal,anda,dapat,sen,ganggu,sulit,temu,seseorang,undang,kemudian,anda,belum,baik,atur,anda', -1, '2022-05-24 16:55:15', 0),
(1597, 'Saya menghapus aplikasi ini untuk sementara waktu. Kemudian, saya mendaftar. Saya menggunakan akun Email lain. Dan kemudian, saya ingin mengaktifkan Dompet Lazada saya. Saya menambahkan nomor telepon saya, mereka berkata, \"silakan gunakan nomor lain\". Bagaimana cara mengaktifkan Dompet Lazada saya??', 'hapus,aplikasi,sementara,waktu,kemudian,daftar,guna,akun,email,lain,kemudian,ingin,aktif,dompet,lazada,tambah,nomor,telepon,kata,sila,guna,nomor,lain,bagaimana,cara,aktif,dompet,lazada', -1, '2022-05-24 16:55:16', 0),
(1598, 'Apakah tugasnya sebagai belanja online tetapi gayanya terlihat seperti situs lama dengan iklan yang tampak seperti virus. Sangat berantakan dan tidak mudah digunakan dan juga terlihat tidak profesional.', 'apakah,tugas,bagai,belanja,online,gaya,lihat,seperti,situs,lama,iklan,tampak,seperti,virus,berantak,tidak,mudah,guna,lihat,tidak,profesional', -1, '2022-05-24 16:55:16', 0),
(1599, 'maaf saya rasa ada yang salah dengan aplikasi line saya. karena setiap kali saya menggunakan aplikasi garis aplikasi ini selalu muncul yang sangat mengganggu tetapi saya masih harus menggunakan aplikasi garis. jadi saya harus uninstall aplikasi lazada semoga saja berhenti muncul. Terima kasih.', 'maaf,rasa,ada,salah,aplikasi,line,tiap,kali,guna,aplikasi,garis,aplikasi,muncul,ganggu,masih,harus,guna,aplikasi,garis,jadi,harus,uninstall,aplikasi,lazada,moga,saja,henti,muncul,terima,kasih', -1, '2022-05-24 16:55:16', 0),
(1600, '2 bintang sejak sekarang, Lazada tidak memindai pesanan saya sehingga mereka akan dibatalkan setiap saat. Hei!!!! Saya sudah memperbarui aplikasi, mengapa tidak memindai pesanan saya? Sangat membuang-buang waktu untuk memesan ulang terutama ketika saya memesan barang-barang itu ketika sedang dijual!!! Tolong segera perbaiki masalah ini.', 'bintang,sejak,lazada,tidak,pindai,pesan,sehingga,batal,tiap,hei,sudah,baru,aplikasi,tidak,pindai,pesan,membuangbuang,waktu,mesan,ulang,utama,ketika,mesan,barangbarang,ketika,jual,tolong,segera,baik,masalah', -1, '2022-05-24 16:55:17', 0),
(1601, 'Pembaruan terbaru telah membuat aplikasi kurang dapat digunakan, karena mencari item tertentu sekarang menghasilkan hasil yang tidak relevan (yaitu sampah acak) yang tidak dapat Anda filter. Ini sangat membuat frustrasi karena jumlah toko yang teduh tampaknya meningkat, dengan tampaknya tidak ada upaya kontrol kualitas atau kurasi yang tepat oleh Lazada.', 'baru,baru,telah,buat,aplikasi,kurang,dapat,guna,cari,item,tentu,hasil,hasil,tidak,relevan,sampah,acak,tidak,dapat,anda,filter,buat,frustrasi,jumlah,toko,teduh,tampak,tingkat,tampak,tidak,ada,upaya,kontrol,kualitas,kuras,tepat,lazada', -1, '2022-05-24 16:55:17', 0),
(1602, 'Pengiriman memakan waktu terlalu lama, Anda mengalahkan kargo pada pengiriman yang lambat. Kargo dari luar negeri, sedangkan produk di sini adalah lokal, mengapa terlalu lama? Saya sabar karena pandemi, tapi sebulan? Ini tidak-tidak bagi saya. Saya tidak akan pernah memesan di sini lagi. Dan harga produknya dua kali lipat dibanding Shopee, merk sama, produk samw, tapi beda harga? Tidak, ini tidak terjadi bestie.', 'kirim,makan,waktu,lama,anda,alah,kargo,kirim,lambat,kargo,neger,produk,sini,lokal,lama,sabar,pandemi,bulan,tidaktidak,tidak,mesan,sini,harga,produk,dua,kali,lipat,banding,shopee,k,sama,produk,samw,beda,harga,tidak,tidak,jadi,bestie', -1, '2022-05-24 16:55:17', 0),
(1603, 'Saya pelanggan jangka panjang Anda. Sejak memperbarui aplikasi, ada banyak masalah. Setiap kali mematikan aplikasi, latar belakang akan ditampilkan lazada menggunakan baterai. Itu akan tetap sama setelah Anda mematikannya. Tolong perbaiki. Sangat mengganggu sudah beberapa hari. Berpikir tentang mengunduh Shopee.', 'langgan,jangka,panjang,anda,sejak,baru,aplikasi,ada,banyak,masalah,tiap,kali,mati,aplikasi,latar,belakang,tampil,lazada,guna,baterai,sama,sete,anda,mati,tolong,baik,ganggu,sudah,beberapa,hari,pikir,tentang,unduh,shopee', -1, '2022-05-24 16:55:18', 0),
(1604, 'Hai game ini super tapi crashnya kurang bagus', 'hai,game,super,crash,kurang,bagus', -1, '2022-05-24 16:55:18', 0),
