(1696, 'Tolong jangan paksa aplikasi Anda untuk memulai otomatis. Saya selalu harus menonaktifkan setiap setelah pembaruan. Bintang akan diperbarui setelah diselesaikan.', 'tolong,paksa,aplikasi,anda,mulai,otomatis,harus,nonaktif,tiap,sete,baru,bintang,baru,sete,selesai', -1, '2022-05-24 16:55:44', 0),
(1697, 'Terlalu banyak produk palsu dan penjual palsu. mohon izinkan kami untuk melaporkan penjual yang menjual produk palsu untuk pengalaman berbelanja yang lebih baik. juga mengapa aplikasi menyala setiap kali saya mematikan layar', 'banyak,produk,palsu,jual,palsu,mohon,izin,lapor,jual,jual,produk,palsu,alam,belanja,lebih,baik,aplikasi,nyala,tiap,kali,mati,layar', -1, '2022-05-24 16:55:44', 0),
