(1701, 'Jangan memaksa orang untuk mengunduh aplikasi. setiap kali saya membuka halaman web lazada di browser apa pun di android, itu memaksa saya untuk membuka playstore atau aplikasi lazada itu sendiri, Ini Sangat Mengganggu. Ukuran aplikasi itu sendiri sangat besar dan terkadang aplikasi membeku jadi saya perlu menutup aplikasi dan menghapus cache lalu membukanya kembali, Itu Sangat Mengganggu.', 'aksa,orang,unduh,aplikasi,tiap,kali,buka,halaman,web,lazada,browser,android,aksa,buka,playstore,aplikasi,lazada,sendiri,ganggu,ukur,aplikasi,sendiri,besar,kadang,aplikasi,membe,jadi,perlu,tutup,aplikasi,hapus,cache,buka,kembali,ganggu', -1, '2022-05-24 16:55:46', 0),
