(1736, 'Ada begitu banyak penjual palsu di Lazada. Saya telah melaporkannya tetapi Lazada tampaknya tidak menindaklanjutinya. Mereka hanya menandai mereka ketika pengiriman gagal yang tidak bisa dihindari. Berhati-hatilah pada penjual tanpa ulasan dan harga rendah yang terlalu bagus untuk menjadi kenyataan. Anda dapat menemukannya dengan membeli secara COD. Mereka akan meminta uang muka yang tidak diperbolehkan oleh Lazada.', 'ada,banyak,jual,palsu,lazada,telah,lapor,lazada,tampak,tidak,menindaklanjuti,tanda,ketika,kirim,gagal,tidak,hindar,berhatihati,jual,tanpa,ulas,harga,rendah,bagus,jadi,nyata,anda,dapat,temu,beli,cara,cod,minta,uang,muka,tidak,boleh,lazada', -1, '2022-05-24 16:55:54', 0),
