(1847, 'Singkirkan penjual yang memberikan harga murah yang menyesatkan. Diiklankan sebagai harga rendah tetapi biaya pengiriman 50 - 70 kali lebih mahal dari harga itu sendiri. Juga perlu menghapus penjual yang diiklankan sebagai barang murah tapi sebenarnya berbeda dari produk yang ditampilkan. Itu membuat aplikasi belanja online yang bagus ini terlihat seperti situs web penipu. Lazada dulunya adalah pilihan pertama saya tetapi sekarang tidak lagi karena jenis penjual seperti ini. Terlalu banyak dari mereka di aplikasi Anda! . Tolong atasi masalah ini.', 'singkir,jual,berik,harga,murah,sesat,iklan,bagai,harga,rendah,biaya,kirim,kali,lebih,mahal,harga,sendiri,perlu,hapus,jual,iklan,bagai,barang,murah,benar,beda,produk,tampil,buat,aplikasi,belanja,online,bagus,lihat,seperti,situs,web,tipu,lazada,dulu,pilih,pertama,tidak,jenis,jual,seperti,banyak,aplikasi,anda,tolong,masalah', -1, '2022-05-24 16:56:21', 0),
(1848, 'Saya menyarankan aplikasi ini karena sangat berguna dan nyaman, saya hanya benci ketika iklan acak akan muncul ketika saya berada di situs web di chrome. dan ketika Anda tidak sengaja mengkliknya, itu akan membawa Anda ke aplikasi ini. Saya tidak tahu apakah ini semacam cara untuk memperkenalkan aplikasi atau hanya karena, itu menjengkelkan. Tapi tidak ada yang lain, itu acungan jempol', 'saran,aplikasi,guna,nyaman,benci,ketika,iklan,acak,muncul,ketika,rada,situs,web,chrome,ketika,anda,tidak,sengaja,klik,bawa,anda,aplikasi,tidak,tahu,apakah,macam,cara,kenal,aplikasi,jengkel,tidak,ada,lain,acung,jempol', -1, '2022-05-24 16:56:21', 0),
(1849, 'Aplikasi ini bagus tapi aplikasi mengecewakan, itu sebabnya saya hanya memberikan 2 bintang untuk aplikasi ini. Saya masih harus memperbaruinya, Beberapa penjual tidak memberikan pesanan pelanggan mereka dengan benar (hanya penjual lain). Beberapa pengiriman lama waktunya untuk disampaikan, dan beberapa tidak. Mengapa aplikasi ini ingin diperbarui, itu hanya buang-buang mb.', 'aplikasi,bagus,aplikasi,kecewa,sebab,berik,bintang,aplikasi,masih,harus,baru,beberapa,jual,tidak,berik,pesan,langgan,benar,jual,lain,beberapa,kirim,lama,waktu,sampai,beberapa,tidak,aplikasi,ingin,baru,buangbuang,mb', -1, '2022-05-24 16:56:22', 0),
(1850, 'Masalah saya tentang aplikasi ini adalah di top up saya sudah menginstal dan uninstall aplikasi tapi selalu mengatakan layanan sibuk untuk top up, saya pikir 2 kali lang ako nakacheck out ng memuat tsaka sebulan yang lalu pa yun pero ngayon laging ganun ang lumalabas sana naman po maayos yung tentang beban sa. salam kenal .', 'masalah,tentang,aplikasi,top,up,sudah,menginstal,uninstall,aplikasi,atak,layan,sibuk,top,up,pikir,kali,lang,ako,nakacheck,out,ng,muat,tsaka,bulan,pa,yun,o,ngayon,laging,ganun,ang,lumalabas,sana,naman,po,maayos,yung,tentang,beban,sa,salam,kenal', -1, '2022-05-24 16:56:22', 0),
(1851, 'Itu membuat saya mengarahkan ulang untuk mengunduh meskipun sudah diinstal', 'buat,arah,ulang,unduh,meski,sudah,diinstal', 1, '2022-05-24 16:56:22', 0);
INSERT INTO `skripsi_rekap` (`no`, `komentar`, `stem`, `sentimen`, `tgl`, `flag`) VALUES
(1852, 'Saya menilai aplikasi ini untuk ini Saya hanya memesan 1 item tetapi kesalahannya mereka memiliki 1 penerima 1 kapal 1 untuk membayar mengapa tolong perbaiki', 'nilai,aplikasi,mesan,item,salah,milik,terima,kapal,bayar,tolong,baik', -1, '2022-05-24 16:56:22', 0),
(1853, 'Sangat buruk! Harap tetap sederhana untuk digunakan dan iklan ada di mana-mana! Saya lebih suka menggunakan shoppee karena lebih mudah digunakan.', 'buruk,harap,sederhana,guna,iklan,ada,manamana,lebih,suka,guna,shoppee,lebih,mudah,guna', 1, '2022-05-24 16:56:23', 0),
(1854, 'Saya berharap Lazada telah melibatkan perusahaan desain/perancang antarmuka pengguna yang lebih baik sejak awal. Situs web ini masih belum terlalu intuitif meskipun sudah ada sejak lama dan sayangnya platform lain telah menyalin antarmuka yang sama, akibatnya juga aspek negatifnya. (Dibuktikan dengan banyak ulasan oleh pengguna lain) Saya harus menekan tombol kembali berkali-kali sebelum saya bisa sampai ke Beranda dan melihat daftar keinginan saya karena menu utama tidak tersedia setelah semua klik-tayang itu.', 'harap,lazada,telah,libat,usaha,desainperancang,antarmuka,guna,lebih,baik,sejak,awal,situs,web,masih,belum,intuitif,meski,sudah,ada,sejak,lama,sayang,platform,lain,telah,salin,antarmuka,sama,akibat,aspek,negatif,bukti,banyak,ulas,guna,lain,harus,nek,tombol,kembali,berkalikali,belum,sampai,beranda,lihat,daftar,ingin,menu,utama,tidak,sedia,sete,semua,kliktayang', -1, '2022-05-24 16:56:23', 0),
(1855, 'Dikatakan \"pengiriman gratis\" padahal sebenarnya tidak terutama di Mindanao. Biaya pengiriman lebih mahal dari yang Anda beli. Tidak adil bahwa hanya di wilayah Metro Manila atau Luzon yang dapat mengalami hal \"pengiriman gratis\". Dan beberapa penjual baik itu LazMall atau bukan tidak akan memberi Anda layanan yang baik. Beberapa dari mereka akan mengirimkan kepada Anda produk dengan beberapa goresan pada item atau item yang bocor dan cacat terburuk. Anda harus memantau keluhan pelanggan dan saran. Semoga Anda membaik.', 'katak,kirim,gratis,padahal,benar,tidak,utama,mindanao,biaya,kirim,lebih,mahal,anda,beli,tidak,adil,wilayah,metro,manila,luzon,dapat,alami,hal,kirim,gratis,beberapa,jual,baik,lazmall,bukan,tidak,beri,anda,layan,baik,beberapa,kirim,anda,produk,beberapa,gores,item,item,bocor,cacat,buruk,anda,harus,pantau,keluh,langgan,saran,moga,anda,baik', 1, '2022-05-24 16:56:23', 0),
(1856, 'Pada awalnya, itu bekerja dengan baik. Saya memesan 4 sepatu bot dan itu datang kepada saya dengan selamat. Tapi setelah berbulan-bulan menggunakan Lazada, saya tidak bisa membukanya lagi! itu hitam! tolong perbaiki. tidak lagi direkomendasikan.', 'awal,kerja,baik,mesan,sepatu,bot,datang,selamat,sete,berbulanbulan,guna,lazada,tidak,buka,hitam,tolong,baik,tidak,rekomendasi', -1, '2022-05-24 16:56:24', 0),
(1857, 'Aplikasi tidak mengizinkan pembaruan atau ulasan lebih lanjut dari produk yang dibeli setelah periode penggunaan yang lebih lama. Semua tinjauan harus diselesaikan dalam waktu kurang dari sebulan, jika tidak, Anda tidak akan dapat melakukannya lagi. Meskipun upaya untuk memberi tahu perusahaan, tidak ada yang dilakukan. Karena mereka tidak ingin meningkatkan pengalaman pembeli di masa depan. Sertakan ulasan produk selama 6 bulan seperti yang dilakukan aliexpress.', 'aplikasi,tidak,izin,baru,ulas,lebih,lanjut,produk,beli,sete,periode,guna,lebih,lama,semua,tinjau,harus,selesai,waktu,kurang,bulan,tidak,anda,tidak,dapat,laku,meski,upaya,beri,tahu,usaha,tidak,ada,laku,tidak,ingin,tingkat,alam,beli,masa,depan,ulas,produk,selama,bulan,seperti,laku,aliexpress', -1, '2022-05-24 16:56:24', 0),
(1858, 'sedangkan e-commerce lain memiliki kesempatan satu kali untuk mengubah alamat ketika barang sudah dibayar, lazada tidak memilikinya. admin csupport sangat tidak membantu. menanyakan pertanyaan yang sama tetapi dengan ppl yang berbeda. itu hanya membuat frustrasi. dan pasti akan menggunakan ecomm oranye dan hijau setelahnya.', 'ecommerce,lain,milik,sempat,satu,kali,ubah,alamat,ketika,barang,sudah,bayar,lazada,tidak,milik,admin,csupport,tidak,bantu,tanya,tanya,sama,ppl,beda,buat,frustrasi,pasti,guna,ecomm,oranye,hijau,telah', -1, '2022-05-24 16:56:25', 0),
(1859, 'Secara harfiah memaksa Anda untuk menggunakan aplikasi alih-alih situs web mereka (situs web terus-menerus membombardir Anda dengan \"lalu lintas yang tidak biasa\"). Spam Anda dengan \"penjualan\" atau acara langsung yang tidak dapat Anda matikan. Kategori notifikasi aplikasi digabungkan menjadi satu di android, jadi tidak ada cara untuk menonaktifkan notifikasi promosi kecuali Anda ingin ketinggalan pesanan. Shopee masih buruk, tetapi jauh lebih baik dari ini. Bahkan toko \"resmi\" pun rusak.', 'cara,harfiah,aksa,anda,guna,aplikasi,alihalih,situs,web,situs,web,terusmenerus,bombardir,anda,lintas,tidak,biasa,spam,anda,jual,acara,langsung,tidak,dapat,anda,mati,kategori,notifikasi,aplikasi,gabung,jadi,satu,android,jadi,tidak,ada,cara,nonaktif,notifikasi,promosi,kecuali,anda,ingin,tinggal,pesan,shopee,masih,buruk,jauh,lebih,baik,bahkan,toko,resmi,rusak', -1, '2022-05-24 16:56:25', 0),
(1860, 'Saya tidak dapat menemukan tombol umpan balik di aplikasi jadi saya akan meletakkannya di sini. Saya hanya berharap Anda membuatnya lebih ramah pengguna. Saya masih tersesat dalam menemukan tombol dan sangat disayangkan bahwa voucher pengiriman gratis terbatas pada sejumlah pengguna dan koin hanya dapat digunakan dengan menukarnya dengan voucher. Memberikan ulasan untuk pembelian juga sulit—itu ditutup setelah saya memasukkan ulasan saya dan akan mengirimkannya, dan terkadang saya harus kembali beberapa kali karena terus mogok.', 'tidak,dapat,temu,tombol,umpan,balik,aplikasi,jadi,letak,sini,harap,anda,buat,lebih,ramah,guna,masih,sesat,temu,tombol,sayang,voucher,kirim,gratis,batas,sejum,guna,koin,dapat,guna,tukar,voucher,berik,ulas,beli,sulititu,tutup,sete,masuk,ulas,kirim,kadang,harus,kembali,beberapa,kali,terus,mogok', -1, '2022-05-24 16:56:26', 0),
(1861, 'Menampilkan iklan saat Anda meluncurkan aplikasi, sangat berisi spam dengan notifikasi secara default dan UI berantakan dengan tombol yang tidak intuitif. Saya hanya menggunakan aplikasi web mereka sebagian besar waktu.', 'tampil,iklan,anda,luncur,aplikasi,risi,spam,notifikasi,cara,default,u,berantak,tombol,tidak,intuitif,guna,aplikasi,web,besar,waktu', -1, '2022-05-24 16:56:26', 0),
(1862, 'Ini bukan aplikasi yang ramah pengguna. Anda merasa sulit untuk menggunakan kode voucher, saya bahkan harus mencarinya di google tentang cara menggunakan voucher pengiriman gratis dan pada akhirnya, saya tidak dapat menggunakannya karena hanya berlaku untuk beberapa item. Selain itu, Anda perlu mengklik produk terlebih dahulu sebelum Anda dapat mengetahui bahwa produk tersebut sudah habis, tidak seperti toko online lain yang menghapus produk yang sudah habis.', 'bukan,aplikasi,ramah,guna,anda,rasa,sulit,guna,kode,voucher,bahkan,harus,cari,google,tentang,cara,guna,voucher,kirim,gratis,akhir,tidak,dapat,guna,berla,beberapa,item,selain,anda,perlu,klik,produk,lebih,dahulu,belum,anda,dapat,mengetahui,produk,sebut,sudah,habis,tidak,seperti,toko,online,lain,hapus,produk,sudah,habis', -1, '2022-05-24 16:56:27', 0),
(1863, 'Dikatakan pengiriman gratis, tetapi ada biaya pengiriman. smh', 'katak,kirim,gratis,ada,biaya,kirim,smh', -1, '2022-05-24 16:56:27', 0),
(1864, 'Saya berterima kasih kepada aplikasi ini karena saya telah mengumpulkan banyak alat dan lain-lain.', 'terima,kasih,aplikasi,telah,kumpul,banyak,alat,lainlain', -1, '2022-05-24 16:56:27', 0),
(1865, 'UI terlalu berantakan messy', 'u,berantak,messy', -1, '2022-05-24 16:56:27', 0),
(1866, 'Saya memiliki pengalaman ketika setelah memilih sesuatu dan setelah mengklik beli, jumlahnya berbeda dari yang ditampilkan sebelumnya. Kemudian mereka tidak mengizinkan Anda untuk membatalkan dan uang telah dipotong dari akun Anda. Itu sebabnya sejak kejadian itu dan seterusnya, saya hanya membeli dari aplikasi belanja lain', 'milik,alam,ketika,sete,pilih,suatu,sete,klik,beli,jumlah,beda,tampil,belum,kemudian,tidak,izin,anda,batal,uang,telah,potong,akun,anda,sebab,sejak,jadi,terus,beli,aplikasi,belanja,lain', -1, '2022-05-24 16:56:27', 0),
(1867, 'Hanya barbel yang saya pesan yang sepadan dengan uang saya. Masalah yang sama dengan Shopee ketika saya memesan produk di luar negeri. Review produk bagus dan rating seller juga tinggi tapi selalu mendapatkan hasil yang sama. Kualitasnya kurang dari apa yang diposting atau sangat buruk seperti dua patung dari satu set yang saya pesan. Pemeriksaan kualitas sebelum mengirimkan produk dapat membantu agar Pelanggan tidak merasa bahwa mereka membuang waktu menunggu dan uang mereka untuk membeli produk dari aplikasi Anda. Saya hanya tidak mempercayai pasar Anda sekarang', 'barbel,pesan,padan,uang,masalah,sama,shopee,ketika,mesan,produk,neger,review,produk,bagus,rating,seller,tinggi,dapat,hasil,sama,kualitas,kurang,diposting,buruk,seperti,dua,patung,satu,set,pesan,periksa,kualitas,belum,kirim,produk,dapat,bantu,langgan,tidak,rasa,buang,waktu,tunggu,uang,beli,produk,aplikasi,anda,tidak,percaya,pasar,anda', -1, '2022-05-24 16:56:28', 0),
(1868, 'Saya menginstal lazada hanya untuk menggunakan voucher yang saya terima. Saya lebih suka menggunakan shopee karena ada voucher gratis ongkos kirim untuk pembelian barang dalam jumlah tertentu. Tidak seperti lazada, biaya pengiriman bisa lebih mahal daripada barang itu sendiri, yang gila. Selain itu, antarmuka Anda bisa sangat membingungkan. Saya hanya benar-benar tidak tahu item mana yang sudah dikemas atau dikirim karena ini terlihat pada bagian pengiriman dan penerimaan.', 'menginstal,lazada,guna,voucher,terima,lebih,suka,guna,shopee,ada,voucher,gratis,ongkos,kirim,beli,barang,jumlah,tentu,tidak,seperti,lazada,biaya,kirim,lebih,mahal,daripada,barang,sendiri,gila,selain,antarmuka,anda,bingung,benarbenar,tidak,tahu,item,mana,sudah,kemas,kirim,lihat,kirim,terima', -1, '2022-05-24 16:56:29', 0),
(1869, 'Dompet pembayaran tidak mengkonfirmasi kisah penarikan 7-10 hari. Lazada penipu..', 'dompet,bayar,tidak,konfirmasi,kisah,tarik,hari,lazada,tipu', -1, '2022-05-24 16:56:29', 0),
(1870, 'Tidak ada pilihan bahasa Inggris', 'tidak,ada,pilih,bahasa,inggris', 1, '2022-05-24 16:56:29', 0),
(1871, 'Aplikasi baik-baik saja. Terkadang tertinggal. Dan layanan kurir oleh lazada sangat sangat lambat sekarang. Terkadang aplikasi tidak diperbarui.', 'aplikasi,baikbaik,saja,kadang,tinggal,layan,kurir,lazada,lambat,kadang,aplikasi,tidak,baru', -1, '2022-05-24 16:56:29', 0),
(1872, 'Proses checkout repot - pilihan pembayaran dbs paylah dan dompet Lazada. Tidak ada opsi cc. Hanya ketika di bagian paling akhir untuk mengirimkan konfirmasi pembayaran, opsi cc muncul. Juga proses pencarian yang merepotkan. Terlalu banyak pemberitahuan dan poin penghargaan voucher. Secara umum terlalu banyak kebisingan. Membuat navigasi melalui halaman mengganggu. Pencarian juga tergantung pada halaman toko vs lazada. Saya harus kembali ke lazada untuk mencari seluruh situs. Juga ada font putih pada header putih sehingga tidak dapat melihat salinan.', 'proses,checkout,repot,pilih,bayar,dbs,pay,dompet,lazada,tidak,ada,opsi,cc,ketika,paling,akhir,kirim,konfirmasi,bayar,opsi,cc,muncul,proses,cari,repot,banyak,beritahu,poin,harga,voucher,cara,umum,banyak,bising,buat,navigasi,halaman,ganggu,cari,gantung,halaman,toko,vs,lazada,harus,kembali,lazada,cari,seluruh,situs,ada,font,putih,header,putih,sehingga,tidak,dapat,lihat,salin', 1, '2022-05-24 16:56:30', 0),
(1873, 'Hai Lazada, Aplikasi yang menarik dan layanan yang baik Saya sering menggunakan ini sekarang. Tapi bisakah Anda berhenti menggunakan ABX sebagai Pengiriman standar. ABX adalah Layanan yang tidak berguna. Item terakhir saya dikirim dan keluar untuk pengiriman tetapi ABX bahkan tidak menelepon saya, sampai tanggal kedaluwarsa terakhir dan saya tidak dapat membatalkan pesanan karena pembaruan pengiriman. Sampai sekarang setiap saya mendapatkan ABX Delivery barang saya selalu hilang. Saya sangat kecewa dengan layanan ini tolong perbaiki ini.', 'hai,lazada,aplikasi,tarik,layan,baik,sering,guna,anda,henti,guna,abx,bagai,kirim,standar,abx,layan,tidak,guna,item,akhir,kirim,keluar,kirim,abx,bahkan,tidak,telepon,sampai,tanggal,kedaluwarsa,akhir,tidak,dapat,batal,pesan,baru,kirim,sampai,tiap,dapat,abx,delivery,barang,hilang,kecewa,layan,tolong,baik', -1, '2022-05-24 16:56:30', 0),
(1874, 'Terlalu banyak promosi dll dan bug yang mengganggu. Saya suka aplikasi ini sampai mulai memberi saya pemberitahuan acak. Itu terus menunjukkan bahwa saya memiliki pesan yang belum dibuka tetapi meskipun setelah menghapus semuanya dengan menandainya sebagai sudah dibaca, itu masih muncul. Saya akan pergi berbelanja di browser saya.', 'banyak,promosi,dll,bug,ganggu,suka,aplikasi,sampai,mulai,beri,beritahu,acak,terus,tunjuk,milik,pesan,belum,buka,meski,sete,hapus,semua,tanda,bagai,sudah,baca,masih,muncul,pergi,belanja,browser', -1, '2022-05-24 16:56:31', 0),
(1875, 'Di atas 50rb rupiah tidak ada ongkos kirim tapi tetap dikenakan biaya', 'rb,rupiah,tidak,ada,ongkos,kirim,kena,biaya', 1, '2022-05-24 16:56:31', 0),
(1876, 'Keranjang saya menunjukkan 11, tetapi sebenarnya hanya menampilkan 1, bagaimana mungkin? Jadikan folder fav yang terbaru di atas, bcs saya terus mencari item yang baru saja saya ketuk untuk fav. Jadi saya tahu ketika saya mengetuk item dan saya hanya menemukan tanggal .. dan antarmuka untuk pembayaran online, ketika selesai membayar, jika saya mengetuk kembali, tolong jangan kembali ke antarmuka sebelum membayar, cukup tunjukkan apa saja yang sudah selesai dan terus maju, bcs sekarang setelah selesai membayar, saya harus memaksa menutup dan membuka kembali untuk melihat item lainnya..', 'keranjang,tunjuk,benar,tampil,bagaimana,jadi,folder,fav,baru,bcs,terus,cari,item,baru,saja,ketuk,fav,jadi,tahu,ketika,ketuk,item,temu,tanggal,antarmuka,bayar,online,ketika,selesai,bayar,ketuk,kembali,tolong,kembali,antarmuka,belum,bayar,cukup,tunjuk,saja,sudah,selesai,terus,maju,bcs,sete,selesai,bayar,harus,aksa,tutup,buka,kembali,lihat,item,lain', -1, '2022-05-24 16:56:31', 0),
(1877, 'Begitu banyak iklan yang begitu sering. Orang-orang ini sangat bodoh tidak dapat memahami pembeli dan saya tahu mereka tidak akan berkembang, jadi saya mencopot pemasangan Aplikasi mereka.', 'banyak,iklan,sering,orangorang,bodoh,tidak,dapat,paham,beli,tahu,tidak,kembang,jadi,copot,pasang,aplikasi', -1, '2022-05-24 16:56:32', 0),
(1878, 'Pengalaman mengerikan saat menggunakan voucher yang diterapkan yang tidak dapat dengan mudah diterapkan karena masalah teknisnya..kemudian layanan pelanggan membutuhkan waktu yang sangat lama untuk merespon..bantuan itu tidak berguna dalam menyelesaikan masalah voucher diskon tersebut...sangat tidak ramah pengguna saat menangani masalah kompleks ini..akan lebih mudah jika mereka mengizinkan penulisan email daripada bantuan bot sebelum melanjutkan ke bantuan CS manusia..butuh waktu lama untuk menjelaskan masalah dengan lampiran, dll.', 'alam,ngeri,guna,voucher,terap,tidak,dapat,mudah,terap,masalah,teknisnyakemudian,layan,langgan,butuh,waktu,lama,meresponbantuan,tidak,guna,selesai,masalah,voucher,diskon,tersebutsangat,tidak,ramah,guna,tangan,masalah,kompleks,iniakan,lebih,mudah,izin,tulis,email,daripada,bantu,bot,belum,lanjut,bantu,cs,manusiabutuh,waktu,lama,jelas,masalah,lampir,dll', 1, '2022-05-24 16:56:32', 0),
