(1906, 'Saat menggunakan aplikasi ini, halaman selalu dimuat. Terkadang proses pemuatan gagal, tetapi sebagian besar waktu pemuatan halaman tidak ada habisnya. Saya tidak dapat melihat isi pesan, tidak dapat melihat ulasan, dan tidak dapat membuka penawaran saat notifikasi datang. Ini bukan masalah jaringan atau WiFi. Saya dapat membuka YouTube 1080p tanpa cegukan. Tetapi setiap kali saya membuka aplikasi Lazada, halaman itu butuh waktu lama untuk dimuat. Tolong perbaiki ini. Pembaruan 29 Juni 2021: Apa ini lazada? Ini tahun 2021 tetapi aplikasi Anda semakin buruk. Sering crash dan self close!', 'guna,aplikasi,halaman,muat,kadang,proses,muat,gagal,besar,waktu,muat,halaman,tidak,ada,habis,tidak,dapat,lihat,isi,pesan,tidak,dapat,lihat,ulas,tidak,dapat,buka,awar,notifikasi,datang,bukan,masalah,jaring,wifi,dapat,buka,youtube,p,tanpa,ceguk,tiap,kali,buka,aplikasi,lazada,halaman,butuh,waktu,lama,muat,tolong,baik,baru,juni,lazada,tahun,aplikasi,anda,makin,buruk,sering,crash,self,close', -1, '2022-05-24 16:56:41', 0),
(1907, 'Kelebihan: Sebagian besar penjual mengirimkan dengan cepat (pengalaman saya) Kekurangan: Aplikasi ini sangat bermasalah. Jika Anda memasukkannya dari halaman eksternal, halaman itu akan berulang kali ditampilkan meskipun Anda mencoba untuk keluar. Ini juga sangat lambat sehingga saya terkadang mengubah menit saya tentang pembelian karena butuh waktu lama untuk melanjutkan. Melihatnya juga sangat mengganggu, terkadang saya hanya ingin memeriksa berapa biaya barang digital saya, itu akan mengatur dirinya sendiri di \"pesanan saya\" untuk dibayar. Terakhir, itu muncul di semua jenis iklan (termasuk adware).', 'lebih,besar,jual,kirim,cepat,alam,kurang,aplikasi,masa,anda,masuk,halaman,eksternal,halaman,ulang,kali,tampil,meski,anda,coba,keluar,lambat,sehingga,kadang,ubah,menit,tentang,beli,butuh,waktu,lama,lanjut,lihat,ganggu,kadang,ingin,periksa,berapa,biaya,barang,digital,atur,diri,sendiri,pesan,bayar,akhir,muncul,semua,jenis,iklan,masuk,adware', -1, '2022-05-24 16:56:42', 0),
(1908, 'Iklan aplikasi Lazada. pop-up sangat mengganggu (saat browsing chrome, bermain game). Itu membuat saya memulai aplikasi ketika saya tidak mau. Bahkan jika saya tidak menekan pop-up, sepertinya saya melakukannya dan boommm aplikasi mulai terbuka (tidak pernah terjadi pada aplikasi lain). Saya memberikan aplikasi 5 bintang sebelumnya tetapi sekarang Lazada tidak sepadan. Sunting. BAIK. Sebulan kemudian... tidak ada yang membaik. Memutuskan untuk mencopot pemasangan aplikasi, saya tidak akan menjadi penipu figur pengguna aktif untuk investor mana pun. FYI, Anda baru saja kehilangan pelanggan di sini. Semoga harimu menyenangkan.', 'iklan,aplikasi,lazada,popup,ganggu,browsing,chrome,main,game,buat,mulai,aplikasi,ketika,tidak,bahkan,tidak,nek,popup,seperti,laku,boommm,aplikasi,mulai,buka,tidak,jadi,aplikasi,lain,berik,aplikasi,bintang,belum,lazada,tidak,padan,sunting,baik,bulan,kemudian,tidak,ada,baik,utus,copot,pasang,aplikasi,tidak,jadi,tipu,figur,guna,aktif,investor,mana,fyi,anda,baru,saja,hilang,langgan,sini,moga,hari,senang', -1, '2022-05-24 16:56:43', 0),
