(1912, 'Verifikasi OTP untuk metode pembayaran kartu sering hilang, pembayaran otomatis disetujui tanpa bertanya apa-apa. Silakan periksa kembali keamanan aplikasi Anda (Bahasa Indonesia). Juga mengklik check out sering membawa Anda ke halaman produk sebelumnya atau bahkan menutup aplikasi. Hasil pencarian berdasarkan kata kunci seringkali tidak akurat. Banyak bug, Anda harus membayar saya untuk menunjukkannya satu per satu.', 'verifikasi,otp,metode,bayar,kartu,sering,hilang,bayar,otomatis,disetujui,tanpa,berta,apaapa,sila,periksa,kembali,aman,aplikasi,anda,bahasa,indonesia,klik,check,out,sering,bawa,anda,halaman,produk,belum,bahkan,tutup,aplikasi,hasil,cari,dasar,kata,kunci,seringkali,tidak,akurat,banyak,bug,anda,harus,bayar,tunjuk,satu,per,satu', -1, '2022-05-24 16:56:45', 0),
(1913, 'Saya telah menggunakan aplikasi ini selama bertahun-tahun sekarang, tetapi untuk pertama kalinya, saya menemukan kesalahan demi kesalahan \"oops ada yang tidak beres\". Saya tidak bisa memesan karena bug. Perbaiki masalah ini dan saya akan mengubah ulasan saya.', 'telah,guna,aplikasi,selama,bertahuntahun,pertama,kali,temu,salah,demi,salah,oops,ada,tidak,beres,tidak,mesan,bug,baik,masalah,ubah,ulas', -1, '2022-05-24 16:56:46', 0),
(1914, 'Tidak bagus sama sekali. Penjual terlalu lama mengirim barang kami, tidak ada koordinasi antara lazada dan penjual untuk menyelesaikan masalah. CS terlalu lama mengambil tindakan. Saya memesan beberapa barang pada tanggal 1 Juli, diperkirakan akan tiba pada tanggal 9 Juli tetapi sampai sekarang kami masih belum menerimanya!', 'tidak,bagus,sama,sekali,jual,lama,kirim,barang,tidak,ada,koordinasi,antara,lazada,jual,selesai,masalah,cs,lama,ambil,tindak,mesan,beberapa,barang,tanggal,juli,kira,tiba,tanggal,juli,sampai,masih,belum,terima', 1, '2022-05-24 16:56:46', 0),
(1915, 'Iklan tersebut terus menampilkan pakaian dalam wanita. Di mana pengaturan untuk mematikannya? Saya belum menemukannya. Miris melihat iklan seperti itu. Saya sudah tekan \"tidak tertarik\". Tapi selalu muncul setiap saat. Sangat sangat tidak nyaman. Makanya saya kasih 1 bintang. Paling buruk.', 'iklan,sebut,terus,tampil,pakai,wanita,mana,atur,mati,belum,temu,miris,lihat,iklan,seperti,sudah,tekan,tidak,tarik,muncul,tiap,tidak,nyaman,makanya,kasih,bintang,paling,buruk', 1, '2022-05-24 16:56:46', 0),
(1916, 'Aplikasinya bagus tapi sayangnya LEX dan layanan pelanggannya mengerikan! Barang macet di depo dan setelah beberapa hari melewati tanggal pengiriman yang dijanjikan dan beberapa panggilan frustasi ke layanan pelanggan, akhirnya memberi tahu saya hari ini bahwa barang itu ditandai hilang di depot beberapa hari yang lalu. Tidak ada penyesalan, tidak ada kompensasi dan mengharapkan saya untuk mengikuti aturan perusahaan untuk pengembalian uang dan pembatalan yang mungkin memakan waktu 5 sampai 15 hari. Secara keseluruhan, itu terdengar seperti penipuan untuk menggulung uang saya selama mungkin demi perusahaan.', 'aplikasi,bagus,sayang,lex,layan,langgan,ngeri,barang,macet,depo,sete,beberapa,hari,lewat,tanggal,kirim,janji,beberapa,panggil,frustasi,layan,langgan,akhir,beri,tahu,hari,barang,tanda,hilang,depot,beberapa,hari,tidak,ada,sesal,tidak,ada,kompensasi,harap,ikut,atur,usaha,kembali,uang,batal,makan,waktu,sampai,hari,cara,seluruh,dengar,seperti,tipu,gulung,uang,selama,demi,usaha', -1, '2022-05-24 16:56:47', 0),
(1917, 'Aplikasi laggy yang buruk dan bodoh. Sangat sulit untuk mengirimkan ulasan dengan video dan foto. Tidak dapat mengirim video dan foto ke penjual langsung di ruang obrolan mereka ketika mengalami masalah. Harus mengirimkan ulang ulasan untuk melakukannya. Bahkan dengan itu, aplikasi sangat lambat!!!!! Dan kemudian ulasannya tidak lolos.. bodoh.. pengguna lazada pertama kali dan itu benar-benar buruk.', 'aplikasi,laggy,buruk,bodoh,sulit,kirim,ulas,video,foto,tidak,dapat,kirim,video,foto,jual,langsung,ruang,obrol,ketika,alami,masalah,harus,kirim,ulang,ulas,laku,bahkan,aplikasi,lambat,kemudian,ulas,tidak,lolos,bodoh,guna,lazada,pertama,kali,benarbenar,buruk', -1, '2022-05-24 16:56:47', 0),
(1918, 'Benci aplikasi ini. Tidak dapat memilih teks untuk diterjemahkan. Tidak dapat memperbesar gambar untuk melihat detail. Anda DIBUTUH untuk mengunduhnya karena setiap tautan sial membuat play store terbuka. Saya lebih suka menjelajah menggunakan browser tetapi mereka membuatnya tidak mungkin. Juga pencarian adalah sampah itu menunjukkan hasil untuk setiap kata dalam permintaan pencarian Anda. Misalnya \'bola pintar\' akan memberikan banyak hasil untuk bohlam dasar (bukan pintar). Mereka perlu mencari frasa, bukan setiap kata.', 'benci,aplikasi,tidak,dapat,pilih,teks,terjemah,tidak,dapat,besar,gambar,lihat,detail,anda,butuh,unduh,tiap,taut,sial,buat,play,store,buka,lebih,suka,jelajah,guna,browser,buat,tidak,cari,sampah,tunjuk,hasil,tiap,kata,minta,cari,anda,misal,bola,pintar,berik,banyak,hasil,bohlam,dasar,bukan,pintar,perlu,cari,frasa,bukan,tiap,kata', -1, '2022-05-24 16:56:48', 0),
(1919, 'Aplikasi perlu banyak perbaikan, di man lang terlihat kung saan lokasi penjual nung, di rin bertanggung jawab, penjual nyo di customer service, aplikasi jadi tidak berguna dan omong kosong, pengguna Shoppee ako untuk waktu yang lama, pero di ko naexperince yung pagiging kamote, sa aplikasi lang na to. Saya memutuskan aplikasi na subukan tong dengan 10 pesanan berbeda, dan yang bisa saya katakan adalah.. lebih baik... yang terburuk.', 'aplikasi,perlu,banyak,baik,man,lang,lihat,kung,sa,lokasi,jual,nung,rin,tanggung,jawab,jual,nyo,customer,service,aplikasi,jadi,tidak,guna,omong,kosong,guna,shoppee,ako,waktu,lama,o,ko,naexperince,yung,pagiging,kamote,sa,aplikasi,lang,na,to,utus,aplikasi,na,subukan,tong,pesan,beda,katak,lebih,baik,buruk', -1, '2022-05-24 16:56:48', 0),
(1920, 'Layanan paling buruk yang pernah dialami dalam hidup saya 5/7/2021, banyak yang memiliki masalah yang sama sampai sekarang 14/7/2021,10 hari telah berakhir, tidak ada pembaruan tentang pengiriman, tidak ada pembaruan catatan pelacakan pesanan, tidak ada perbaikan bahkan balasan layanan pelanggan, kesulitan tinggi level untuk pembatalan dan pengembalian dana, tidak ada tombol batal setelah pembelian, jalur layanan pelanggan hanya memberi kata untuk menunggu, perlu menunggu, menunggu dan menunggu selamanya. BELANJA ONLINE TERBURUK YANG PERNAH.....!!!!', 'layan,paling,buruk,alami,hidup,banyak,milik,masalah,sama,sampai,hari,telah,akhir,tidak,ada,baru,tentang,kirim,tidak,ada,baru,catat,lacak,pesan,tidak,ada,baik,bahkan,balas,layan,langgan,sulit,tinggi,level,batal,kembali,dana,tidak,ada,tombol,batal,sete,beli,jalur,layan,langgan,beri,kata,tunggu,perlu,tunggu,tunggu,tunggu,selama,belanja,online,buruk', -1, '2022-05-24 16:56:49', 0),
(1921, 'Baru-baru ini mohon jangan membeli dari Lazada , kecuali jika Anda memiliki \"printer\". Jika Anda menerima barang yang salah, atau barang rusak dan Anda tidak memiliki printer, maka gg. Anda dapat memilih untuk menyimpan barang atau pergi ke luar cetak (tetapi risiko tinggi akan terkena covid atau saman) Sarankan Anda semua pergi shopxx, jika barang salah atau rusak, Anda memiliki opsi untuk langsung mendapatkan pengembalian uang tanpa pengembalian', 'barubaru,mohon,beli,lazada,kecuali,anda,milik,printer,anda,terima,barang,salah,barang,rusak,anda,tidak,milik,printer,maka,gg,anda,dapat,pilih,simpan,barang,pergi,cetak,risiko,tinggi,kena,covid,saman,saran,anda,semua,pergi,shopxx,barang,salah,rusak,anda,milik,opsi,langsung,dapat,kembali,uang,tanpa,kembali', 1, '2022-05-24 16:56:50', 0),
(1922, 'mengapa Anda harus menampilkan iklan 3 detik tepat setelah saya membuka aplikasi Anda? saya sudah di toko Anda! iklan itu lebih cenderung membuat saya menutup lazada. edit: mencoba lazada lagi setelah beberapa bulan, sekarang saya ingat mengapa saya tidak menggunakannya. Sama seperti sebelumnya, hal pertama yang Anda lihat di aplikasi adalah iklan 3 detik dari aplikasi yang sudah Anda buka', 'anda,harus,tampil,iklan,detik,tepat,sete,buka,aplikasi,anda,sudah,toko,anda,iklan,lebih,cenderung,buat,tutup,lazada,edit,coba,lazada,sete,beberapa,bulan,ingat,tidak,guna,sama,seperti,belum,hal,pertama,anda,lihat,aplikasi,iklan,detik,aplikasi,sudah,anda,buka', -1, '2022-05-24 16:56:50', 0),
(1923, 'Lebih buruk dengan setiap pembaruan. Fungsi pencarian yang buruk. Terus menunjukkan kepada saya item yang tidak terkait dengan pencarian saya atau produk yang sama 1000x Sunting: kemampuan mengurutkan (misalnya berdasarkan harga) juga tidak berfungsi. edit: mengurangi peringkat lebih jauh setelah integrasi redmart. Sunting: sistem peninjauan tidak ada gunanya untuk sebagian besar produk karena vendor hanya membuat item baru. Sunting: aplikasi membeku sekali sesi dan perlu diatur ulang. Sunting: begitu banyak barang palsu. Layanan pelanggan yang mengerikan. Pencarian redmart sekarang menunjukkan hasil Lazada yang tidak berguna.', 'lebih,buruk,tiap,baru,fungsi,cari,buruk,terus,tunjuk,item,tidak,kait,cari,produk,sama,x,sunting,mampu,urut,misal,dasar,harga,tidak,fungsi,edit,urang,peringkat,lebih,jauh,sete,integrasi,redmart,sunting,sistem,tinjau,tidak,ada,guna,besar,produk,vendor,buat,item,baru,sunting,aplikasi,membe,sekali,sesi,perlu,atur,ulang,sunting,banyak,barang,palsu,layan,langgan,ngeri,cari,redmart,tunjuk,hasil,lazada,tidak,guna', -1, '2022-05-24 16:56:50', 0),
(1924, 'Saya tidak tahu apa yang salah dengan aplikasi Anda. Saya memperbaruinya tetapi tidak berhasil memuat terlalu lama saya mencoba aplikasi lain seperti milik Anda dan saya tidak punya masalah dengan aplikasi mereka. Dan juga saya harap Anda setidaknya dapat memindai produk terutama yang tampak seperti obral yang benar-benar menjijikkan seperti bagian pribadi Sulit juga menggunakan bantuan dari Anda. Anda terus mengirim balasan otomatis saja', 'tidak,tahu,salah,aplikasi,anda,baru,tidak,hasil,muat,lama,coba,aplikasi,lain,seperti,milik,anda,tidak,punya,masalah,aplikasi,harap,anda,tidak,dapat,pindai,produk,utama,tampak,seperti,obral,benarbenar,jijik,seperti,pribadi,sulit,guna,bantu,anda,anda,terus,kirim,balas,otomatis,saja', -1, '2022-05-24 16:56:51', 0),
(1925, 'Sama seperti ulasan lainnya, saya juga mengalami terlalu banyak iklan lazada yang mengganggu halaman atau aplikasi lain yang saya gunakan. Dan bagian yang menjengkelkan adalah ketika Anda mengklik untuk menutupnya, itu membuka aplikasi lazada sebagai gantinya. Saya memutuskan sekarang untuk mencopot pemasangan aplikasi.', 'sama,seperti,ulas,lain,alami,banyak,iklan,lazada,ganggu,halaman,aplikasi,lain,guna,jengkel,ketika,anda,klik,tutup,buka,aplikasi,lazada,bagai,ganti,utus,copot,pasang,aplikasi', -1, '2022-05-24 16:56:51', 0),
(1926, 'aplikasi terburuk. Jika ada bintang nol, saya akan menilai itu bintang nol. Terlalu banyak game yang tidak berguna bermunculan. Dan barang-barang kebanyakan mahal. TIDAK ADA PENGIRIMAN GRATIS. Tidak seperti shopee, ketika Anda mengklik item, mereka akan menampilkan item serupa, Lazada sangat sulit dinavigasi. Dan tanggapan otomatis menyebalkan. Secara keseluruhan, aplikasi terburuk.', 'aplikasi,buruk,ada,bintang,nol,nilai,bintang,nol,banyak,game,tidak,guna,muncul,barangbarang,banyak,mahal,tidak,ada,kirim,gratis,tidak,seperti,shopee,ketika,anda,klik,item,tampil,item,rupa,lazada,sulit,navigasi,tanggap,otomatis,sebal,cara,seluruh,aplikasi,buruk', -1, '2022-05-24 16:56:52', 0),
(1927, 'Setelah bertahun-tahun, Anda masih tidak dapat memperbaiki fitur pencarian Anda. Fitur pencarian Anda adalah salah satu yang konyol yang pernah saya lihat. Fungsi pencarian tidak akurat sama sekali. PERBAIKI ITU. Saya tidak menggunakan aplikasi Anda sebelumnya bertahun-tahun sebelumnya karena fungsi pencarian bodoh Anda. Anda perlu memperbaiki untuk fungsi pencarian yang lebih baik.', 'sete,bertahuntahun,anda,masih,tidak,dapat,baik,fitur,cari,anda,fitur,cari,anda,salah,satu,konyol,lihat,fungsi,cari,tidak,akurat,sama,sekali,baik,tidak,guna,aplikasi,anda,belum,bertahuntahun,belum,fungsi,cari,bodoh,anda,anda,perlu,baik,fungsi,cari,lebih,baik', -1, '2022-05-24 16:56:52', 0),
(1928, 'Aplikasi sangat lambat, gambar secara teratur tidak tersedia, tidak memuat gambar produk. Itu menyatakan bahwa saya memiliki 47 item dalam daftar keinginan tetapi ketika saya ingin melihatnya, hanya tiga item yang ditampilkan. Silakan tingkatkan aplikasi Anda..', 'aplikasi,lambat,gambar,cara,atur,tidak,sedia,tidak,muat,gambar,produk,nyata,milik,item,daftar,ingin,ketika,ingin,lihat,tiga,item,tampil,sila,tingkat,aplikasi,anda', -1, '2022-05-24 16:56:52', 0),
(1929, 'LAYANAN PELANGGAN TERLAMBAT Harus menunggu setidaknya 30 menit untuk saluran Obrolan pelanggan Internet mereka serta saluran Pelanggan Telp mereka ketika Anda ingin menghubungi mereka. Ini hanya berarti mereka hanya memprioritaskan keuntungan maksimal dan bukan pengalaman pelanggan. Bayangkan saja saya memiliki pemborosan seperti 1 jam jika saya ingin berkomunikasi dengan mereka untuk menyelesaikan masalah apa pun. Saya menghindari LAZADA karena layanan pelanggan mereka yang buruk. Saya mencoba yang lain.', 'layan,langgan,lambat,harus,tunggu,tidak,menit,salur,obrol,langgan,internet,salur,langgan,p,ketika,anda,ingin,hubung,arti,prioritas,untung,maksimal,bukan,alam,langgan,bayang,saja,milik,boros,seperti,jam,ingin,komunikasi,selesai,masalah,hindar,lazada,layan,langgan,buruk,coba,lain', -1, '2022-05-24 16:56:53', 0),
(1930, 'Waktu pengiriman tidak bisa dipercaya, dengan kata lain, buang waktu untuk berbelanja, menunggu kurir keluar untuk pengiriman sampai hari ini sudah 20 hari masih di toko, karena dari waktu beli sudah hampir dua bulan, meminta layanan pelanggan hanya robot yang berbicara, menggunakan live chat sibuk . Ketika Anda membatalkan barang akan dikembalikan tetapi apa keuntungan Anda? Keuntungannya adalah membuang waktu dua bulan untuk menunggu 0 item dan membeli kembali dan menunggu, layanan lazada yang bagus', 'waktu,kirim,tidak,percaya,kata,lain,buang,waktu,belanja,tunggu,kurir,keluar,kirim,sampai,hari,sudah,hari,masih,toko,waktu,beli,sudah,hampir,dua,bulan,minta,layan,langgan,robot,bicara,guna,live,chat,sibuk,ketika,anda,batal,barang,kembali,untung,anda,untung,buang,waktu,dua,bulan,tunggu,item,beli,kembali,tunggu,layan,lazada,bagus', -1, '2022-05-24 16:56:54', 0),
(1931, 'Dikatakan pesanan gagal setiap kali saya ingin melakukan pembayaran, apa pun metode pembayaran yang saya gunakan. Saya mencoba menghubungi layanan pelanggan agen langsung alih-alih robot. Tidak ada respon dan sangat tidak berguna. Btw saya mencoba semua pemecahan masalah yang disarankan namun masalahnya masih ada. Copot pemasangan segera', 'katak,pesan,gagal,tiap,kali,ingin,laku,bayar,metode,bayar,guna,coba,hubung,layan,langgan,agen,langsung,alihalih,robot,tidak,ada,respon,tidak,guna,btw,coba,semua,pecah,masalah,saran,masalah,masih,ada,copot,pasang,segera', -1, '2022-05-24 16:56:54', 0),
(1932, 'Kurir yang sangat buruk ditunjuk oleh Lazada. Tunda dan kirim paket pada hari Sabtu (alamat kantor). Layanan pelanggan juga tidak membantu, hanya menggunakan komputer menjawab pertanyaan (tidak dapat memecahkan masalah). Produk saya beli karena daerah tulis cheras. Area yang sama dengan saya? seharusnya cepat, tetapi lebih dari perkiraan waktu yang diberikan Lazada juga tidak mencapai.', 'kurir,buruk,tunjuk,lazada,tunda,kirim,paket,hari,sabtu,alamat,kantor,layan,langgan,tidak,bantu,guna,komputer,jawab,tanya,tidak,dapat,pecah,masalah,produk,beli,daerah,tulis,cheras,area,sama,harus,cepat,lebih,kira,waktu,berik,lazada,tidak,capai', -1, '2022-05-24 16:56:55', 0),
(1933, 'Mencari beberapa item tidak akurat, aplikasi sedikit bermasalah dan Lazada \"Shake It\" (untuk promo PH) tidak adil karena saya menemukannya tiga kali sejak Penjualan Lazada 6.6 yang mendorong \"Terlalu banyak lalu lintas\" kehilangan 3 peluang saya untuk mendapatkan gratis saya voucher sia-sia dan juga butuh waktu terlalu lama untuk muncul juga. Saya pembeli dari aplikasi ini juga, perbaiki. ? Sunting: Perbaiki juga sistem ulasan item karena menyegarkan dengan sendirinya saat saya menulis ulasan item saya, menjengkelkan untuk memulai dari awal lagi, perbaiki. ?', 'cari,beberapa,item,tidak,akurat,aplikasi,sedikit,masa,lazada,shake,it,promo,ph,tidak,adil,temu,tiga,kali,sejak,jual,lazada,dorong,banyak,lintas,hilang,luang,dapat,gratis,voucher,siasia,butuh,waktu,lama,muncul,beli,aplikasi,baik,sunting,baik,sistem,ulas,item,segar,sendiri,tulis,ulas,item,jengkel,mulai,awal,baik', -1, '2022-05-24 16:56:55', 0),
(1934, 'Saya tidak bisa menggunakan voucher, setiap kali saya check out selalu ada kesalahan. Saya pikir aplikasi ini akan memberikan diskon 100 untuk timer pertama tetapi dalam kasus saya, saya tidak menerima voucher. Saya harap tim akan bekerja dalam masalah ini di aplikasi.', 'tidak,guna,voucher,tiap,kali,check,out,ada,salah,pikir,aplikasi,berik,diskon,timer,pertama,kasus,tidak,terima,voucher,harap,tim,kerja,masalah,aplikasi', -1, '2022-05-24 16:56:55', 0),
(1935, 'Aplikasi itu sendiri sangat bagus tetapi saya berharap ada opsi untuk memilih opsi pengiriman. Lex express tidak diragukan lagi adalah layanan pengiriman terburuk yang pernah saya gunakan. Dua pembelian saya melewati fasilitas logistik yang sama pada dua hari yang berbeda tetapi hanya barang yang datang kemudian yang diproses dan sampai ke saya. Pembelian pertama masih tertahan di fasilitas logistik. Ada masalah dengan obrolan dengan layanan pelanggan juga, berbicara dengan robot benar-benar tidak membantu. Saya perlu berbicara dengan orang yang nyata', 'aplikasi,sendiri,bagus,harap,ada,opsi,pilih,opsi,kirim,lex,express,tidak,raguk,layan,kirim,buruk,guna,dua,beli,lewat,fasilitas,logistik,sama,dua,hari,beda,barang,datang,kemudian,proses,sampai,beli,pertama,masih,tahan,fasilitas,logistik,ada,masalah,obrol,layan,langgan,bicara,robot,benarbenar,tidak,bantu,perlu,bicara,orang,nyata', -1, '2022-05-24 16:56:56', 0),
(1936, 'Dipesan dari lazada dan barang dikirim seminggu setelah awalnya dikatakan terkirim. Barangnya rusak dan saat mencoba mengembalikannya di luar pengembalian. Meskipun barang dikirim seminggu kemudian dan dikatakan dikirim sebelum itu yang tidak pernah terjadi ketika saya mencoba membuat lazada menangani ini, tidak ada yang membantu saya, saya mencoba mengirim email kepada mereka, tidak ada yang membantu saya, mereka mengirimi saya email acak dan tidak \'bahkan tidak mengakui masalah saya jadi saya akan memberikan nol ini jika memungkinkan', 'pesan,lazada,barang,kirim,minggu,sete,awal,katak,kirim,barang,rusak,coba,kembali,kembali,meski,barang,kirim,minggu,kemudian,katak,kirim,belum,tidak,jadi,ketika,coba,buat,lazada,tangan,tidak,ada,bantu,coba,kirim,email,tidak,ada,bantu,kirim,email,acak,tidak,bahkan,tidak,masalah,jadi,berik,nol', -1, '2022-05-24 16:56:57', 0);
INSERT INTO `skripsi_rekap` (`no`, `komentar`, `stem`, `sentimen`, `tgl`, `flag`) VALUES
(1937, 'Ini pertama kalinya saya menggunakannya dan saya senang ketika saya menggunakan voucher yang saya klaim karena total pembayaran saya hanya 5 peso tetapi masalahnya adalah area yang dipilih saja. Ketika saya memasukkan alamat, itu adalah area yang dipilih ketika saya mencoba memasukkan alamat saya, itu tidak ada dan saya bahkan tidak bisa melewatinya. Harap Anda dapat menanggapi. Terima kasih', 'pertama,kali,guna,senang,ketika,guna,voucher,klaim,total,bayar,peso,masalah,area,pilih,saja,ketika,masuk,alamat,area,pilih,ketika,coba,masuk,alamat,tidak,ada,bahkan,tidak,lewat,harap,anda,dapat,tanggap,terima,kasih', -1, '2022-05-24 16:56:57', 0),
(1938, 'Layanan purna jual yang buruk, disebut hotline dengan beberapa tanggapan berbeda. Nyatakan bahwa pesanan saya tidak dapat dikembalikan karena tidak semua barang terkirim. Ketika semuanya sudah terkirim, saya tidak dapat mengembalikan barang tersebut lagi, karena sudah melewati kebijakan 7 hari. Apa penipuan.', 'layan,purna,jual,buruk,sebut,hotline,beberapa,tanggap,beda,nyata,pesan,tidak,dapat,kembali,tidak,semua,barang,kirim,ketika,semua,sudah,kirim,tidak,dapat,kembali,barang,sebut,sudah,lewat,bijak,hari,tipu', -1, '2022-05-24 16:56:57', 0),
(1939, 'Benar-benar tidak bisa diandalkan baru-baru ini. 3 pembelian berturut-turut tidak terkirim padahal diinformasikan sudah terkirim. Tidak ada cara untuk membantah atau memberikan umpan balik. Diblokir oleh chatbot yang hanya membuat Anda berkeliaran.', 'benarbenar,tidak,andal,barubaru,beli,berturutturut,tidak,kirim,padahal,informasi,sudah,kirim,tidak,ada,cara,bantah,berik,umpan,balik,blokir,chatbot,buat,anda,keliar', 1, '2022-05-24 16:56:58', 0),
(1940, 'Layanan pelanggan yang sangat buruk! Ketika menyangkut privasi pelanggan, mereka hanya menjelaskan jawaban yang tidak membantu. Bahkan, mintalah pelanggan untuk menyelesaikannya sendiri. Ketika pelanggan ingin mengobrol langsung, mereka tetap menyatakan sibuk yang menyebabkan pelanggan menunggu lama. Tolong perbaiki layanan pelanggan terburuk Anda yang pernah saya tangani.', 'layan,langgan,buruk,ketika,sangkut,privasi,langgan,jelas,jawab,tidak,bantu,bahkan,minta,langgan,selesai,sendiri,ketika,langgan,ingin,obrol,langsung,nyata,sibuk,sebab,langgan,tunggu,lama,tolong,baik,layan,langgan,buruk,anda,tangan', 1, '2022-05-24 16:56:58', 0),
(1941, '1 bintang karena metode pembayarannya payah. Saya harus memasukkan detail berulang kali ketika pembayaran saya tidak berhasil. Juga, ketika saya gagal transaksi, voucher potongan 100 saya hilang! Aku bahkan tidak bisa menggunakannya! Tidak ada yang membatalkan transaksi, hanya saja tidak berhasil. Pengalaman pengguna terburuk yang pernah ada.', 'bintang,metode,bayar,payah,harus,masuk,detail,ulang,kali,ketika,bayar,tidak,hasil,ketika,gagal,transaksi,voucher,potong,hilang,bahkan,tidak,guna,tidak,ada,batal,transaksi,saja,tidak,hasil,alam,guna,buruk,ada', -1, '2022-05-24 16:56:59', 0),
(1942, 'Aplikasi Anda mendapatkan lebih banyak bug, di luar item daftar keinginan adalah 6, tetapi ketika saya mengklik hanya 3,3 item lagi yang hilang, ketik kata kunci untuk menemukan hal-hal yang saya inginkan, tetapi keluar hal-hal lain.. tolong perbaiki!', 'aplikasi,anda,dapat,lebih,banyak,bug,item,daftar,ingin,ketika,klik,item,hilang,ketik,kata,kunci,temu,halhal,ingin,keluar,halhal,lain,tolong,baik', -1, '2022-05-24 16:56:59', 0),
(1943, 'Saya sudah muak dengan aplikasi ini & kebijakan mereka. Alih-alih membantu menyelesaikan masalah, mereka memberi tahu bahwa ada aktivitas yang tidak biasa dengan akun saya dan saya tidak lagi dapat mengumpulkan voucher koin? Mengapa tidak ada pemberitahuan atau upaya untuk memberi tahu saya sampai saya menelepon untuk melapor? Mengapa tidak membantu saya untuk menyelesaikan masalah? Terima kasih atas pembelian sebelumnya, tetapi ini pada akhirnya hanya membuang-buang waktu, tenaga, dan pengalaman yang sama sekali tidak menyenangkan dengan banyak frustrasi. Selamat tinggal.', 'sudah,muak,aplikasi,bijak,alihalih,bantu,selesai,masalah,beri,tahu,ada,aktivitas,tidak,biasa,akun,tidak,dapat,kumpul,voucher,koin,tidak,ada,beritahu,upaya,beri,tahu,sampai,telepon,lapor,tidak,bantu,selesai,masalah,terima,kasih,beli,belum,akhir,membuangbuang,waktu,tenaga,alam,sama,sekali,tidak,senang,banyak,frustrasi,selamat,tinggal', -1, '2022-05-24 16:56:59', 0),
(1944, 'Tidak terinstal. Anda memiliki iklan yang paling mengganggu dan mengganggu. Iklan Anda selalu terlalu lama untuk dilewati, dan begitu saya mengklik untuk melewatinya, aplikasi ini akan dimuat. Aplikasi itu sendiri baik-baik saja tetapi saya harus mencopotnya sekarang karena saya sangat membenci iklan Anda.', 'tidak,terinstal,anda,milik,iklan,paling,ganggu,ganggu,iklan,anda,lama,lewat,klik,lewat,aplikasi,muat,aplikasi,sendiri,baikbaik,saja,harus,copot,benci,iklan,anda', -1, '2022-05-24 16:57:00', 0),
(1945, 'Menerima pengembalian dana di dompet. Tidak dapat menarik karena tidak dapat membuat rekening bank. Selalu dapatkan pesan kesalahan jaringan. Setelah membersihkan cache, masalah masih berlanjut. Sulit mendapatkan agen untuk menyelesaikan masalah. Layar Lazada penuh sesak. Sulit dinavigasi.', 'terima,kembali,dana,dompet,tidak,dapat,tarik,tidak,dapat,buat,rekening,bank,dapat,pesan,salah,jaring,sete,bersih,cache,masalah,masih,lanjut,sulit,dapat,agen,selesai,masalah,layar,lazada,penuh,sesak,sulit,navigasi', 1, '2022-05-24 16:57:01', 0),
(1946, 'saya telah menggulir tanpa henti pada item yang sama. juga, gambar membutuhkan waktu lama untuk dimuat sehingga ketika Anda tidak melihatnya dan tetap putih, Anda harus keluar dari aplikasi lagi.', 'telah,gulir,tanpa,henti,item,sama,gambar,butuh,waktu,lama,muat,sehingga,ketika,anda,tidak,lihat,putih,anda,harus,keluar,aplikasi', -1, '2022-05-24 16:57:01', 0),
(1947, 'Saya dulu sangat menyukai lazada, tetapi kebijakan pengembaliannya buruk, layanan pelanggannya baik tetapi tim lazada hanya malas Saya sudah menunggu lebih dari 2 bulan untuk tim untuk memberi tahu saya bahwa itu ditolak. Penjual tidak dapat mengambil paket dan Anda tidak akan mendapatkan pengembalian uang atau jika label pengembalian rusak atau sobek, mereka tidak dapat memberi Anda yang lain, sebaliknya jika rusak, mereka akan meminta Anda untuk menempelkannya dan jika itu tidak bekerja, mereka tidak membalas Anda lagi.', 'dulu,suka,lazada,bijak,kembali,buruk,layan,langgan,baik,tim,lazada,malas,sudah,tunggu,lebih,bulan,tim,beri,tahu,tolak,jual,tidak,dapat,ambil,paket,anda,tidak,dapat,kembali,uang,label,kembali,rusak,sobek,tidak,dapat,beri,anda,lain,balik,rusak,minta,anda,tempel,tidak,kerja,tidak,balas,anda', 1, '2022-05-24 16:57:01', 0),
(1948, 'Aplikasi memiliki banyak masalah teknis yang belum terselesaikan. Aplikasi menggunakan voucher bank saya (ditampilkan seperti yang digunakan) tetapi tidak berlaku untuk pembelian saya. Pasti masalah teknis. UT memberikan segala macam alasan tetapi tidak ada penyelesaian. Juga, lazada tidak memiliki OTP bahkan untuk jumlah besar.', 'aplikasi,milik,banyak,masalah,teknis,belum,selesai,aplikasi,guna,voucher,bank,tampil,seperti,guna,tidak,berla,beli,pasti,masalah,teknis,ut,berik,segala,macam,alas,tidak,ada,selesai,lazada,tidak,milik,otp,bahkan,jumlah,besar', -1, '2022-05-24 16:57:02', 0),
(1949, 'Selalu terjebak dengan memuat atau menampilkan layar pemuatan halaman kosong. Saya memeriksa koneksi saya untuk membuka semua aplikasi lain tanpa masalah. Selalu terjadi saat menggulir hasil pencarian, selalu tekan kesalahan atau terus memuat. Klik di layar kosong memuat produk lagi Itu juga terus muncul \"Kueri voucher add on item error....\" pesan kesalahan saat menggulir', 'jebak,muat,tampil,layar,muat,halaman,kosong,periksa,koneksi,buka,semua,aplikasi,lain,tanpa,masalah,jadi,gulir,hasil,cari,tekan,salah,terus,muat,klik,layar,kosong,muat,produk,terus,muncul,kueri,voucher,add,on,item,error,pesan,salah,gulir', -1, '2022-05-24 16:57:02', 0),
(1950, 'dulu sangat menyukainya untuk agen cs 24 jam mereka dan kebijakan pengembalian tetapi baru-baru ini, itu hanya satu hal yang mengganggu. tidak menunjukkan kepada kami perusahaan pengiriman mana yang mereka gunakan dan kapan itu terungkap sebagai \'speedpost\', gd luck, ppl. memberi saya grafiti sebagai bukti pengiriman dan jawaban seperti \'mungkin dengan tetangga Anda\'. dan Anda tidak dapat mematikan notifikasi. masih memberitahu saya hampir setiap hari bahwa saya \'lupa\' untuk memeriksa item. ya, betapa linglungnya aku.', 'dulu,suka,agen,cs,jam,bijak,kembali,barubaru,satu,hal,ganggu,tidak,tunjuk,usaha,kirim,mana,guna,kapan,ungkap,bagai,speedpost,gd,luck,ppl,beri,grafit,bagai,bukti,kirim,jawab,seperti,tetangga,anda,anda,tidak,dapat,mati,notifikasi,masih,beritahu,hampir,tiap,hari,lupa,periksa,item,ya,betapa,linglung', -1, '2022-05-24 16:57:03', 0),
(1951, 'Pesanan pertama kali dan dikirim ke unit yang salah, mencoba menghubungi mereka untuk pengembalian atau pengembalian uang membutuhkan waktu yang sangat lama dan lama .. Satu jam penuh terus meminta kami untuk berulang kali mengirim nomor pesanan dan harus terus mengirim gambar yang mereka kirim ke unit yang salah 3 kali sebelum mereka berhenti. Balasan membutuhkan waktu 5 hingga 10 menit setiap kali di agen obrolan langsung. Saya tetap kembali ke shoppe terima kasih', 'pesan,pertama,kali,kirim,unit,salah,coba,hubung,kembali,kembali,uang,butuh,waktu,lama,lama,satu,jam,penuh,terus,minta,ulang,kali,kirim,nomor,pesan,harus,terus,kirim,gambar,kirim,unit,salah,kali,belum,henti,balas,butuh,waktu,hingga,menit,tiap,kali,agen,obrol,langsung,kembali,shoppe,terima,kasih', 1, '2022-05-24 16:57:03', 0),
(1952, 'Sebagian besar barang oke seperti barang yang tersedia. Semoga ada promo yang lebih baik lagi. Pengiriman di sini buruk karena kurir tidak menghubungi nomor Anda. Iklan Anda semakin mengganggu.', 'besar,barang,oke,seperti,barang,sedia,moga,ada,promo,lebih,baik,kirim,sini,buruk,kurir,tidak,hubung,nomor,anda,iklan,anda,makin,ganggu', -1, '2022-05-24 16:57:04', 0),
(1953, 'Pengiriman lambat, kurir LEX tidak terpercaya dan tidak profesional. Mereka mengambil waktu dua kali lipat dibandingkan dengan Shopee, dan tidak pernah mencari pengakuan atas barang yang mereka kirim. Beberapa kali barang dikirim ke alamat yang salah. Aplikasi itu sendiri memiliki algoritme pencarian dan saran produk yang mengerikan.', 'kirim,lambat,kurir,lex,tidak,percaya,tidak,profesional,ambil,waktu,dua,kali,lipat,banding,shopee,tidak,cari,barang,kirim,beberapa,kali,barang,kirim,alamat,salah,aplikasi,sendiri,milik,algoritme,cari,saran,produk,ngeri', -1, '2022-05-24 16:57:04', 0),
(1954, 'Kehilangan lebih dari $40. Benci bagaimana barang sering hilang penjual hanya akan mengatakan untuk menghubungi Lazada dan Lazada tidak akan membantu terutama karena mereka akan menggunakan antarmuka AI ini yang tidak berguna. Saya mencoba mendapatkan pengembalian dana untuk produk yang diklaim telah dikirim oleh penjual. Penjual mengatakan kepada saya untuk menghubungi Lazada untuk pengembalian dana karena mereka pasti telah mengirim produk dan Lazada menanganinya. Masalahnya adalah saya terlambat mengajukan pengembalian dana karena saya pikir barangnya terlambat (ini kadang-kadang terjadi).', 'hilang,lebih,benci,bagaimana,barang,sering,hilang,jual,atak,hubung,lazada,lazada,tidak,bantu,utama,guna,antarmuka,a,tidak,guna,coba,dapat,kembali,dana,produk,klaim,telah,kirim,jual,jual,atak,hubung,lazada,kembali,dana,pasti,telah,kirim,produk,lazada,tangan,masalah,lambat,ajuk,kembali,dana,pikir,barang,lambat,kadangkadang,jadi', -1, '2022-05-24 16:57:05', 0),
(1955, 'Saya sangat tidak suka lazada tata letaknya berantakan dan untuk pengguna baru semuanya sulit dilakukan dan Anda tidak dapat membatalkan voucher pengiriman? Tsk saya bisa menghemat lebih banyak. Ibonly download karena saya sangat ingin membeli Twice Necklace karena di platform pemesanan online order tidak support cod. Tolong perbaiki tata letak Anda.', 'tidak,suka,lazada,tata,letak,berantak,guna,baru,semua,sulit,laku,anda,tidak,dapat,batal,voucher,kirim,tsk,hemat,lebih,banyak,ibonly,download,ingin,beli,twice,necklace,platform,mesan,online,order,tidak,support,cod,tolong,baik,tata,letak,anda', -1, '2022-05-24 16:57:05', 0),
(1956, 'Aplikasi boleh digunakan meskipun terkadang membingungkan. Mereka hanya perlu meningkatkan layanan kurir mereka terutama LEX karena pengendara mereka sangat kasar dan tidak profesional! Saya tidak bertanya-tanya apakah Lazada akan memiliki peringkat rendah di atas Shopee. Layanan kurir merupakan faktor utama keberhasilan perusahaan Anda.', 'aplikasi,boleh,guna,meski,kadang,bingung,perlu,tingkat,layan,kurir,utama,lex,kendara,kasar,tidak,profesional,tidak,bertanyata,apakah,lazada,milik,peringkat,rendah,shopee,layan,kurir,rupa,faktor,utama,hasil,usaha,anda', -1, '2022-05-24 16:57:06', 0),
(1957, 'Aku tidak tahu apa yang terjadi. Aplikasi membutuhkan saya untuk masuk. Ketika saya melakukannya, dengan id dan kata sandi yang valid, dikatakan emel saya tidak terdaftar. Ketika saya mengubah kata sandi, semuanya hilang. Saya tidak dapat melacak paket saya. Kehilangan setiap daftar keinginan. Seperti saya pengguna baru. Sekarang saya tidak tahu di mana paket saya.', 'tidak,tahu,jadi,aplikasi,butuh,masuk,ketika,laku,id,kata,sandi,valid,katak,emel,tidak,daftar,ketika,ubah,kata,sandi,semua,hilang,tidak,dapat,lacak,paket,hilang,tiap,daftar,ingin,seperti,guna,baru,tidak,tahu,mana,paket', -1, '2022-05-24 16:57:06', 0),
(1958, 'Tidak bisa memilih kurir. Tidak semua kurir sama dalam hal layanan yang diberikan. Ini sangat tergantung pada daerah. Kecewa. Dan apa-apaan dengan pop up. Itu ada di mana-mana. Mungkin para pengembang menyukainya. Bagi saya, itu agak mengganggu.', 'tidak,pilih,kurir,tidak,semua,kurir,sama,hal,layan,berik,gantung,daerah,kecewa,apaapaan,pop,up,ada,manamana,para,kembang,suka,agak,ganggu', 1, '2022-05-24 16:57:06', 0),
(1959, 'Item di tab Wishlist & Pembelian Sebelumnya tidak muncul secara penuh. Mengirim pesan kepada mereka di Facebook, Sam perwakilan mereka mengatakan seseorang akan menelepon saya tetapi tidak ada yang melakukannya. Liya di sisi lain bertanya kepada saya apa masalahnya meskipun ada riwayat obrolan di Facebook Messenger. Jangan percaya tanggal pengiriman mereka juga. Jumlah BS.', 'item,tab,wishlist,beli,belum,tidak,muncul,cara,penuh,kirim,pesan,facebook,sam,wakil,atak,seseorang,telepon,tidak,ada,laku,liya,sisi,lain,berta,masalah,meski,ada,riwayat,obrol,facebook,messenger,percaya,tanggal,kirim,jumlah,bs', 1, '2022-05-24 16:57:07', 0),
(1960, 'Iklan Anda di setiap game saya sangat mengganggu. Bagian yang paling menyebalkan adalah tombol (X) tidak bisa ditekan, itu hanya umpan klik. Saya menginstal aplikasi Anda hanya ingin memberi tahu Anda ini.', 'iklan,anda,tiap,game,ganggu,paling,sebal,tombol,x,tidak,tekan,umpan,klik,menginstal,aplikasi,anda,ingin,beri,tahu,anda', -1, '2022-05-24 16:57:07', 0),
(1961, 'aplikasi ini sangat mengganggu, iklan ada di mana-mana dan diluncurkan dengan paksa saat saya menjelajah dan ketika saya di tengah permainan, tidak apa-apa untuk membuat iklan tetapi diluncurkan dengan paksa beberapa kali, membuat saya kesal dengan aplikasi Anda.', 'aplikasi,ganggu,iklan,ada,manamana,luncur,paksa,jelajah,ketika,tengah,main,tidak,apaapa,buat,iklan,luncur,paksa,beberapa,kali,buat,kesal,aplikasi,anda', -1, '2022-05-24 16:57:07', 0),
(1962, 'Dukungan pelanggan tidak ada gunanya untuk memecahkan masalah! Bahkan mengkonfirmasi sesuatu yang tidak dia lakukan. Perwakilan selalu memutuskan sambungan. Sangat kasar!! Tidak ada jawaban yang sesuai dari mereka dan memberikan jawaban yang berbeda. Tidak profesional! Sudah menunggu penarikan pengembalian dana saya selama sebulan sekarang dan yang bisa mereka katakan hanyalah \"sudah dalam proses\"', 'dukung,langgan,tidak,ada,guna,pecah,masalah,bahkan,konfirmasi,suatu,tidak,laku,wakil,utus,sambung,kasar,tidak,ada,jawab,sesuai,berik,jawab,beda,tidak,profesional,sudah,tunggu,tarik,kembali,dana,selama,bulan,katak,sudah,proses', -1, '2022-05-24 16:57:08', 0),
(1963, 'Saya memberikan 1 bintang hanya untuk aplikasi ini, seperti ulasan di sini, saya juga menemukan hal yang disebut \"bug\" dan juga baru-baru ini saya memesan barang di sini yang saya periksa dua kali sebelum memesan, lalu ketika tiba jumlahnya tepat tetapi saya menerima barang yang salah. Lalu salah satu tim (Lazada) PM saya, tapi dia bilang saya yang salah bukan penjualnya. Bagaimana bisa terjadi bahwa sebelum saya memesan saya memilih barang yang saya inginkan kemudian datang salah? Saya akan menghapus aplikasi ini & tidak pernah menggunakannya.', 'berik,bintang,aplikasi,seperti,ulas,sini,temu,hal,sebut,bug,barubaru,mesan,barang,sini,periksa,dua,kali,belum,mesan,ketika,tiba,jumlah,tepat,terima,barang,salah,salah,satu,tim,lazada,pm,bilang,salah,bukan,jual,bagaimana,jadi,belum,mesan,pilih,barang,ingin,kemudian,datang,salah,hapus,aplikasi,tidak,guna', -1, '2022-05-24 16:57:08', 0),
(1964, 'Aplikasi tersedot. Setiap kali pembayaran menggunakan sistem kartu kredit akan menyimpan kartu default di aplikasi. Pada 7/7 kartu saya ditipu. . . disebut layanan pelanggan, mereka tampaknya tersesat tidak dapat menyelesaikan keluhan saya. Saya ingin mengatakan Manajemen, tim Pelanggan, dan TI mereka bekerja secara terpisah. Selama keluhan serius seperti itu, mereka mendorong pelanggan untuk menyelesaikan masalahnya sendiri! !', 'aplikasi,sedot,tiap,kali,bayar,guna,sistem,kartu,kredit,simpan,kartu,default,aplikasi,kartu,tipu,sebut,layan,langgan,tampak,sesat,tidak,dapat,selesai,keluh,ingin,atak,manajemen,tim,langgan,t,kerja,cara,pisah,selama,keluh,serius,seperti,dorong,langgan,selesai,masalah,sendiri', -1, '2022-05-24 16:57:09', 0),
