(1987, 'Dukungan pelanggan di bawah rata-rata dan tidak terlalu membantu sama sekali. Pengiriman memakan waktu terlalu lama atau sebagian besar waktu, dibatalkan bahkan tanpa memberi tahu Anda. Ya, mereka tidak memiliki fitur itu jika mereka membatalkan pesanan Anda, pesanan Anda akan hilang begitu saja di tab Untuk menerima mereka. Tidak ada pemberitahuan sama sekali. Jika pengiriman terlalu lama, Anda tidak memiliki opsi untuk membatalkannya.????????????', 'dukung,langgan,bawah,ratarata,tidak,bantu,sama,sekali,kirim,makan,waktu,lama,besar,waktu,batal,bahkan,tanpa,beri,tahu,anda,ya,tidak,milik,fitur,batal,pesan,anda,pesan,anda,hilang,saja,tab,terima,tidak,ada,beritahu,sama,sekali,kirim,lama,anda,tidak,milik,opsi,batal', -1, '2022-05-24 16:57:23', 0),
(1988, 'Itu bagus sebelum covid, sekarang kurir tidak akan menelepon atau mengirimi Anda pesan, katanya barang Anda terkirim tetapi Anda tidak menerima, dan layanan pelanggan tidak menjawab Anda juga, total scam mate', 'bagus,belum,covid,kurir,tidak,telepon,kirim,anda,pesan,kata,barang,anda,kirim,anda,tidak,terima,layan,langgan,tidak,jawab,anda,total,scam,mate', 1, '2022-05-24 16:57:23', 0),
(1989, 'APLIKASI SANGAT SANGAT BURUK UNTUK PEMBELI!!! BENAR-BENAR TIDAK DIREKOMENDASIKAN!!!! PENGALAMAN KEDUA SAYA DI SINI AKAN TERAKHIR KALI SAYA MENGGUNAKAN APLIKASI INI. LAZADA TIDAK MEMBERI APA PUN SELAIN KEKECEWAAN!!!!', 'aplikasi,buruk,beli,benarbenar,tidak,rekomendasi,alam,dua,sini,akhir,kali,guna,aplikasi,lazada,tidak,beri,selain,kecewa', -1, '2022-05-24 16:57:23', 0),
(1990, 'Jika saya tidak bisa memberikan bintang, saya akan melakukannya. Aplikasi ini semakin menjadi mimpi buruk yang memburuk dari waktu yang terbuang untuk digunakan, terutama ketika saya perlu menjelajah. Itu hang / membeku sebagian besar waktu, rekomendasinya konyol dan kadang-kadang sama sekali tidak terkait, kumpulan rekomendasi yang sama muncul berulang-ulang setelah menggulir untuk sementara waktu, dan setelah saya mengirimkan ulasan secara anonim, itu masih meminta saya untuk berkomentar ( apa yang harus saya katakan tentang ulasan saya sendiri? Ulasan bagus?). Perbaiki bug!', 'tidak,berik,bintang,laku,aplikasi,makin,jadi,mimpi,buruk,buruk,waktu,buang,guna,utama,ketika,perlu,jelajah,hang,membe,besar,waktu,rekomendasi,konyol,kadangkadang,sama,sekali,tidak,kait,kumpul,rekomendasi,sama,muncul,berulangulang,sete,gulir,sementara,waktu,sete,kirim,ulas,cara,anonim,masih,minta,komentar,harus,katak,tentang,ulas,sendiri,ulas,bagus,baik,bug', -1, '2022-05-24 16:57:24', 0),
(1991, 'Aplikasi Tidak Berguna, Layanan Tidak Berguna. Tidak ada layanan pelanggan, pelacakan tidak berfungsi, tidak ada nomor yang dapat dihubungi untuk meminta bantuan.', 'aplikasi,tidak,guna,layan,tidak,guna,tidak,ada,layan,langgan,lacak,tidak,fungsi,tidak,ada,nomor,dapat,hubung,minta,bantu', -1, '2022-05-24 16:57:24', 0),
(1992, 'Banyak produk scammer/palsu. Lazada tidak memfilter dan mengecek ulang penjual dan produk. Fitur tidak rapi dan sulit digunakan. Satu-satunya hal yang bagus adalah ini memiliki banyak komersial tetapi tidak terlalu persuasif. Secara keseluruhan, sangat tidak puas. Jangan gunakan aplikasi ini. Sebagai gantinya, gunakan aplikasi lain yang memiliki koin gratis, pengiriman gratis, voucher, dll.', 'banyak,produk,scammerpalsu,lazada,tidak,filter,ecek,ulang,jual,produk,fitur,tidak,rapi,sulit,guna,satusatu,hal,bagus,milik,banyak,komersial,tidak,persuasif,cara,seluruh,tidak,puas,guna,aplikasi,bagai,ganti,guna,aplikasi,lain,milik,koin,gratis,kirim,gratis,voucher,dll', -1, '2022-05-24 16:57:25', 0),
(1993, 'Ketika saya masuk ke Bagan Saya dan kemudian tekan tombol check out akan langsung melompat ke layar beranda, telah berulang kali 25062021 Sekali lagi hanya melompat ke layar utama ke mana harus mengadu ? Tidak ada yang menjawab Aplikasi yang buruk', 'ketika,masuk,bagan,kemudian,tekan,tombol,check,out,langsung,lompat,layar,beranda,telah,ulang,kali,sekali,lompat,layar,utama,mana,harus,adu,tidak,ada,jawab,aplikasi,buruk', -1, '2022-05-24 16:57:25', 0),
(1994, 'Aplikasi ini semakin buruk! Setiap kali saya mencoba untuk membeli beban, selalu dikatakan bahwa ada terlalu banyak lalu lintas yang saya yakin internet saya cepat. Saya mencoba menghubungi layanan pelanggan tentang hal itu dan mereka memberi tahu saya untuk melakukan beberapa pemecahan masalah seperti; Log in/Log out Hapus cache/data Instal/uninstall Kemudian setelah saya mencoba semua, ketika saya kembali mereka mengatakan kepada saya bahwa itu karena internet saya yang lambat. Saya cukup yakin bahwa koneksi internet saya cepat. Saya bisa streaming tanpa buffering.', 'aplikasi,makin,buruk,tiap,kali,coba,beli,beban,katak,ada,banyak,lintas,yakin,internet,cepat,coba,hubung,layan,langgan,tentang,hal,beri,tahu,laku,beberapa,pecah,masalah,seperti,log,inlog,out,hapus,cachedata,instaluninstall,kemudian,sete,coba,semua,ketika,kembali,atak,internet,lambat,cukup,yakin,koneksi,internet,cepat,streaming,tanpa,buffering', -1, '2022-05-24 16:57:26', 0),
(1995, 'Sejujurnya sangat jujur ??... Pengalaman buruk satu bintang aplikasi ini membuat saya memiliki masalah kemarahan, saya sangat yakin data dan Wi-Fi saya dalam koneksi 4G yang baik TAPI APLIKASI INI MEMILIKI BEBERAPA MASALAH DAN SAYA TIDAK BISA MELAPORKAN MASALAH halaman terus memberi tahu saya bahwa saya memiliki koneksi yang buruk setiap kali saya mengetuk \"kirim\" .......... Masalahnya adalah setiap kali saya memilih barang yang ingin saya beli dan memilih metode pembayaran dan KETIKA saya mengetuk \"Tempatkan Pesanan\" tombol itu langsung ke halaman kosong dengan judul \"Konfirmasi Pembayaran\"......', 'jujur,jujur,alam,buruk,satu,bintang,aplikasi,buat,milik,masalah,marah,yakin,data,wifi,koneksi,g,baik,aplikasi,milik,beberapa,masalah,tidak,lapor,masalah,halaman,terus,beri,tahu,milik,koneksi,buruk,tiap,kali,ketuk,kirim,masalah,tiap,kali,pilih,barang,ingin,beli,pilih,metode,bayar,ketika,ketuk,tempat,pesan,tombol,langsung,halaman,kosong,judul,konfirmasi,bayar', -1, '2022-05-24 16:57:27', 0),
(1996, 'Mencari item tertentu adalah latihan yang sia-sia karena Anda dibombardir dengan item lain yang tidak terkait. Misalnya, pencarian hanya untuk satu kata kunci \"macross\" juga akan memberi Anda hasil untuk mainan lain dan bahkan gundam dan beberapa transformer. Anda mendapatkan beberapa hit teratas di awal, lalu sekelompok item yang tidak terkait dibumbui dengan sedikit lebih banyak dari apa yang Anda cari. Ketika pandemi berakhir, saya meninggalkan platform ini.', 'cari,item,tentu,latih,siasia,anda,bombardir,item,lain,tidak,kait,misal,cari,satu,kata,kunci,macross,beri,anda,hasil,main,lain,bahkan,gundam,beberapa,transformer,anda,dapat,beberapa,hit,awal,kelompok,item,tidak,kait,bumbu,sedikit,lebih,banyak,anda,cari,ketika,pandemi,akhir,tinggal,platform', 1, '2022-05-24 16:57:27', 0),
(1997, 'Lazada sangat bagus dalam hal iklan. Mereka tidak akan berhenti sampai Anda mendapatkan produk yang mereka ingin Anda beli. Sayangnya, di situlah transaksi bisnis mereka yang baik berakhir. Lihat, jika mereka setidaknya bisa menghabiskan lebih banyak waktu untuk memberi tahu pengguna tentang pesanan mereka, pelacakannya, dan cara berkomunikasi dengan kurir (untuk mencegah pengiriman yang gagal) daripada membombardir kami dengan iklan yang tidak berguna, itu akan lebih baik daripada Shoppee.. .', 'lazada,bagus,hal,iklan,tidak,henti,sampai,anda,dapat,produk,ingin,anda,beli,sayang,situ,transaksi,bisnis,baik,akhir,lihat,tidak,habis,lebih,banyak,waktu,beri,tahu,guna,tentang,pesan,lacak,cara,komunikasi,kurir,cegah,kirim,gagal,daripada,bombardir,iklan,tidak,guna,lebih,baik,daripada,shoppee', -1, '2022-05-24 16:57:27', 0),
(1998, 'Nah saya pesan laptop lewat lazada, dan setelah beberapa bulan charger nya rusak trus saya pesan charger penggantinya. Penjual sebenarnya responsif dan baik, dalam waktu 24 jam mereka mengemas dan meneruskan pengisi daya ke logistik Lazada untuk pemindaian sebelum pengiriman, tetapi seminggu kemudian masih tidak ada pembaruan, dan penjual mengatakan bahwa itu mungkin hilang/diabaikan oleh logistik lazada karena barangnya sangat kecil, menurut penjual ini sering terjadi. lazada sangat sangat mengecewakan', 'nah,pesan,laptop,lewat,lazada,sete,beberapa,bulan,charger,,rusak,trus,pesan,charger,ganti,jual,benar,responsif,baik,waktu,jam,emas,terus,isi,daya,logistik,lazada,pindai,belum,kirim,minggu,kemudian,masih,tidak,ada,baru,jual,atak,hilangdiabaikan,logistik,lazada,barang,kecil,turut,jual,sering,jadi,lazada,kecewa', -1, '2022-05-24 16:57:28', 0),
(1999, 'Iklan mereka ada di mana-mana! Itu terus mengarahkan saya untuk mengunduh aplikasi, terutama ketika saya membaca artikel dan webtoon dari google, jadi saya mengunduhnya tetapi meskipun sudah diinstal, itu masih terus mengarahkan dan membuka aplikasi.. Sangat mengganggu sehingga saya menghabiskan setengahnya waktu menutup aplikasi karena saya tidak meminta untuk dibuka. Tolong biarkan aku membaca dengan tenang!!!', 'iklan,ada,manamana,terus,arah,unduh,aplikasi,utama,ketika,baca,artikel,webtoon,google,jadi,unduh,meski,sudah,diinstal,masih,terus,arah,buka,aplikasi,ganggu,sehingga,habis,tengah,waktu,tutup,aplikasi,tidak,minta,buka,tolong,biar,baca,tenang', -1, '2022-05-24 16:57:29', 0),
(2000, 'Saya memesan lemari portabel minggu lalu dan tiba tepat pada 26/04. ketika saya membuka paket saya menemukan itu rusak. Saya mencoba memberi tahu penjual dan saya bahkan tidak tahu apakah dia merespons atau tidak karena setiap kali saya ingin memeriksa kotak masuk saya, aplikasi hanya akan mengatakan lalu lintas yang tidak biasa ditemukan di jaringan saya. hal yang sama berlaku untuk pelanggan lain. Saya mencoba menghubungi nomor penjual tetapi tidak berhasil. tidak ada jawaban atau telepon tidak aktif. bagaimana sih saya akan menempatkan proses pengembalian/pengembalian dana!', 'mesan,lemari,portabel,minggu,tiba,tepat,ketika,buka,paket,temu,rusak,coba,beri,tahu,jual,bahkan,tidak,tahu,apakah,respons,tidak,tiap,kali,ingin,periksa,kotak,masuk,aplikasi,atak,lintas,tidak,biasa,temu,jaring,hal,sama,berla,langgan,lain,coba,hubung,nomor,jual,tidak,hasil,tidak,ada,jawab,telepon,tidak,aktif,bagaimana,sih,tempat,proses,pengembalianpengembalian,dana', -1, '2022-05-24 16:57:30', 0),
(2001, 'Aplikasi ini bagus untuk menelusuri produk tetapi dalam hal seberapa halus aplikasi itu seharusnya sampah. Terutama pembaruan baru, saya membukanya setelah saya memperbaruinya kemudian mulai macet sepanjang waktu. Setiap kali saya membukanya selalu crash, dan meskipun saya tidak mengklik apa pun dan menunggu jika crash, buka saja bagian feed live feed. Ayo kawan, tolong perbaiki ini. Anda selalu mengatakan bahwa aplikasi tge ditingkatkan dan Anda memperbaiki beberapa bug atau lebih pada aplikasi tetapi masih sampah', 'aplikasi,bagus,telusur,produk,hal,berapa,halus,aplikasi,harus,sampah,utama,baru,baru,buka,sete,baru,kemudian,mulai,macet,panjang,waktu,tiap,kali,buka,crash,meski,tidak,klik,tunggu,crash,buka,saja,feed,live,feed,ayo,kawan,tolong,baik,anda,atak,aplikasi,tge,tingkat,anda,baik,beberapa,bug,lebih,aplikasi,masih,sampah', -1, '2022-05-24 16:57:30', 0),
(2002, 'Saya tidak dapat menambahkan produk apa pun ke keranjang saya. Saya sudah mencoba berbagai cara untuk bisa, seperti menguninstall aplikasi itu sendiri. Setelah saya mengklik tombol tambahkan ke troli ke produk APAPUN, tertulis, \"Maaf, ada yang tidak beres di pihak kami.\" Saya baru-baru ini membeli voucher dan saya khawatir itu hanya akan sia-sia dengan situasi ini, aplikasi telah ditampilkan selama beberapa hari sekarang. Aplikasi Lazada ayah saya memungkinkan dia untuk menambahkan produk ke keranjangnya sehingga tidak ada di koneksi internet kami. Ini berfungsi sebelumnya seperti yang saya pesan tetapi sekarang ...', 'tidak,dapat,tambah,produk,keranjang,sudah,coba,bagai,cara,seperti,menguninstall,aplikasi,sendiri,sete,klik,tombol,tambah,troli,produk,tulis,maaf,ada,tidak,beres,pihak,barubaru,beli,voucher,khawatir,siasia,situasi,aplikasi,telah,tampil,selama,beberapa,hari,aplikasi,lazada,ayah,tambah,produk,keranjang,sehingga,tidak,ada,koneksi,internet,fungsi,belum,seperti,pesan', -1, '2022-05-24 16:57:31', 0),
(2003, 'Aplikasi tidak berfungsi. Saya tidak bisa lagi membeli dari PC atau ponsel saya karena saya terjebak dalam neraka \"terdeteksi lalu lintas yang tidak biasa\". | Juga mengatakan \"Pengiriman Gratis.\"... sebuah lelucon. | Biaya pengiriman keterlaluan. | Melacak pengiriman adalah lelucon yang lebih besar. | Beberapa kurir baik, beberapa kurir berbohong (LBC) | Ajukan keluhan, yakinlah Anda tidak akan memiliki tindak lanjut. | Saya tidak ingin f@ $nlling 60 peso Anda! | Serahkan saja, Lazada! Banyak ulasan 5 * palsu di sini.. ulangi saja kata yang sama.', 'aplikasi,tidak,fungsi,tidak,beli,pc,ponsel,jebak,neraka,deteksi,lintas,tidak,biasa,atak,kirim,gratis,buah,lelucon,biaya,kirim,lacak,kirim,lelucon,lebih,besar,beberapa,kurir,baik,beberapa,kurir,bohong,lbc,ajuk,keluh,yakin,anda,tidak,milik,tindak,lanjut,tidak,ingin,f,nlling,peso,anda,serah,saja,lazada,banyak,ulas,palsu,sini,ulang,saja,kata,sama', -1, '2022-05-24 16:57:31', 0),
(2004, 'Aplikasi selalu mendapat masalah dan layanan pelanggan tidak bagus sama sekali. Pilihan yang diberikan dalam layanan pelanggan sangat terbatas dan bahkan tidak dapat terhubung ke agen langsung. Satu hal lagi adalah setelah saya membeli barang beberapa hari yang lalu, sekarang ppl memanggil saya untuk membatalkan barang tersebut karena mereka sudah kehabisan stok. Mereka bahkan tidak repot-repot memperbarui aplikasi sebelumnya ?? Membuat saya frustasi karena saya harus memasukkan lagi rm10 (min) hanya untuk membeli barang dari penjual lain karena harganya 20 sen lebih.', 'aplikasi,dapat,masalah,layan,langgan,tidak,bagus,sama,sekali,pilih,berik,layan,langgan,batas,bahkan,tidak,dapat,hubung,agen,langsung,satu,hal,sete,beli,barang,beberapa,hari,ppl,panggil,batal,barang,sebut,sudah,habis,stok,bahkan,tidak,repotrepot,baru,aplikasi,belum,buat,frustasi,harus,masuk,rm,min,beli,barang,jual,lain,harga,sen,lebih', -1, '2022-05-24 16:57:32', 0),
(2005, 'Belum pernah melakukan ini sebelumnya tetapi iklan Anda membuat saya gugup dan mengganggu dengan cara yang secara otomatis muncul di aplikasi saya ketika saya mencoba untuk keluar dari tombol umpan klik Anda-- bahwa saya benar-benar meluangkan waktu untuk datang ke sini hanya untuk memberikan ini ulasan. Selamat, aplikasi belanja Anda sangat populer tetapi tidak seperti yang Anda inginkan. Kalau saja saya punya fitur, saya bisa menonaktifkan aplikasi Anda selamanya. Mencopot pemasangannya hanya akan menyebabkan playstore bermunculan. HENTIKAN IKLAN.', 'belum,laku,belum,iklan,anda,buat,gugup,ganggu,cara,cara,otomatis,muncul,aplikasi,ketika,coba,keluar,tombol,umpan,klik,anda,benarbenar,luang,waktu,datang,sini,berik,ulas,selamat,aplikasi,belanja,anda,populer,tidak,seperti,anda,ingin,saja,punya,fitur,nonaktif,aplikasi,anda,selama,copot,pasang,sebab,playstore,muncul,henti,iklan', -1, '2022-05-24 16:57:33', 0),
(2006, 'Sejauh ini bagus, omong-omong, TV megasonik yang saya terima hari ini apakah saya perlu trafo, daya AC 110V - 240V, atau saya harus menyedotnya langsung ke 240V. saya beli tv megasonic thn lalu 2020 tapi blm pernah pakai saya tidak tau tv nya palsecam jadi tidak bisa di pakai, kalau tv nya american standard atau ntsc maka apakah akan berfungsi. Saya ingin balasan dari pihak Anda. terima kasih', 'jauh,bagus,omongomong,tv,megasonik,terima,hari,apakah,perlu,trafo,daya,ac,v,v,harus,sedot,langsung,v,beli,tv,megasonic,thn,blm,pakai,tidak,tau,tv,,palsecam,jadi,tidak,pakai,tv,,american,standard,ntsc,maka,apakah,fungsi,ingin,balas,pihak,anda,terima,kasih', -1, '2022-05-24 16:57:33', 0),
(2007, 'Begitu banyak yang terjadi dengan aplikasi. Terlalu banyak permainan, terlalu banyak untuk dikonfirmasi hanya karena Anda melihat-lihat 2 item atau apa. Tapi tujuan utama yang membeli adalah apa yang kurang. Kategori di toko bisa membingungkan. Sulit untuk menelusuri semuanya sehingga perlu sedikit peningkatan pada pencarian di antarmuka toko. Sebenarnya tidak hanya saat mencari toko, mungkin juga meningkatkan keseluruhan antarmuka. Voucher sf hanya memberikan diskon yang sangat minim. Itu sebabnya saya tidak berbelanja di sini sebanyak b4. Terlalu luar biasa.', 'banyak,jadi,aplikasi,banyak,main,banyak,konfirmasi,anda,melihatlihat,item,tuju,utama,beli,kurang,kategori,toko,bingung,sulit,telusur,semua,sehingga,perlu,sedikit,tingkat,cari,antarmuka,toko,benar,tidak,cari,toko,tingkat,seluruh,antarmuka,voucher,sf,berik,diskon,minim,sebab,tidak,belanja,sini,banyak,b,biasa', -1, '2022-05-24 16:57:33', 0);
INSERT INTO `skripsi_rekap` (`no`, `komentar`, `stem`, `sentimen`, `tgl`, `flag`) VALUES
(2008, 'Saya baru saja menginstal aplikasi dan memesan sesuatu, sedikit lebih dari satu jam kemudian dikatakan \"lalu lintas yang tidak biasa terdeteksi\". Mencoba mematikan ponsel saya dan menginstal ulang aplikasi lagi masih tidak dapat mengaksesnya. Sangat mengecewakan. Semoga seseorang segera memperbaiki masalah ini karena saya yakin bukan hanya saya yang mengalami ini sekarang.', 'baru,saja,menginstal,aplikasi,mesan,suatu,sedikit,lebih,satu,jam,kemudian,katak,lintas,tidak,biasa,deteksi,coba,mati,ponsel,menginstal,ulang,aplikasi,masih,tidak,dapat,akses,kecewa,moga,seseorang,segera,baik,masalah,yakin,bukan,alami', -1, '2022-05-24 16:57:34', 0),
(2009, 'Adikku memesan telepon dan membayar dengan tabungannya. Ketika tiba kami senang karena terlihat bagus tetapi ketika kami mencoba menggunakan telepon itu rusak. Itu terus mengatakan bahwa itu tidak memiliki penyimpanan internal yang tersisa meskipun kami belum menginstal aplikasi apa pun. Kami mencoba untuk mengembalikannya namun layanan pelanggannya payah dan entah bagaimana itu tidak akan mengirimnya terus memuat setiap kali saya mencoba mengirimkan formulir pengembalian dana', 'adik,mesan,telepon,bayar,tabung,ketika,tiba,senang,lihat,bagus,ketika,coba,guna,telepon,rusak,terus,atak,tidak,milik,simpan,internal,sisa,meski,belum,menginstal,aplikasi,coba,kembali,layan,langgan,payah,entah,bagaimana,tidak,kirim,terus,muat,tiap,kali,coba,kirim,formulir,kembali,dana', -1, '2022-05-24 16:57:35', 0),
(2010, 'Aplikasi ini mendapat beberapa masalah tetapi juga bukan masalah besar..tetapi hal yang paling menjengkelkan dan menjengkelkan tentang lazada adalah ketika saya menjelajahi google 85% iklan menjadi saya ke lazada..jadi sistem Anda lemah..tolong platform terbesar..so banyak pengguna..jalankan sistem yang hebat dan buat sistem Anda kuat..dan harap perhatikan ulasan orang lain..thts all', 'aplikasi,dapat,beberapa,masalah,bukan,masalah,besartetapi,hal,paling,jengkel,jengkel,tentang,lazada,ketika,jelajah,google,iklan,jadi,lazadajadi,sistem,anda,lemahtolong,platform,terbesarso,banyak,penggunajalankan,sistem,hebat,buat,sistem,anda,kuatdan,harap,hati,ulas,orang,lainthts,all', -1, '2022-05-24 16:57:35', 0),
(2011, 'Menyatakan bahwa akan mencoba pengiriman hari ini dan tidak ada pengiriman. Mohon perbaiki masalah dalam memberi tahu status pengiriman paket pelanggan. Tidak dapat menghubungi layanan pelanggan karena antrian yang tinggi. Mengubah waktu paket pribadi karena informasi yang salah dan ada buang-buang waktu menunggu tidak ada pengiriman. App menunjukkan parsel keluar untuk pengiriman dan akan dikirimkan hari ini. Tolong cari tahu kesalahannya dan perbaiki masalahnya.', 'nyata,coba,kirim,hari,tidak,ada,kirim,mohon,baik,masalah,beri,tahu,status,kirim,paket,langgan,tidak,dapat,hubung,layan,langgan,antri,tinggi,ubah,waktu,paket,pribadi,informasi,salah,ada,buangbuang,waktu,tunggu,tidak,ada,kirim,app,tunjuk,parsel,keluar,kirim,kirim,hari,tolong,cari,tahu,salah,baik,masalah', -1, '2022-05-24 16:57:36', 0),
(2012, 'Ini adalah mimpi buruk untuk membuat ulasan produk/pesanan karena foto tidak diunggah dengan benar dan halaman tampaknya disegarkan secara otomatis. Jika Anda membutuhkan waktu lebih lama, semua yang Anda tulis di ulasan Anda akan hilang begitu juga dengan foto-fotonya. Pengalaman pembeli adalah bencana. Pesanan saya ditandai upaya pengiriman gagal meskipun tidak ada upaya nyata yang dilakukan. Saya hampir tidak bisa mentolerir ketidakjujuran. Pasti menonaktifkan akun saya segera!', 'mimpi,buruk,buat,ulas,produkpesanan,foto,tidak,unggah,benar,halaman,tampak,segar,cara,otomatis,anda,butuh,waktu,lebih,lama,semua,anda,tulis,ulas,anda,hilang,fotofoto,alam,beli,bencana,pesan,tanda,upaya,kirim,gagal,meski,tidak,ada,upaya,nyata,laku,hampir,tidak,mentolerir,ketidakjujuran,pasti,nonaktif,akun,segera', 1, '2022-05-24 16:57:36', 0),
(2013, 'ADA YANG SALAH DENGAN SISTEM ANDA. Setiap kali saya mencoba untuk memesan sesuatu, saya tidak dapat memilih voucher yang ingin saya gunakan (yaitu, tidak ada pengeluaran minimum pengiriman gratis). Saya tahu bahwa voucher tersebut lebih dari memenuhi syarat untuk saya gunakan untuk barang yang saya inginkan tetapi Lazada tampaknya menggunakan metode FIFO dalam hal voucher. Itu tidak seperti ini sebelumnya. Saya berharap hal ini dapat diatasi sesegera mungkin.', 'ada,salah,sistem,anda,tiap,kali,coba,mesan,suatu,tidak,dapat,pilih,voucher,ingin,guna,tidak,ada,keluar,minimum,kirim,gratis,tahu,voucher,sebut,lebih,penuh,syarat,guna,barang,ingin,lazada,tampak,guna,metode,fifo,hal,voucher,tidak,seperti,belum,harap,hal,dapat,segera', -1, '2022-05-24 16:57:37', 0),
(2014, 'Sangat kecewa dengan aplikasi ini. Saya menyaksikan kesalahan di Funfarm yang menyebabkan saya tidak dapat menukar stroberi dengan hadiah. Saya memberi tahu layanan pelanggan dan memberi mereka gambar & video tentang kesalahan itu; dan, menunggu satu hari untuk mendapatkan umpan balik. Lagi pula, mereka mengatakan saya harus menunggu 48 jam, tidak apa-apa tetapi program pertukaran stroberi akan berakhir sebelum saya mendapatkan tanggapan mereka; jadi, bahkan mereka memperbaiki kesalahan setelah itu, itu tidak masuk akal bagi saya.', 'kecewa,aplikasi,saksi,salah,funfarm,sebab,tidak,dapat,tukar,stroberi,hadiah,beri,tahu,layan,langgan,beri,gambar,video,tentang,salah,tunggu,satu,hari,dapat,umpan,balik,pula,atak,harus,tunggu,jam,tidak,apaapa,program,tukar,stroberi,akhir,belum,dapat,tanggap,jadi,bahkan,baik,salah,sete,tidak,masuk,akal', -1, '2022-05-24 16:57:38', 0),
(2015, 'Berbelanja dengan Lazada tidak apa-apa, aplikasinya sangat berguna. Tapi yang saya tidak suka adalah Lazada muncul di mana-mana, seperti ketika Anda secara tidak sengaja mengklik apa pun di situs web tertentu, Aplikasi Lazada muncul secara otomatis terlalu banyak Iklan, dan itu sangat mengganggu, dan karena ini. Saya harus meng-uninstall App lagi, jadi saya bisa terus browsing internet/website, bebas tanpa push notification dan iklan Lazada. Maaf.', 'belanja,lazada,tidak,apaapa,aplikasi,guna,tidak,suka,lazada,muncul,manamana,seperti,ketika,anda,cara,tidak,sengaja,klik,situs,web,tentu,aplikasi,lazada,muncul,cara,otomatis,banyak,iklan,ganggu,harus,menguninstall,app,jadi,terus,browsing,internetwebsite,bebas,tanpa,push,notification,iklan,lazada,maaf', -1, '2022-05-24 16:57:38', 0),
(2016, 'Lazada yang terhormat, tujuan Anda selalu terbukti sejak Anda memulai dan tumbuh selama bertahun-tahun. Namun baru-baru ini saya mulai menggunakan aplikasi menemukan banyak hal menarik. Kemarin setelah melakukan pemesanan pertama saya setelah beberapa saat aplikasi saya mogok. Pesan kesalahan muncul setelah membuka aplikasi sayung \"Lalu lintas jaringan yang tidak biasa terdeteksi di area saya\" bagaimana mungkin jika semua aplikasi lain di ponsel saya terhubung ke data seluler saya baik-baik saja. Kepercayaan selalu penting bagi kami para pengguna.JS!', 'lazada,hormat,tuju,anda,bukti,sejak,anda,mulai,tumbuh,selama,bertahuntahun,barubaru,mulai,guna,aplikasi,temu,banyak,hal,tarik,kemarin,sete,laku,mesan,pertama,sete,beberapa,aplikasi,mogok,pesan,salah,muncul,sete,buka,aplikasi,sayung,lintas,jaring,tidak,biasa,deteksi,area,bagaimana,semua,aplikasi,lain,ponsel,hubung,data,seluler,baikbaik,saja,percaya,penting,para,penggunajs', -1, '2022-05-24 16:57:39', 0),
(2017, 'Banyak menyesatkan. Tampilkan pengiriman gratis, Tetapi pengguna biaya akhir tidak peduli menggunakan dompet Anda atau metode pembayaran apa pun. Harga menyesatkan. Tampilkan 1 harga tetapi ketika memilih jenis atau warna lain, Harga meningkat. Platform tidak ramah digunakan dibandingkan dengan Sxxpee. Pengembang perlu melihat dan meningkatkan. Layanan pelanggan perlu meningkatkan dan memahami masalah pembeli karena penjual salah mengirim ukuran. Sengketa pembeli dan tidak valid membuat pembeli harus menanggung biaya atau pengembalian dana. Cari A acara B,C,D, Dll. Frustrasi.', 'banyak,sesat,tampil,kirim,gratis,guna,biaya,akhir,tidak,peduli,guna,dompet,anda,metode,bayar,harga,sesat,tampil,harga,ketika,pilih,jenis,warna,lain,harga,tingkat,platform,tidak,ramah,guna,banding,sxxpee,kembang,perlu,lihat,tingkat,layan,langgan,perlu,tingkat,paham,masalah,beli,jual,salah,kirim,ukur,sengketa,beli,tidak,valid,buat,beli,harus,tanggung,biaya,kembali,dana,cari,a,acara,bcd,dll,frustrasi', -1, '2022-05-24 16:57:39', 0),
(2018, 'Iklan Anda menghancurkan segalanya, bahkan tidak tahu bagaimana Anda masuk ke ponsel lama saya, tetapi sekarang saya memiliki ponsel baru dengan dinding api yang bagus, selamat tinggal iklan mengganggu Anda di mana-mana di chrome. Tolong demi fk, hapus atau kurangi iklan Anda, kalian bahkan membuat Malwares yang membuat perangkat seseorang penuh dengan iklan sht Anda dan akan muncul kapan saja', 'iklan,anda,hancur,segala,bahkan,tidak,tahu,bagaimana,anda,masuk,ponsel,lama,milik,ponsel,baru,dinding,api,bagus,selamat,tinggal,iklan,ganggu,anda,manamana,chrome,tolong,demi,fk,hapus,kurang,iklan,anda,bahkan,buat,malwares,buat,angkat,seseorang,penuh,iklan,sht,anda,muncul,kapan,saja', -1, '2022-05-24 16:57:40', 0),
(2019, 'Aplikasi baik-baik saja sampai Anda benar-benar membutuhkan bantuan. Dukungan pelanggan tidak berguna dan banyak scammers di sini yang mengirim produk rusak atau berbeda dari apa yang digambarkan. Masih menunggu pengembalian dana hampir 400 rm saya !! Meskipun saya mengirim produk kembali BULAN lalu!! Supervisor seharusnya menelepon kembali !!! Tidak pernah!!! Saya menelepon dukungan pelanggan. Mereka tidak membantu. Penipu!!!!', 'aplikasi,baikbaik,saja,sampai,anda,benarbenar,butuh,bantu,dukung,langgan,tidak,guna,banyak,scammers,sini,kirim,produk,rusak,beda,gambar,masih,tunggu,kembali,dana,hampir,rm,meski,kirim,produk,kembali,bulan,supervisor,harus,telepon,kembali,tidak,telepon,dukung,langgan,tidak,bantu,tipu', -1, '2022-05-24 16:57:40', 0),
(2020, 'Tidak dapat menghubungi layanan pelanggan sama sekali, benar-benar kosong. Buang-buang waktu untuk refresh dan ketika saya akhirnya mendapat kesempatan untuk mengobrol dengan Lazada, ada 10++ orang dalam antrean. Akhirnya, giliran saya, dan apa yang saya minta, saya harus menunggu setidaknya tiga menit sebelum merespons. Agen berbicara dengan setidaknya 4 hingga 5 orang pada saat yang bersamaan. Masalah saya belum terpecahkan.. Karena ada begitu banyak ppl yang mencari layanan pelanggan, tolong beri kami alamat email? Buang-buang waktu, tidak efisien.', 'tidak,dapat,hubung,layan,langgan,sama,sekali,benarbenar,kosong,buangbuang,waktu,refresh,ketika,akhir,dapat,sempat,obrol,lazada,ada,orang,antre,akhir,gilir,minta,harus,tunggu,tidak,tiga,menit,belum,respons,agen,bicara,tidak,hingga,orang,sama,masalah,belum,pecah,ada,banyak,ppl,cari,layan,langgan,tolong,beri,alamat,email,buangbuang,waktu,tidak,efisien', 1, '2022-05-24 16:57:41', 0),
(2021, 'Saya tidak keberatan dengan UI yang rumit dengan semua iklan yang berisik dan promo gamified. Tapi aplikasi telah bermasalah akhir-akhir ini, selalu memblokir saya dengan mengatakan \"lalu lintas yang tidak biasa dilaporkan dari jaringan Anda\" TERLEPAS dari jaringan atau data seluler yang saya gunakan. Mengirim email ke alamat dukungan mereka memantul kembali sebagai email yang tidak ada. Saya lebih suka online ke situs web utama bahkan dengan fitur terbatas daripada aplikasi.', 'tidak,berat,u,rumit,semua,iklan,berisik,promo,gamified,aplikasi,telah,masa,akhirakhir,blokir,atak,lintas,tidak,biasa,lapor,jaring,anda,lepas,jaring,data,seluler,guna,kirim,email,alamat,dukung,antul,kembali,bagai,email,tidak,ada,lebih,suka,online,situs,web,utama,bahkan,fitur,batas,daripada,aplikasi', -1, '2022-05-24 16:57:41', 0),
(2022, 'Yang saya inginkan hanyalah membeli barang, tetapi semua tipu muslihat ini hanya merusak aplikasi! Setidaknya buat versi Lite. Saya tidak peduli dengan streaming langsung dan permainan omong kosong Anda! Hapus daftar keinginan dan batas item keranjang. Setiap kali saya mengetuk item di troli dan mengetuk kembali, item itu kembali ke bagian paling atas daftar, yang sangat menjengkelkan!', 'ingin,beli,barang,semua,tipu,muslihat,rusak,aplikasi,tidak,buat,versi,lite,tidak,peduli,streaming,langsung,main,omong,kosong,anda,hapus,daftar,ingin,batas,item,keranjang,tiap,kali,ketuk,item,troli,ketuk,kembali,item,kembali,paling,daftar,jengkel', -1, '2022-05-24 16:57:42', 0),
(2023, 'Adapun pengalaman pribadi, saya telah memesan dari salah satu TOKO RESMI dan TERVERIFIKASI mereka. Dan setelah menunggu begitu lama, mereka membatalkan pesanan saya karena toko gagal mengirimkan barang tepat waktu. Dan sekarang mereka mengembalikannya satu per satu, jumlah barang dikembalikan tetapi biaya pengiriman tidak. PENCURI LAZADA 101!! MEMILIKI LAYANAN TERMURAH DARI SEMUA APLIKASI BELANJA!! TIDAK DIREKOMENDASIKAN!', 'adapun,alam,pribadi,telah,mesan,salah,satu,toko,resmi,verifikasi,sete,tunggu,lama,batal,pesan,toko,gagal,kirim,barang,tepat,waktu,kembali,satu,per,satu,jumlah,barang,kembali,biaya,kirim,tidak,curi,lazada,milik,layan,murah,semua,aplikasi,belanja,tidak,rekomendasi', -1, '2022-05-24 16:57:42', 0),
(2024, 'Aplikasi ini akan membantu dengan cara yang mudah. Ini membantu orang-orang yang tidak bisa keluar atau jauh di pasar, itu sangat berguna bagi mereka biasanya bagi saya. Pengalaman saya sangat bagus sejauh ini. Begitu banyak toko legit yang menjual produk berkualitas baik dengan harga murah. Anda harus bijak dalam menemukan toko/penjual yang bagus- Penilaian dengan gambar adalah kuncinya ? Pasti salah satu toko belanja yang paling mudah dinavigasi di luar sana. Banyak penjualan, potongan harga, kupon, voucher, dan gratis.', 'aplikasi,bantu,cara,mudah,bantu,orangorang,tidak,keluar,jauh,pasar,guna,biasa,alam,bagus,jauh,banyak,toko,legit,jual,produk,kualitas,baik,harga,murah,anda,harus,bijak,temu,tokopenjual,bagus,nilai,gambar,kunci,pasti,salah,satu,toko,belanja,paling,mudah,navigasi,sana,banyak,jual,potong,harga,kupon,voucher,gratis', -1, '2022-05-24 17:01:40', 0),
(2025, 'Platform belanja online ini didesain sempurna untuk kita para pelanggan yang lebih memilih berbelanja online daripada keluar rumah karena pandemi. Fitur yang paling terpuji dari aplikasi ini adalah pengirimannya, sebagian besar barang yang saya pesan untuk tanggal tertentu dikirim pada hari berikutnya. Memang, menjadi bagian dari pertumbuhan dan kesuksesan Anda yang berkelanjutan adalah kesenangan dan pengalaman yang luar biasa, terima kasih Lazada! #NasaLazadaYan', 'platform,belanja,online,desain,sempurna,para,langgan,lebih,pilih,belanja,online,daripada,keluar,rumah,pandemi,fitur,paling,puji,aplikasi,kirim,besar,barang,pesan,tanggal,tentu,kirim,hari,ikut,memang,jadi,tumbuh,sukses,anda,berkelanjutan,senang,alam,biasa,terima,kasih,lazada,nasalazadayan', -1, '2022-05-24 17:01:40', 0),
(2026, 'Suka! memiliki aplikasi ini selama bertahun-tahun sekarang dan itu telah menjadi aplikasi saya ketika pandemi dimulai. Lazada membuatnya sangat nyaman dan terus menjadi lebih baik. Pengiriman cepat, produk asli (LazMall) dengan harga terjangkau. Anda bisa mendapatkan lebih banyak diskon! Bantuan yang begitu besar. Ini adalah APP HARUS yang harus dimiliki setiap orang.', 'suka,milik,aplikasi,selama,bertahuntahun,telah,jadi,aplikasi,ketika,pandemi,mulai,lazada,buat,nyaman,terus,jadi,lebih,baik,kirim,cepat,produk,asli,lazmall,harga,jangkau,anda,dapat,lebih,banyak,diskon,bantu,besar,app,harus,harus,milik,tiap,orang', -1, '2022-05-24 17:01:41', 0),
(2027, 'Situs belanja online yang mudah dinavigasi.. pemenang untuk setiap game jelas dan terutama mekanismenya. Saya suka promosi dan diskon yang ditawarkan. Saya pikir satu-satunya kejatuhan adalah goyang itu. Ada saat-saat itu tidak muncul bahkan jika sudah waktunya untuk mengguncangnya. Juga voucher P1, mungkin bisa diganti dengan dompet lazada P1? Atau mungkin kita bisa menggunakan beberapa voucher P1 dalam satu transaksi agar bermanfaat. Atau mungkin Anda dapat mengizinkannya digunakan untuk sumbangan? Terima kasih.', 'situs,belanja,online,mudah,navigasi,menang,tiap,game,jelas,utama,mekanisme,suka,promosi,diskon,ditawarkan,pikir,satusatu,jatuh,goyang,ada,saatsaat,tidak,muncul,bahkan,sudah,waktu,guncang,voucher,p,ganti,dompet,lazada,p,guna,beberapa,voucher,p,satu,transaksi,manfaat,anda,dapat,izin,guna,sumbang,terima,kasih', -1, '2022-05-24 17:01:41', 0),
(2028, 'Aplikasi ini luar biasa! Ini jelas menunjukkan kebutuhan pelanggan. Ini juga memiliki daftar bersih dari hal-hal yang membuatnya dapat diakses dan mudah digunakan. Lazada juga memberikan tanggapan yang tepat dalam tindakan layanan pelanggan mereka. Ini sangat disarankan untuk digunakan karena keamanan Anda juga terjamin dan semua yang Anda butuhkan tersedia. #NasaLazadaYan #SureKaSaLazada', 'aplikasi,biasa,jelas,tunjuk,butuh,langgan,milik,daftar,bersih,halhal,buat,dapat,akses,mudah,guna,lazada,berik,tanggap,tepat,tindak,layan,langgan,saran,guna,aman,anda,jamin,semua,anda,butuh,sedia,nasalazadayan,surekasalazada', -1, '2022-05-24 17:01:42', 0),
(2029, 'Ada suatu masa ketika belanja online hanyalah impian bagi orang-orang. Mereka hanya membayangkan dan menginginkan cara berbelanja yang nyaman yang bisa dilakukan hanya dengan duduk di rumah dan tidak perlu bekerja keras dengan pergi ke toko. Dengan cara ini Lazada datang dan memberi kami cara belanja online yang sangat mudah dan nyaman. Berbelanja melalui Lazada sekarang adalah cara termudah yang bisa dilakukan siapa saja.', 'ada,suatu,masa,ketika,belanja,online,impi,orangorang,bayang,ingin,cara,belanja,nyaman,laku,duduk,rumah,tidak,perlu,kerja,keras,pergi,toko,cara,lazada,datang,beri,cara,belanja,online,mudah,nyaman,belanja,lazada,cara,mudah,laku,siapa,saja', -1, '2022-05-24 17:01:42', 0),
(2030, 'Pengalaman itu bagus. Sangat mudah untuk menemukan barang yang saya inginkan dan ada banyak voucher dan pengiriman gratis yang membuat pembelian saya jauh lebih murah daripada membelinya di toko fisik. Layanan pelanggan juga sangat responsif dan aplikasi itu sendiri sangat mudah digunakan.', 'alam,bagus,mudah,temu,barang,ingin,ada,banyak,voucher,kirim,gratis,buat,beli,jauh,lebih,murah,daripada,beli,toko,fisik,layan,langgan,responsif,aplikasi,sendiri,mudah,guna', -1, '2022-05-24 17:01:42', 0),
(2031, 'Lazada adalah salah satu e-commerce terbaik yang kami miliki di Filipina. Karena intuitif, itu akan memudahkan Anda untuk membeli apa pun yang Anda butuhkan dan apa pun yang Anda inginkan, dan Anda akan senang menggunakannya karena fitur-fiturnya. Mulai dari giveaway, voucher, games, diskon, hingga layanannya.', 'lazada,salah,satu,ecommerce,baik,milik,filipina,intuitif,mudah,anda,beli,anda,butuh,anda,ingin,anda,senang,guna,fiturfitur,mulai,giveaway,voucher,games,diskon,hingga,layan', 1, '2022-05-24 17:01:42', 0),
(2032, 'Saya mulai menggunakan aplikasi ini enam atau lima tahun yang lalu dan sampai sekarang saya masih sangat puas karena ini adalah aplikasi yang sangat andal. Anda dapat menggunakan aplikasi dengan lancar, memiliki produk yang terjangkau, pilihan yang luas dan banyak promo dan penawaran. Opsi pembayaran sangat aman, layanan purna jual dan komunitas rekan lazada yang hebat! Lima bintang untuk Aplikasi Lazada!', 'mulai,guna,aplikasi,enam,lima,tahun,sampai,masih,puas,aplikasi,andal,anda,dapat,guna,aplikasi,lancar,milik,produk,jangkau,pilih,luas,banyak,promo,awar,opsi,bayar,aman,layan,purna,jual,komunitas,rekan,lazada,hebat,lima,bintang,aplikasi,lazada', -1, '2022-05-24 17:01:43', 0),
