(2060, 'Saya telah menggunakan LAZADA dan senang berbelanja di sini. Barangnya bagus dan pengirimannya juga sangat cepat. Anda dengan mudah mendapatkan apa yang Anda butuhkan', 'telah,guna,lazada,senang,belanja,sini,barang,bagus,kirim,cepat,anda,mudah,dapat,anda,butuh', 1, '2022-05-24 17:01:51', 0),
(2061, 'Saya juga suka lazada tapi pengirimannya terlalu tinggi dibandingkan dengan Shopee. Saya bisa mendapatkan gratis ongkos kirim dan diskon di Shopee tetapi saya belum pernah mengalaminya. di Lazada. Tapi saya tidak menyesal membeli barang di sini karena sebagian besar produk yang mereka jual adalah legit dan asli, dan terkadang pengemasannya rapat dan aman', 'suka,lazada,kirim,tinggi,banding,shopee,dapat,gratis,ongkos,kirim,diskon,shopee,belum,alami,lazada,tidak,sesal,beli,barang,sini,besar,produk,jual,legit,asli,kadang,emas,rapat,aman', 1, '2022-05-24 17:01:51', 0),
(2062, 'Saya akan menilai aplikasi Lazada 5 bintang. Aplikasi ini sangat lancar untuk digunakan dan saya perhatikan bahwa bug yang ada di sini sebelumnya telah diperbaiki. Saya menghemat uang saat checkout di Lazada karena selalu ada voucher di sini dan pengiriman gratis terutama pada penjualan khusus seperti 7.7 atau Obral Payday. Aplikasi ini memiliki banyak fitur seperti LazLive dan LazCoin. Bermain game di sini juga seru karena selain seru, ada potongan harga yang bisa kamu gunakan untuk checkout item.', 'nilai,aplikasi,lazada,bintang,aplikasi,lancar,guna,hati,bug,ada,sini,belum,telah,baik,hemat,uang,checkout,lazada,ada,voucher,sini,kirim,gratis,utama,jual,khusus,seperti,obral,payday,aplikasi,milik,banyak,fitur,seperti,lazlive,lazcoin,main,game,sini,seru,selain,seru,ada,potong,harga,kamu,guna,checkout,item', -1, '2022-05-24 17:01:52', 0),
(2063, 'Saya suka betapa ramahnya antarmuka pengguna Lazada. Aplikasi mudah dinavigasi dan tidak banyak bug. Saya merasa nyaman, saya dapat dengan mudah mencari dan membeli barang yang saya inginkan. Plus, Lazada menawarkan begitu banyak penawaran dan promo hebat. Secara keseluruhan ini layak 10 bintang!', 'suka,betapa,ramah,antarmuka,guna,lazada,aplikasi,mudah,navigasi,tidak,banyak,bug,rasa,nyaman,dapat,mudah,cari,beli,barang,ingin,plus,lazada,awar,banyak,awar,promo,hebat,cara,seluruh,layak,bintang', -1, '2022-05-24 17:01:52', 0),
(2064, 'Salah satu platform e-commerce terbaik di luar sana. Mereka juga memberikan banyak diskon dan potongan harga setiap kali Anda berinteraksi dengan aplikasi. Yang mengatakan, Anda mendapatkan lebih banyak item dengan cara yang lebih sedikit!', 'salah,satu,platform,ecommerce,baik,sana,berik,banyak,diskon,potong,harga,tiap,kali,anda,interaksi,aplikasi,atak,anda,dapat,lebih,banyak,item,cara,lebih,sedikit', -1, '2022-05-24 17:01:52', 0),
(2065, 'Aplikasi ini terus ditingkatkan. Ini mungkin memiliki beberapa bug tetapi mereka memperbaikinya dan terus meningkatkannya sehingga kami dapat terus menikmati menggunakannya. Juga, aplikasi ini sangat berguna terutama di masa pandemi ini di mana Anda dapat menemukan sebagian besar kebutuhan sehari-hari Anda di aplikasi.', 'aplikasi,terus,tingkat,milik,beberapa,bug,baik,terus,tingkat,sehingga,dapat,terus,nikmat,guna,aplikasi,guna,utama,masa,pandemi,mana,anda,dapat,temu,besar,butuh,seharihari,anda,aplikasi', -1, '2022-05-24 17:01:53', 0),
(2066, 'Pelanggan puas disini. Ada banyak pilihan untuk dipilih. Biaya pengiriman rendah. Kualitas produk yang baik dan tindakan cepat dalam hal pesanan. Secara keseluruhan. Bagus Lazada.', 'langgan,puas,sini,ada,banyak,pilih,pilih,biaya,kirim,rendah,kualitas,produk,baik,tindak,cepat,hal,pesan,cara,seluruh,bagus,lazada', -1, '2022-05-24 17:01:53', 0),
(2067, 'Aplikasi belanja terbaik. Saya biasanya membeli barang menggunakan refferal saya. Dan itu gratis. Tidak ada kerumitan. Pengiriman tepat waktu. Dan lebih banyak diskon dan voucher.', 'aplikasi,belanja,baik,biasa,beli,barang,guna,refferal,gratis,tidak,ada,kerumit,kirim,tepat,waktu,lebih,banyak,diskon,voucher', -1, '2022-05-24 17:01:53', 0),
(2068, 'Tidak dapat disangkal, Lazada adalah salah satu aplikasi Belanja terbaik di pasar saat ini. Selain pengalaman berbelanja yang aman, Lazada menawarkan banyak diskon dan voucher yang akan menghemat banyak uang Anda!! Semua yang Anda cari, Anda dapat menemukannya di Lazada! Dari sembako, pakaian, peralatan rumah tangga, kebutuhan rumah tangga, bahkan pembayaran tagihan dan barang digital sudah tersedia tepat di depan Anda. Saya sangat berharap Lazada akan terus melakukan yang terbaik untuk para pembelinya! Semua yang terbaik!', 'tidak,dapat,sangkal,lazada,salah,satu,aplikasi,belanja,baik,pasar,selain,alam,belanja,aman,lazada,awar,banyak,diskon,voucher,hemat,banyak,uang,anda,semua,anda,cari,anda,dapat,temu,lazada,sembako,pakai,ralat,rumah,tangga,butuh,rumah,tangga,bahkan,bayar,tagih,barang,digital,sudah,sedia,tepat,depan,anda,harap,lazada,terus,laku,baik,para,beli,semua,baik', -1, '2022-05-24 17:01:53', 0),
(2069, 'Platform online yang sangat bagus. Banyak sekali barang yang harganya lebih murah dari supermarket, outlet, dll apalagi jika ditukarkan dengan kupon LAZADA.', 'platform,online,bagus,banyak,sekali,barang,harga,lebih,murah,supermarket,outlet,dll,apalagi,tukar,kupon,lazada', -1, '2022-05-24 17:01:53', 0),
(2070, 'Aplikasi ini sangat membantu ketika Anda ingin berbelanja tanpa repot dan sangat mudah digunakan! Mereka juga memiliki komunitas besar yang dapat Anda ikuti untuk membantu Anda dengan pertanyaan dan permainan menyenangkan lainnya serta berbagi kiat kepada pembeli dan penjual', 'aplikasi,bantu,ketika,anda,ingin,belanja,tanpa,repot,mudah,guna,milik,komunitas,besar,dapat,anda,ikut,bantu,anda,tanya,main,senang,lain,kiat,beli,jual', -1, '2022-05-24 17:01:54', 0),
(2071, 'Aplikasi ini mudah digunakan.. Penjualnya akomodatif dan petugas pengiriman menangani paket dengan hati-hati. (Yah, saya sangat beruntung saya berbelanja di penjual yang tepat. Satu-satunya masalah yang saya temui adalah pengiriman yang tertunda tapi itu bisa dimengerti karena Saya memesannya secara internasional.', 'aplikasi,mudah,guna,jual,akomodatif,tugas,kirim,tangan,paket,hatihati,yah,untung,belanja,jual,tepat,satusatu,masalah,temu,kirim,tunda,dimengerti,mesan,cara,internasional', -1, '2022-05-24 17:01:54', 0),
(2072, 'Aplikasi ini sangat nyaman digunakan dalam belanja online Anda. Mudah dinavigasi dan ramah pengguna. Ini memiliki produk yang lebih otentik dan murah yang dapat Anda beli.', 'aplikasi,nyaman,guna,belanja,online,anda,mudah,navigasi,ramah,guna,milik,produk,lebih,otentik,murah,dapat,anda,beli', -1, '2022-05-24 17:01:54', 0),
(2073, 'Meskipun terakhir kali saya membeli remote control saya tidak puas, namun saya akan tetap memberi peringkat 5 bintang karena ini baru pertama kali saya temui.. selebihnya puas..', 'meski,akhir,kali,beli,remote,control,tidak,puas,beri,peringkat,bintang,baru,pertama,kali,temu,lebih,puas', 1, '2022-05-24 17:01:54', 0);
